INSERT INTO `ai_chat_message` VALUES (2420, 1781604279872581728, 2419, 1, NULL, 'assistant', 'deepseek-chat', 17, '当然可以！以下是一个简单的 Java 实现的选择排序算法。选择排序是一种直观的排序算法，它通过重复地从未排序部分找到最小元素并将其放到已排序部分的末尾来工作。\n\n```java\npublic class SelectionSort {\n    public static void main(String[] args) {\n        int[] array = {64, 34, 25, 12, 22, 11, 90};\n        selectionSort(array);\n        System.out.println(\"Sorted array:\");\n        printArray(array);\n    }\n\n    // 选择排序算法\n    public static void selectionSort(int[] array) {\n        int n = array.length;\n        for (int i = 0; i < n - 1; i++) {\n            // 找到未排序部分的最小元素的索引\n            int minIndex = i;\n            for (int j = i + 1; j < n; j++) {\n                if (array[j] < array[minIndex]) {\n                    minIndex = j;\n                }\n            }\n            // 交换找到的最小元素与第一个未排序元素\n            int temp = array[minIndex];\n            array[minIndex] = array[i];\n            array[i] = temp;\n        }\n    }\n\n    // 打印数组\n    public static void printArray(int[] array) {\n        for (int i : array) {\n            System.out.print(i + \" \");\n        }\n        System.out.println();\n    }\n}\n```\n\n这个选择排序算法的时间复杂度是 O(n^2)，在最坏的情况下（即输入数组完全逆序），它需要进行 n*(n-1)/2 次比较。尽管它不是最高效的排序算法，但它的实现简单，易于理解。\n\n如果您需要更高效的排序算法，可以考虑使用快速排序（QuickSort）、归并排序（MergeSort）或堆排序（HeapSort），它们的时间复杂度通常为 O(n log n)。', b'1', NULL, '1', '2024-07-29 21:10:23', NULL, '2024-07-29 21:10:48', b'0', 1);
