INSERT INTO `ai_chat_message` VALUES (2574, 1781604279872581765, 2573, 1, 16, 'assistant', 'qwen:4b', 21, '以下是 Yudao 技术栈的相关介绍：\n\n1. **Java SDK**：\n   Yudao 提供了 Java SDK，用于开发、部署Yudao服务。通过使用Java SDK，您可以轻松地利用Yudao的所有功能。\n\n2. **数据库访问（SQLA）库支持**：\n   Yudao 提供了 SQLA 账支持，支持在 Java 中使用 JdbcTemplate 来执行 SQL语句操作的功能。\n\n3. **Spring框架集成**：\n   Yudao 提供了 Spring 框架的 Spring Bean 的管理功能，支持在 Java 中使用 Spring Bean 来完成 SpringBean对象管理功能的操作的功能。\n\n4. **Laravel框架集成**：\n   Yudao 提供了 Laravel 框架的 Laravel Beans 的管理功能，支持在 Java 中使用 Laravel Beans 来完成 LaravelBeans对象管理功能的操作的功能。\n\n5. **WebSocket集成**：\n   Yudao 提供了 WebSocket 框架的 websocket.js 依赖的功能，支持在 JavaScript 中使用 websocket.js 来实现WebSocket操作的功能的操作的功能。\n\n6. **微服务集成**：\n   Yudao 提供了 Spring Cloud Microservices 框架的 microservice-maven-plugin 依赖的功能，支持在 Java 中使用 microservice-maven-plugin 来实现微服务构建及管理操作的功能的操作的功能。', b'1', '164,162,169', '1', '2025-03-09 18:51:12', NULL, '2025-03-09 18:51:26', b'0', 1);
