INSERT INTO `ai_chat_message` VALUES (2582, 1781604279872581765, 2581, 1, 16, 'assistant', 'generalv3.5', 13, 'Yudao的技术栈包括以下几部分：\n\n### 依赖管理\n- **`yudao-dependencies`**：用于Maven依赖版本管理。\n\n### 框架拓展\n- **`yudao-framework`**：Java框架的拓展。\n\n### 服务端\n- **`yudao-server`**：管理后台和用户APP的服务端。\n\n### 用户界面\n- **`yudao-ui-admin`**：用户界面的管理员部分。\n\n### 监控与日志\n- **Java监控**：基于Spring Boot Admin实现Java应用的监控。\n- **链路追踪**：接入SkyWalking组件，实现链路追踪。\n- **日志中心**：接入SkyWalking组件，实现日志中心。\n\n### 分布式系统\n- **分布式锁**：基于Redis实现分布式锁，满足并发场景。\n- **幂等组件**：基于Redis实现幂等组件，解决重复请求问题。\n- **服务保障**：基于Resilience4j实现服务的稳定性，包括限流、熔断等功能。\n- **轻量级日志中心**：查看远程服务器的日志。\n\n### 测试\n- **单元测试**：基于JUnit + Mockito实现单元测试，保证功能的正确性和代码的质量。\n\n### 数据报表与大屏设计\n- **报表设计器**：支持数据报表、图形报表、打印设计等。\n- **大屏设计器**：建设中，拖拽式实现可视化数据大屏。\n\n### 敏感词与应用管理\n- **敏感词**：配置系统敏感词，支持标签分组。\n- **应用管理**：管理SSO单点登录的应用，支持多种OAuth2授权方式。\n\n### 工作流程\n- **流程模型**：配置工作流的流程模型，支持文件导入与在线设计流程图，提供7种任务分配规则。\n- **流程表单**：拖动表单元素生成相应的工作流表单，覆盖Element UI所有的表单组件。\n- **用户分组**：自定义用户分组，可用于工作流的审批分组。\n- **我的流程**：查看我发起的工作流程，支持新建、取消流程等操作，高亮流程图、审批时间线。\n- **待办任务**：查看自己未审批的工作任务，支持通过、不通过、转发、委派、退回等操作。\n- **已办任务**：查看自己已审批的工作任务，未来会支持回退操作。\n- **OA请假**：作为业务自定义接入工作流的使用示例，只需创建请求对应的工作流程，即可进行审批。\n\n### 支付系统\n- **商户信息**：管理商户信息，支持Saas场景下的多商户功能。\n- **应用信息**：配置商户的应用信息，对接支付宝、微信等多个支付渠道。', b'1', '164,170,162', '1', '2025-03-09 18:54:50', NULL, '2025-03-09 18:55:12', b'0', 1);
