INSERT INTO `ai_knowledge_document` VALUES (15, 2, 'Java开发工程师-xxx .docx', 'http://test.yudao.iocoder.cn/8905418ef0076f1817bee7fda02175ed694a8694f80a6c27a7a973f07ae41158.docx', '个人简历\n\n基本资料 \n姓    名： 	岳晓威 	出生年月： 	1992.09.26 \n手    机： 	17326899616 	邮      箱： 	17326899616yxw@sina.com \n工作经验：	7年	语言能力：	CET4，读写熟练\n\n求职意向 \n期望职位： 	Java开发工程师           期望薪资：            面议 \n\n工作经历 \n2019.02-至今	中电金信软件有限公司\n2016.06-2019.02	英大清源(北京)科技有限公司 \n工作职责： 	\n1. 负责所属模块的关键逻辑代码开发\n2. 独立负责基础架构及相关表结构的设计并协调团队开发 \n3. 协助测试人员完成软件系统及模块的测试，定位、修复程序缺陷\n4. 对所开发的产品进行版本更新及维护，以满足业务运营要求 \n\n教育经历\n河北工程大学（ 2012.09 - 2016.06 ） \n专业名称：	计算机科学与技术 	学历：	统招本科 	 	 \n专业技能 \n* 精通Java基础、集合框架、并发编程、JVM，有实际调优经验\n* 精通锁（单机到分布式）\n* 精通事务（单机到分布式）\n* 熟练使用Spring、SpringMVC、Mybatis等主流开源应用框架 \n* 熟练使用git版本管理工具以及maven项目构建工具 \n* 熟悉分布式架构\n* 熟悉MySQL以及数据库调优、SQL优化\n* 熟悉基本的数据机构和算法，了解多线程编程和异步IO编程以及常用线程同步机制\n* 熟练使用网络通信以及HTTP、TCP/IP、UDP通信协议\n* 熟悉Linux环境，了解Linux下Java项目的部署以及优化\n* 熟悉单例模式、代理模式、模板方法模式、工厂模式\n* 熟悉SpringBoot、SpringCloud\n* 了解RabbitMQ、Redis、ElasticSearch、Ngnix、Zookeeper中间件   \n项目经历 \n统计微讯报表服务	\n项目描述：本项目拟在优化数据服务定制功能，开发可向业务部门用户开放基于指标的内容快捷定制功能，降低业务用户使用指标数据资源的技术门槛，拓展数据服务用户群，提高指标资源的利用率，充分发挥其作为重要的移动端数据服务渠道的价值，为我行数字化转型做出贡献；强化系统管理力度、细化管理粒度，实现对移动数据服务全流程管理，增强应急情况处理能力，提升数据服务体验。\n	开发技术：	SpringBoot+SpringCloud+Spring + Mybatis+MySQL+Redis+RabbitMQ+Vue+Activiti\n项目职责：	带领团队实现微信息定制、消息状态监控、消息推送模块\n	微信息定制包括选择模板、选择指标、添加指标校验规则、选择推送人员名单、选择推送时间、选择推送频次，微信息定制完成后，经过流程审批进入消息测试发送状态，待消息审批人确认通过后，进入正式推送状态。\n       消息状态监控包括数仓上游ETL任务加工状态、数仓ETL任务加工状态、数据下载、数据校验、生成消息、消息推送。如果某个状态出现异常，即推送异常通知消息给业务部门管理人员\n       消息推送包括根据微信息定制中配置的推送人员名单和推送频次以及推送时间，进行消息定点推送。\n\n公司业务数字化营销支持平台	\n项目描述：	为顺应“互联网+”新形势，应对经济周期性调整以及利率市场化和金融脱媒化带来的冲击，进一步提升民生银行公司条线客户服务能力，提高前中后台各部门运行效率，按照行领导“加强公司条线信息管理系统整合”，“打造业界先进的公司业务数字化营销支持平台”开发的公司业务数字营销支持平台\n本系统一共有八大业务组件，客户中心、客群中心、决策支持中心、营销支持中心、营销管理中心、营销作业中心、线上协同中心、业务消息中心；两大目标：营销数字化转型、服务数字化转型；三大核心定位：管理平台、作业平台、信息平台；三大系统功能：数字化营销管理、线上化营销作业、智能化决策支持；六大基础维度：客户、客群、机构、团队、员工、产品\n	开发技术：	SpringBoot+SpringCloud+Spring + Mybatis+MySQL\n项目职责：	本人主要负责八大业务组件中的线上协同中心，线上协同不仅是单独的一个业务组件，可以配合其他组件实现一些业务需求，线上协同包含三大元素，报送、载体、指标，线上协同有一个模板配置，因为有了模板配置，所以报送非常灵活，可以针对各种业务需求进行相应的配置生成报送，给分行以及支行相关人员进行报送\n模板配置包括业务模板配置和流程模板配置，业务模板配置包括基础属性和扩展属性，可以配置报送相关的参数，载体的具体内容，指标的具体内容，流程模板配置包括流程图的配置，流程节点相关配置、流程业务单元配置\n报送配置包括报送列表、报送明细、报送简版、业务数据汇总、子工单、报送统计，报送列表展示的是所有的报送任务，查看权限是机构向下的，报送明细展示的是报送所有的指标以横向排列，报送简版展示的是所有报送指标以纵向排列，业务数据汇总展示的是报送所有数值类型的指标值的汇总，子工单展示的所有报送任务的子任务，报送统计展示的是所有报送状态的数量\n\n北京建工集团法律风险管理信息系统	\n项目描述：	北京建工集团作为一家大型工程承包商，难免会和第三方产生合同纠纷，甚至在法庭上打官司，尤其是合同的数据量是非常庞大的，很难全部人为得来管理，为了让法务管理信息化，法律风险信息系统应运而生，此系统极大方便了合同信息的管理，在系统中就可以处理合同以及合同引起的法律纠纷的登记审批流程，无需再为了合同及其法律纠纷的审批来回跑各个部门。 .                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               \n开发技术：	SpringBoot+Spring +Mybatis+MySQL+Swagger2+Redis\n项目职责：	本人负责系统管理下的纠纷管理、案件管理、合同管理、律师管理信息管理四个子模块\n合同管理实现的功能是合同新增、合同编辑、合同用印、合同生效、合同归档、动态模糊查询。合同都是基于项目发起的，纠纷及案件也是在有了合同的前提下而建立的。\n    纠纷管理，未进入（仲裁）程序的为非诉，非诉登记完毕以后，选择发文审批或者收文上报，发文审批是建工作为原告、需要经过部门领导的审批真正发起非诉，收文上报是建工作为被告，需要经过领导的审批确认，非诉案件如果严重的话，可以直接转为诉讼案件\n诉讼管理，进入（仲裁）程序的为诉讼，也就是说是需要在法院打官司的，登记完基本信息以后，需要添加过程记录，来表示案件进入什么状态 \n	律师管理实现的功能是律师以及律所的增加、删除、修改、动态模糊查询\n自我评价 \n具有较强的分析、解决问题能力，方案设计以及持续学习和业务推进能力\n良好的团队协作精神、具备一定的自我驱动力，能独立承担任务和有系统进度把控能力\n\n', 3436, 2522, 500, 0, 0, '1', '2025-03-03 09:33:43', '1', '2025-03-09 18:50:01', b'1', 1);
INSERT INTO `ai_knowledge_document` VALUES (16, 3, 'README_yudao.md', 'http://test.yudao.iocoder.cn/167d6d2372997b1fc0ac52c0756bc4bc2a5e84a690ecc8fa2f8c56ecc3adc788.md', '<p align=\"center\">\n <img src=\"https://img.shields.io/badge/Spring%20Boot-3.4.1-blue.svg\" alt=\"Downloads\">\n <img src=\"https://img.shields.io/badge/Vue-3.2-blue.svg\" alt=\"Downloads\">\n <img src=\"https://img.shields.io/github/license/YunaiV/ruoyi-vue-pro\" alt=\"Downloads\" />\n</p>\n\n**严肃声明：现在、未来都不会有商业版本，所有代码全部开源!！**\n\n**「我喜欢写代码，乐此不疲」**  \n**「我喜欢做开源，以此为乐」**\n\n我 🐶 在上海艰苦奋斗，早中晚在 top3 大厂认真搬砖，夜里为开源做贡献。\n\n如果这个项目让你有所收获，记得 Star 关注哦，这对我是非常不错的鼓励与支持。\n\n## 🐶 新手必读\n\n* 演示地址【Vue3 + element-plus】：<http://dashboard-vue3.yudao.iocoder.cn>\n* 演示地址【Vue3 + vben(ant-design-vue)】：<http://dashboard-vben.yudao.iocoder.cn>\n* 演示地址【Vue2 + element-ui】：<http://dashboard.yudao.iocoder.cn>\n* 启动文档：<https://doc.iocoder.cn/quick-start/>\n* 视频教程：<https://doc.iocoder.cn/video/>\n\n## 🐰 版本说明\n\n| 版本                                                                  | JDK 8 + Spring Boot 2.7                                                   | JDK 17/21 + Spring Boot 3.2                                                           |\n|---------------------------------------------------------------------|---------------------------------------------------------------------------|---------------------------------------------------------------------------------------|\n| 【完整版】[ruoyi-vue-pro](https://gitee.com/zhijiantianya/ruoyi-vue-pro) | [`master`](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/) 分支 | [`master-jdk17`](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master-jdk17/) 分支 |\n| 【精简版】[yudao-boot-mini](https://gitee.com/yudaocode/yudao-boot-mini) | [`master`](https://gitee.com/yudaocode/yudao-boot-mini/tree/master/) 分支   | [`master-jdk17`](https://gitee.com/yudaocode/yudao-boot-mini/tree/master-jdk17/) 分支   |\n\n* 【完整版】：包括系统功能、基础设施、会员中心、数据报表、工作流程、商城系统、微信公众号、CRM、ERP 等功能\n* 【精简版】：只包括系统功能、基础设施功能，不包括会员中心、数据报表、工作流程、商城系统、微信公众号、CRM、ERP 等功能\n\n可参考 [《迁移文档》](https://doc.iocoder.cn/migrate-module/) ，只需要 5-10 分钟，即可将【完整版】按需迁移到【精简版】\n\n## 🐯 平台简介\n\n**芋道**，以开发者为中心，打造中国第一流的快速开发平台，全部开源，个人与企业可 100% 免费使用。\n\n> 有任何问题，或者想要的功能，可以在 _Issues_ 中提给艿艿。\n>\n> 😜 给项目点点 Star 吧，这对我们真的很重要！\n\n![架构图](/.image/common/ruoyi-vue-pro-architecture.png)\n\n* Java 后端：`master` 分支为 JDK 8 + Spring Boot 2.7，`master-jdk17` 分支为 JDK 17/21 + Spring Boot 3.2\n* 管理后台的电脑端：Vue3 提供 `element-plus`、`vben(ant-design-vue)` 两个版本，Vue2 提供 `element-ui` 版本\n* 管理后台的移动端：采用 `uni-app` 方案，一份代码多终端适配，同时支持 APP、小程序、H5！\n* 后端采用 Spring Boot 多模块架构、MySQL + MyBatis Plus、Redis + Redisson\n* 数据库可使用 MySQL、Oracle、PostgreSQL、SQL Server、MariaDB、国产达梦 DM、TiDB 等\n* 消息队列可使用 Event、Redis、RabbitMQ、Kafka、RocketMQ 等\n* 权限认证使用 Spring Security & Token & Redis，支持多终端、多种用户的认证系统，支持 SSO 单点登录\n* 支持加载动态权限菜单，按钮级别权限控制，Redis 缓存提升性能\n* 支持 SaaS 多租户，可自定义每个租户的权限，提供透明化的多租户底层封装\n* 工作流使用 Flowable，支持动态表单、在线设计流程、会签 / 或签、多种任务分配方式\n* 高效率开发，使用代码生成器可以一键生成 Java、Vue 前后端代码、SQL 脚本、接口文档，支持单表、树表、主子表\n* 实时通信，采用 Spring WebSocket 实现，内置 Token 身份校验，支持 WebSocket 集群\n* 集成微信小程序、微信公众号、企业微信、钉钉等三方登陆，集成支付宝、微信等支付与退款\n* 集成阿里云、腾讯云等短信渠道，集成 MinIO、阿里云、腾讯云、七牛云等云存储服务\n* 集成报表设计器、大屏设计器，通过拖拽即可生成酷炫的报表与大屏\n\n##  🐳 项目关系\n\n![架构演进](/.image/common/yudao-roadmap.png)\n\n三个项目的功能对比，可见社区共同整理的 [国产开源项目对比](https://www.yuque.com/xiatian-bsgny/lm0ec1/wqf8mn) 表格。\n\n### 后端项目\n\n| 项目                                                              | Star                                                                                                                                                                                                                                                                                             | 简介                          |\n|-----------------------------------------------------------------|--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------|-----------------------------|\n| [ruoyi-vue-pro](https://gitee.com/zhijiantianya/ruoyi-vue-pro)  | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro)       | 基于 Spring Boot 多模块架构        |\n| [yudao-cloud](https://gitee.com/zhijiantianya/yudao-cloud)      | [![Gitee star](https://gitee.com/zhijiantianya/yudao-cloud/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/yudao-cloud) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/yudao-cloud.svg?style=social&label=Stars)](https://github.com/YunaiV/yudao-cloud)               | 基于 Spring Cloud 微服务架构       |\n| [Spring-Boot-Labs](https://gitee.com/yudaocode/SpringBoot-Labs) | [![Gitee star](https://gitee.com/yudaocode/SpringBoot-Labs/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/yudao-cloud) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/SpringBoot-Labs.svg?style=social&label=Stars)](https://github.com/yudaocode/SpringBoot-Labs) | 系统学习 Spring Boot & Cloud 专栏 |\n\n### 前端项目\n\n| 项目                                                                         | Star                                                                                                                                                                                                                                                                                                                     | 简介                                     |\n|----------------------------------------------------------------------------|--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------|----------------------------------------|\n| [yudao-ui-admin-vue3](https://gitee.com/yudaocode/yudao-ui-admin-vue3)     | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-admin-vue3/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-admin-vue3) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-admin-vue3.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-admin-vue3)         | 基于 Vue3 + element-plus 实现的管理后台         |\n| [yudao-ui-admin-vben](https://gitee.com/yudaocode/yudao-ui-admin-vben)     | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-admin-vben/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-admin-vben) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-admin-vben.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-admin-vben)         | 基于 Vue3 + vben(ant-design-vue) 实现的管理后台 |\n| [yudao-mall-uniapp](https://gitee.com/yudaocode/yudao-mall-uniapp)         | [![Gitee star](https://gitee.com/yudaocode/yudao-mall-uniapp/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-mall-uniapp) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-mall-uniapp.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-mall-uniapp)                 | 基于 uni-app 实现的商城小程序                    |\n| [yudao-ui-admin-vue2](https://gitee.com/yudaocode/yudao-ui-admin-vue2)     | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-admin-vue2/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-admin-vue2) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-admin-vue2.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-admin-vue2)         | 基于 Vue2 + element-ui 实现的管理后台           |\n| [yudao-ui-admin-uniapp](https://gitee.com/yudaocode/yudao-ui-admin-uniapp) | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-admin-uniapp/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-admin-uniapp) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-admin-uniapp.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-admin-uniapp) | 基于 Vue2 + element-ui 实现的管理后台           |\n| [yudao-ui-go-view](https://gitee.com/yudaocode/yudao-ui-go-view)           | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-go-view/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-go-view) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-go-view.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-go-view)                     | 基于 Vue3 + naive-ui 实现的大屏报表             |\n\n## 😎 开源协议\n\n**为什么推荐使用本项目？**\n\n① 本项目采用比 Apache 2.0 更宽松的 [MIT License](https://gitee.com/zhijiantianya/ruoyi-vue-pro/blob/master/LICENSE) 开源协议，个人与企业可 100% 免费使用，不用保留类作者、Copyright 信息。\n\n② 代码全部开源，不会像其他项目一样，只开源部分代码，让你无法了解整个项目的架构设计。[国产开源项目对比](https://www.yuque.com/xiatian-bsgny/lm0ec1/wqf8mn)\n\n![开源项目对比](/.image/common/project-vs.png)\n\n③ 代码整洁、架构整洁，遵循《阿里巴巴 Java 开发手册》规范，代码注释详细，113770 行 Java 代码，42462 行代码注释。\n\n## 🤝 项目外包\n\n我们也是接外包滴，如果你有项目想要外包，可以微信联系【**Aix9975**】。\n\n团队包含专业的项目经理、架构师、前端工程师、后端工程师、测试工程师、运维工程师，可以提供全流程的外包服务。\n\n项目可以是商城、SCRM 系统、OA 系统、物流系统、ERP 系统、CMS 系统、HIS 系统、支付系统、IM 聊天、微信公众号、微信小程序等等。\n\n## 🐼 内置功能\n\n系统内置多种多种业务功能，可以用于快速你的业务系统：\n\n![功能分层](/.image/common/ruoyi-vue-pro-biz.png)\n\n* 通用模块（必选）：系统功能、基础设施\n* 通用模块（可选）：工作流程、支付系统、数据报表、会员中心\n* 业务系统（按需）：ERP 系统、CRM 系统、商城系统、微信公众号、AI 大模型\n\n> 友情提示：本项目基于 RuoYi-Vue 修改，**重构优化**后端的代码，**美化**前端的界面。\n>\n> * 额外新增的功能，我们使用 🚀 标记。\n> * 重新实现的功能，我们使用 ⭐️ 标记。\n\n🙂 所有功能，都通过 **单元测试** 保证高质量。\n\n### 系统功能\n\n|     | 功能    | 描述                              |\n|-----|-------|---------------------------------|\n|     | 用户管理  | 用户是系统操作者，该功能主要完成系统用户配置          |\n| ⭐️  | 在线用户  | 当前系统中活跃用户状态监控，支持手动踢下线           |\n|     | 角色管理  | 角色菜单权限分配、设置角色按机构进行数据范围权限划分      |\n|     | 菜单管理  | 配置系统菜单、操作权限、按钮权限标识等，本地缓存提供性能    |\n|     | 部门管理  | 配置系统组织机构（公司、部门、小组），树结构展现支持数据权限  |\n|     | 岗位管理  | 配置系统用户所属担任职务                    |\n| 🚀  | 租户管理  | 配置系统租户，支持 SaaS 场景下的多租户功能        |\n| 🚀  | 租户套餐  | 配置租户套餐，自定每个租户的菜单、操作、按钮的权限       |\n|     | 字典管理  | 对系统中经常使用的一些较为固定的数据进行维护          |\n| 🚀  | 短信管理  | 短信渠道、短息模板、短信日志，对接阿里云、腾讯云等主流短信平台 |\n| 🚀  | 邮件管理  | 邮箱账号、邮件模版、邮件发送日志，支持所有邮件平台       |\n| 🚀  | 站内信   | 系统内的消息通知，提供站内信模版、站内信消息          |\n| 🚀  | 操作日志  | 系统正常操作日志记录和查询，集成 Swagger 生成日志内容 |\n| ⭐️  | 登录日志  | 系统登录日志记录查询，包含登录异常               |\n| 🚀  | 错误码管理 | 系统所有错误码的管理，可在线修改错误提示，无需重启服务     |\n|     | 通知公告  | 系统通知公告信息发布维护                    |\n| 🚀  | 敏感词   | 配置系统敏感词，支持标签分组                  |\n| 🚀  | 应用管理  | 管理 SSO 单点登录的应用，支持多种 OAuth2 授权方式 |\n| 🚀  | 地区管理  | 展示省份、城市、区镇等城市信息，支持 IP 对应城市      |\n\n![功能图](/.image/common/system-feature.png)\n\n### 工作流程\n\n|    | 功能    | 描述                                      |\n|----|-------|-----------------------------------------|\n| 🚀 | 流程模型  | 配置工作流的流程模型，支持 BPMN 和仿钉钉/飞书设计器           |\n| 🚀 | 流程表单  | 拖动表单元素生成相应的工作流表单，覆盖 Element UI 所有的表单组件  |\n| 🚀 | 用户分组  | 自定义用户分组，可用于工作流的审批分组                     |\n| 🚀 | 我的流程  | 查看我发起的工作流程，支持新建、取消流程等操作，高亮流程图、审批时间线     |\n| 🚀 | 待办任务  | 查看自己【未】审批的工作任务，支持通过、不通过、转派、委派、退回、加减签等操作 |\n| 🚀 | 已办任务  | 查看自己【已】审批的工作任务，支持流程预测，展示未来审批人信息         |\n| 🚀 | OA 请假 | 作为业务自定义接入工作流的使用示例，只需创建请求对应的工作流程，即可进行审批  |\n\n![功能图](/.image/common/bpm-feature.png)\n\n| BPMN 设计器                     | 钉钉/飞书设计器                       |\n|------------------------------|--------------------------------|\n| ![](/.image/工作流设计器-bpmn.jpg) | ![](/.image/工作流设计器-simple.jpg) |\n\n### 支付系统\n\n|     | 功能   | 描述                        |\n|-----|------|---------------------------|\n| 🚀  | 应用信息 | 配置商户的应用信息，对接支付宝、微信等多个支付渠道 |\n| 🚀  | 支付订单 | 查看用户发起的支付宝、微信等的【支付】订单     |\n| 🚀  | 退款订单 | 查看用户发起的支付宝、微信等的【退款】订单     |\n| 🚀  | 回调通知 | 查看支付回调业务的【支付】【退款】的通知结果    |\n| 🚀  | 接入示例 | 提供接入支付系统的【支付】【退款】的功能实战    |\n\n### 基础设施\n\n|     | 功能        | 描述                                           |\n|-----|-----------|----------------------------------------------|\n| 🚀  | 代码生成      | 前后端代码的生成（Java、Vue、SQL、单元测试），支持 CRUD 下载       |\n| 🚀  | 系统接口      | 基于 Swagger 自动生成相关的 RESTful API 接口文档          |\n| 🚀  | 数据库文档     | 基于 Screw 自动生成数据库文档，支持导出 Word、HTML、MD 格式      |\n|     | 表单构建      | 拖动表单元素生成相应的 HTML 代码，支持导出 JSON、Vue 文件         |\n| 🚀  | 配置管理      | 对系统动态配置常用参数，支持 SpringBoot 加载                 |\n| ⭐️  | 定时任务      | 在线（添加、修改、删除)任务调度包含执行结果日志                     |\n| 🚀  | 文件服务      | 支持将文件存储到 S3（MinIO、阿里云、腾讯云、七牛云）、本地、FTP、数据库等   | \n| 🚀  | WebSocket | 提供 WebSocket 接入示例，支持一对一、一对多发送方式              | \n| 🚀  | API 日志    | 包括 RESTful API 访问日志、异常日志两部分，方便排查 API 相关的问题   |\n|     | MySQL 监控  | 监视当前系统数据库连接池状态，可进行分析SQL找出系统性能瓶颈              |\n|     | Redis 监控  | 监控 Redis 数据库的使用情况，使用的 Redis Key 管理           |\n| 🚀  | 消息队列      | 基于 Redis 实现消息队列，Stream 提供集群消费，Pub/Sub 提供广播消费 |\n| 🚀  | Java 监控   | 基于 Spring Boot Admin 实现 Java 应用的监控           |\n| 🚀  | 链路追踪      | 接入 SkyWalking 组件，实现链路追踪                      |\n| 🚀  | 日志中心      | 接入 SkyWalking 组件，实现日志中心                      |\n| 🚀  | 服务保障      | 基于 Redis 实现分布式锁、幂等、限流功能，满足高并发场景              |\n| 🚀  | 日志服务      | 轻量级日志中心，查看远程服务器的日志                           |\n| 🚀  | 单元测试      | 基于 JUnit + Mockito 实现单元测试，保证功能的正确性、代码的质量等    |\n\n![功能图](/.image/common/infra-feature.png)\n\n### 数据报表\n\n|     | 功能    | 描述                 |\n|-----|-------|--------------------|\n| 🚀  | 报表设计器 | 支持数据报表、图形报表、打印设计等  |\n| 🚀  | 大屏设计器 | 拖拽生成数据大屏，内置几十种图表组件 |\n\n### 微信公众号\n\n|     | 功能     | 描述                            |\n|-----|--------|-------------------------------|\n| 🚀  | 账号管理   | 配置接入的微信公众号，可支持多个公众号           |\n| 🚀  | 数据统计   | 统计公众号的用户增减、累计用户、消息概况、接口分析等数据  |\n| 🚀  | 粉丝管理   | 查看已关注、取关的粉丝列表，可对粉丝进行同步、打标签等操作 |\n| 🚀  | 消息管理   | 查看粉丝发送的消息列表，可主动回复粉丝消息         |\n| 🚀  | 自动回复   | 自动回复粉丝发送的消息，支持关注回复、消息回复、关键字回复 |\n| 🚀  | 标签管理   | 对公众号的标签进行创建、查询、修改、删除等操作       |\n| 🚀  | 菜单管理   | 自定义公众号的菜单，也可以从公众号同步菜单         |\n| 🚀  | 素材管理   | 管理公众号的图片、语音、视频等素材，支持在线播放语音、视频 |\n| 🚀  | 图文草稿箱  | 新增常用的图文素材到草稿箱，可发布到公众号         |\n| 🚀  | 图文发表记录 | 查看已发布成功的图文素材，支持删除操作           |\n\n### 商城系统\n\n演示地址：<https://doc.iocoder.cn/mall-preview/>\n\n![功能图](/.image/common/mall-feature.png)\n\n![功能图](/.image/common/mall-preview.png)\n\n### 会员中心\n\n|     | 功能   | 描述                               |\n|-----|------|----------------------------------|\n| 🚀  | 会员管理 | 会员是 C 端的消费者，该功能用于会员的搜索与管理        |\n| 🚀  | 会员标签 | 对会员的标签进行创建、查询、修改、删除等操作           |\n| 🚀  | 会员等级 | 对会员的等级、成长值进行管理，可用于订单折扣等会员权益      |\n| 🚀  | 会员分组 | 对会员进行分组，用于用户画像、内容推送等运营手段         |\n| 🚀  | 积分签到 | 回馈给签到、消费等行为的积分，会员可订单抵现、积分兑换等途径消耗 |\n\n### ERP 系统\n\n演示地址：<https://doc.iocoder.cn/erp-preview/>\n\n![功能图](/.image/common/erp-feature.png)\n\n### CRM 系统\n\n演示地址：<https://doc.iocoder.cn/crm-preview/>\n\n![功能图](/.image/common/crm-feature.png)\n\n### AI 大模型\n\n演示地址：<https://doc.iocoder.cn/ai-preview/>\n\n![功能图](/.image/common/ai-feature.png)\n\n![功能图](/.image/common/ai-preview.gif)\n\n## 🐨 技术栈\n\n### 模块\n\n| 项目                    | 说明                 |\n|-----------------------|--------------------|\n| `yudao-dependencies`  | Maven 依赖版本管理       |\n| `yudao-framework`     | Java 框架拓展          |\n| `yudao-server`        | 管理后台 + 用户 APP 的服务端 |\n| `yudao-module-system` | 系统功能的 Module 模块    |\n| `yudao-module-member` | 会员中心的 Module 模块    |\n| `yudao-module-infra`  | 基础设施的 Module 模块    |\n| `yudao-module-bpm`    | 工作流程的 Module 模块    |\n| `yudao-module-pay`    | 支付系统的 Module 模块    |\n| `yudao-module-mall`   | 商城系统的 Module 模块    |\n| `yudao-module-erp`    | ERP 系统的 Module 模块  |\n| `yudao-module-crm`    | CRM 系统的 Module 模块  |\n| `yudao-module-ai`     | AI 大模型的 Module 模块  |\n| `yudao-module-mp`     | 微信公众号的 Module 模块   |\n| `yudao-module-report` | 大屏报表 Module 模块     |\n\n### 框架\n\n| 框架                                                                                          | 说明               | 版本             | 学习指南                                                           |\n|---------------------------------------------------------------------------------------------|------------------|----------------|----------------------------------------------------------------|\n| [Spring Boot](https://spring.io/projects/spring-boot)                                       | 应用开发框架           | 3.4.1          | [文档](https://github.com/YunaiV/SpringBoot-Labs)                |\n| [MySQL](https://www.mysql.com/cn/)                                                          | 数据库服务器           | 5.7 / 8.0+     |                                                                |\n| [Druid](https://github.com/alibaba/druid)                                                   | JDBC 连接池、监控组件    | 1.2.23         | [文档](http://www.iocoder.cn/Spring-Boot/datasource-pool/?yudao) |\n| [MyBatis Plus](https://mp.baomidou.com/)                                                    | MyBatis 增强工具包    | 3.5.7          | [文档](http://www.iocoder.cn/Spring-Boot/MyBatis/?yudao)         |\n| [Dynamic Datasource](https://dynamic-datasource.com/)                                       | 动态数据源            | 4.3.1          | [文档](http://www.iocoder.cn/Spring-Boot/datasource-pool/?yudao) |\n| [Redis](https://redis.io/)                                                                  | key-value 数据库    | 5.0 / 6.0 /7.0 |                                                                |\n| [Redisson](https://github.com/redisson/redisson)                                            | Redis 客户端        | 3.32.0         | [文档](http://www.iocoder.cn/Spring-Boot/Redis/?yudao)           |\n| [Spring MVC](https://github.com/spring-projects/spring-framework/tree/master/spring-webmvc) | MVC 框架           | 6.1.10         | [文档](http://www.iocoder.cn/SpringMVC/MVC/?yudao)               |\n| [Spring Security](https://github.com/spring-projects/spring-security)                       | Spring 安全框架      | 6.3.1          | [文档](http://www.iocoder.cn/Spring-Boot/Spring-Security/?yudao) |\n| [Hibernate Validator](https://github.com/hibernate/hibernate-validator)                     | 参数校验组件           | 8.0.1          | [文档](http://www.iocoder.cn/Spring-Boot/Validation/?yudao)      |\n| [Flowable](https://github.com/flowable/flowable-engine)                                     | 工作流引擎            | 7.0.0          | [文档](https://doc.iocoder.cn/bpm/)                              |\n| [Quartz](https://github.com/quartz-scheduler)                                               | 任务调度组件           | 2.3.2          | [文档](http://www.iocoder.cn/Spring-Boot/Job/?yudao)             |\n| [Springdoc](https://springdoc.org/)                                                         | Swagger 文档       | 2.3.0          | [文档](http://www.iocoder.cn/Spring-Boot/Swagger/?yudao)         |\n| [SkyWalking](https://skywalking.apache.org/)                                                | 分布式应用追踪系统        | 9.0.0          | [文档](http://www.iocoder.cn/Spring-Boot/SkyWalking/?yudao)      |\n| [Spring Boot Admin](https://github.com/codecentric/spring-boot-admin)                       | Spring Boot 监控平台 | 3.3.2          | [文档](http://www.iocoder.cn/Spring-Boot/Admin/?yudao)           |\n| [Jackson](https://github.com/FasterXML/jackson)                                             | JSON 工具库         | 2.17.1         |                                                                |\n| [MapStruct](https://mapstruct.org/)                                                         | Java Bean 转换     | 1.6.3          | [文档](http://www.iocoder.cn/Spring-Boot/MapStruct/?yudao)       |\n| [Lombok](https://projectlombok.org/)                                                        | 消除冗长的 Java 代码    | 1.18.34        | [文档](http://www.iocoder.cn/Spring-Boot/Lombok/?yudao)          |\n| [JUnit](https://junit.org/junit5/)                                                          | Java 单元测试框架      | 5.10.1         | -                                                              |\n| [Mockito](https://github.com/mockito/mockito)                                               | Java Mock 框架     | 5.7.0          | -                                                              |\n\n## 🐷 演示图\n\n### 系统功能\n\n| 模块       | biu                         | biu                       | biu                      |\n|----------|-----------------------------|---------------------------|--------------------------|\n| 登录 & 首页  | ![登录](/.image/登录.jpg)       | ![首页](/.image/首页.jpg)     | ![个人中心](/.image/个人中心.jpg) |\n| 用户 & 应用  | ![用户管理](/.image/用户管理.jpg)   | ![令牌管理](/.image/令牌管理.jpg) | ![应用管理](/.image/应用管理.jpg) |\n| 租户 & 套餐  | ![租户管理](/.image/租户管理.jpg)   | ![租户套餐](/.image/租户套餐.png) | -                        |\n| 部门 & 岗位  | ![部门管理](/.image/部门管理.jpg)   | ![岗位管理](/.image/岗位管理.jpg) | -                        |\n| 菜单 & 角色  | ![菜单管理](/.image/菜单管理.jpg)   | ![角色管理](/.image/角色管理.jpg) | -                        |\n| 审计日志     | ![操作日志](/.image/操作日志.jpg)   | ![登录日志](/.image/登录日志.jpg) | -                        |\n| 短信       | ![短信渠道](/.image/短信渠道.jpg)   | ![短信模板](/.image/短信模板.jpg) | ![短信日志](/.image/短信日志.jpg) |\n| 字典 & 敏感词 | ![字典类型](/.image/字典类型.jpg)   | ![字典数据](/.image/字典数据.jpg) | ![敏感词](/.image/敏感词.jpg)  |\n| 错误码 & 通知 | ![错误码管理](/.image/错误码管理.jpg) | ![通知公告](/.image/通知公告.jpg) | -                        |\n\n### 工作流程\n\n| 模块      | biu                             | biu                             | biu                             |\n|---------|---------------------------------|---------------------------------|---------------------------------|\n| 流程模型    | ![流程模型-列表](/.image/流程模型-列表.jpg) | ![流程模型-设计](/.image/流程模型-设计.jpg) | ![流程模型-定义](/.image/流程模型-定义.jpg) |\n| 表单 & 分组 | ![流程表单](/.image/流程表单.jpg)       | ![用户分组](/.image/用户分组.jpg)       | -                               |\n| 我的流程    | ![我的流程-列表](/.image/我的流程-列表.jpg) | ![我的流程-发起](/.image/我的流程-发起.jpg) | ![我的流程-详情](/.image/我的流程-详情.jpg) |\n| 待办 & 已办 | ![任务列表-审批](/.image/任务列表-审批.jpg) | ![任务列表-待办](/.image/任务列表-待办.jpg) | ![任务列表-已办](/.image/任务列表-已办.jpg) |\n| OA 请假   | ![OA请假-列表](/.image/OA请假-列表.jpg) | ![OA请假-发起](/.image/OA请假-发起.jpg) | ![OA请假-详情](/.image/OA请假-详情.jpg) |\n\n### 基础设施\n\n| 模块            | biu                           | biu                         | biu                       |\n|---------------|-------------------------------|-----------------------------|---------------------------|\n| 代码生成          | ![代码生成](/.image/代码生成.jpg)     | ![生成效果](/.image/生成效果.jpg)   | -                         |\n| 文档            | ![系统接口](/.image/系统接口.jpg)     | ![数据库文档](/.image/数据库文档.jpg) | -                         |\n| 文件 & 配置       | ![文件配置](/.image/文件配置.jpg)     | ![文件管理](/.image/文件管理2.jpg)  | ![配置管理](/.image/配置管理.jpg) |\n| 定时任务          | ![定时任务](/.image/定时任务.jpg)     | ![任务日志](/.image/任务日志.jpg)   | -                         |\n| API 日志        | ![访问日志](/.image/访问日志.jpg)     | ![错误日志](/.image/错误日志.jpg)   | -                         |\n| MySQL & Redis | ![MySQL](/.image/MySQL.jpg)   | ![Redis](/.image/Redis.jpg) | -                         |\n| 监控平台          | ![Java监控](/.image/Java监控.jpg) | ![链路追踪](/.image/链路追踪.jpg)   | ![日志中心](/.image/日志中心.jpg) |\n\n### 支付系统\n\n| 模块      | biu                       | biu                             | biu                             |\n|---------|---------------------------|---------------------------------|---------------------------------|\n| 商家 & 应用 | ![商户信息](/.image/商户信息.jpg) | ![应用信息-列表](/.image/应用信息-列表.jpg) | ![应用信息-编辑](/.image/应用信息-编辑.jpg) |\n| 支付 & 退款 | ![支付订单](/.image/支付订单.jpg) | ![退款订单](/.image/退款订单.jpg)       | ---                             |\n### 数据报表\n\n| 模块    | biu                             | biu                             | biu                                   |\n|-------|---------------------------------|---------------------------------|---------------------------------------|\n| 报表设计器 | ![数据报表](/.image/报表设计器-数据报表.jpg) | ![图形报表](/.image/报表设计器-图形报表.jpg) | ![报表设计器-打印设计](/.image/报表设计器-打印设计.jpg) |\n| 大屏设计器 | ![大屏列表](/.image/大屏设计器-列表.jpg)   | ![大屏预览](/.image/大屏设计器-预览.jpg)   | ![大屏编辑](/.image/大屏设计器-编辑.jpg)         |\n\n### 移动端（管理后台）\n\n| biu                              | biu                              | biu                              |\n|----------------------------------|----------------------------------|----------------------------------|\n| ![](/.image/admin-uniapp/01.png) | ![](/.image/admin-uniapp/02.png) | ![](/.image/admin-uniapp/03.png) |\n| ![](/.image/admin-uniapp/04.png) | ![](/.image/admin-uniapp/05.png) | ![](/.image/admin-uniapp/06.png) |\n| ![](/.image/admin-uniapp/07.png) | ![](/.image/admin-uniapp/08.png) | ![](/.image/admin-uniapp/09.png) |\n\n目前已经实现登录、我的、工作台、编辑资料、头像修改、密码修改、常见问题、关于我们等基础功能。\n\n', 24120, 9676, 500, 0, 0, '1', '2025-03-05 12:58:03', '1', '2025-03-09 18:31:21', b'1', 1);
INSERT INTO `ai_knowledge_document` VALUES (17, 3, '1_yudao-cloud-mini-jdk17-整合seata.docx', 'http://test.yudao.iocoder.cn/d2a8a80545b136192398fbeb5f9b917c7845c4dc186ddf142bf61f83a1cae51f.docx', '一，创建seata子模块\n在yudao-framework模块下新建子模块yudao-spring-boot-starter-seata,\n然后在这个yudao-spring-boot-starter-seata模块的pom文件中引入依赖，\n<dependency>\n            <groupId>cn.iocoder.cloud</groupId>\n            <artifactId>yudao-common</artifactId>\n            <version>2.3.0-SNAPSHOT</version>\n        </dependency>\n        <dependency>\n            <groupId>com.alibaba.cloud</groupId>\n            <artifactId>spring-cloud-alibaba-seata</artifactId>\n            <version>2023.0.1.2</version>\n        </dependency>\n        <dependency>\n            <groupId>io.seata</groupId>\n            <artifactId>seata-spring-boot-starter</artifactId>\n            <!-- 注意不能用2.0.0版本，事务不生效有bug-->\n            <version>1.8.0</version>\n        </dependency>\n        <dependency>\n            <groupId>io.seata</groupId>\n            <artifactId>seata-all</artifactId>\n            <!-- 注意不能用2.0.0版本，事务不生效有bug,The AdapterSpringSeataInterceptor\'s order \'2147483647\' is lower or equals than TransactionInterceptor\'s order \'2147483647\' , reset AdapterSpringSeataInterceptor\'s order to higher order \'2147483646\'.-->\n            <version>1.8.0</version>\n            <exclusions>\n                <exclusion>\n                    <groupId>log4j</groupId>\n                    <artifactId>log4j</artifactId>\n                </exclusion>\n            </exclusions>\n        </dependency>\n        <dependency>\n            <groupId>io.seata</groupId>\n            <artifactId>seata-spring-autoconfigure-client</artifactId>\n            <!-- 注意不能用2.0.0版本，事务不生效有bug-->\n            <version>1.8.0</version>\n        </dependency>\n        <dependency>\n            <groupId>com.caucho</groupId>\n            <artifactId>hessian</artifactId>\n            <version>4.0.63</version>\n        </dependency>\n        <dependency>\n            <groupId>io.protostuff</groupId>\n            <artifactId>protostuff-core</artifactId>\n            <version>1.7.2</version>\n        </dependency>\n        <dependency>\n            <groupId>io.protostuff</groupId>\n            <artifactId>protostuff-runtime</artifactId>\n            <version>1.7.2</version>\n        </dependency>\n\n二，部署seata服务端\nseata是用于分布式事务的，\n目前我用的是seata-server2.0.0版的windows版，nacos服务器版本我用的2.0.3\nseata\\conf\\application.yml配置文件中：\n\nserver:\n  port: 7091\n\nspring:\n  application:\n    name: seata-server\n\nlogging:\n  config: classpath:logback-spring.xml\n  file:\n    path: ${log.home:${user.home}/logs/seata}\n  extend:\n    logstash-appender:\n      destination: 127.0.0.1:4560\n    kafka-appender:\n      bootstrap-servers: 127.0.0.1:9092\n      topic: logback_to_logstash\n\nconsole:\n  user:\n    username: seata\n    password: seata\nseata:\n  config:\n    # support: nacos, consul, apollo, zk, etcd3\n    type: nacos\n    nacos:\n      server-addr: 192.168.1.146:8848\n      namespace: zma-dev\n      group: SEATA_GROUP\n      username: nacos\n      password: nacos\n      context-path:\n      ##if use MSE Nacos with auth, mutex with username/password attribute\n      #access-key:\n      #secret-key:\n      data-id: seataServer.properties\n  registry:\n    # support: nacos, eureka, redis, zk, consul, etcd3, sofa\n    type: nacos\n    preferred-networks: 30.240.*\n    nacos:\n      application: seata-server\n      server-addr: 192.168.1.146:8848\n      group: SEATA_GROUP\n      namespace: zma-dev\n      cluster: default\n      username: nacod\n      password: nacos\n      context-path:\n      ##if use MSE Nacos with auth, mutex with username/password attribute\n      #access-key:\n  store:\n    # support: file 、 db 、 redis 、 raft\n    mode: file\n  #  server:\n  #    service-port: 8091 #If not configured, the default is \'${server.port} + 1000\'\n  security:\n    secretKey: SeataSecretKey0c382ef121d778043159209298fd40bf3850a017\n    tokenValidityInMilliseconds: 1800000\n    ignore:\n      urls: /,/**/*.css,/**/*.js,/**/*.html,/**/*.map,/**/*.svg,/**/*.png,/**/*.jpeg,/**/*.ico,/api/v1/auth/login,/metadata/v1/**\nnacos配置中心里面，建一个seataServer.properties配置文件，内容如下：\nData ID: seataServer.properties\nGroup: SEATA_GROUP\nservice.enableDegrade=false\nservice.disableGlobalTransaction=false\nservice.vgroupMapping.default-tx-group=default\nservice.vgroupMapping.order-service-group=default\n启动seata-server,\n在seata\\bin下，双击seata-server.bat文件启动，查看nacos中是否有seata-server的服务，如果有，证明启动成功。\n或者去访问seata的管理页面地址：http://localhost:7091,如果能正常打开，证明seata已经启动成功。\n二，微服务中配置seata\nspringcloud的微服务中配置seata\n先在微服务的pom.xml中添加依赖\n <!-- seata -->\n        <dependency>\n            <groupId>cn.iocoder.cloud</groupId>\n            <artifactId>yudao-spring-boot-starter-seata</artifactId>\n            <version>2.3.0-SNAPSHOT</version>\n        </dependency>\n然后在springboot微服务的yml中配置：\n# Seata 配置项，对应 SeataProperties 类\nseata:\n  application-id: ${spring.application.name} # Seata 应用编号，默认为 ${spring.application.name}\n  tx-service-group: default-tx-group # Seata 事务组编号，用于 TC 集群名\n  # Seata 服务配置项，对应 ServiceProperties 类\n  service:\n    vgroup-mapping:\n      default-tx-group: default\n  data-source-proxy-mode: AT\n  # Seata 注册中心配置项，对应 RegistryProperties 类\n  registry:\n    type: nacos # 注册中心类型，默认为 file\n    nacos:\n      cluster: default # 使用的 Seata 分组\n      namespace: zma-dev # Nacos 命名空间\n      #      serverAddr: 192.168.1.17:8848 # Nacos 服务地址\n      serverAddr: localhost:8848 # Nacos 服务地址\n      group : SEATA_GROUP\n      username: nacos\n      password: nacos\n然后在微服务启动类上加注解\n//开启seata对数据源的自动代理\n@EnableAutoDataSourceProxy \n//开启seata对FeignClient运程调用的自动配置\n@EnableFeignClients(defaultConfiguration = SeataFeignClientAutoConfiguration.class)\n\n三，测试全局事务\n先写一个测试接口，我是在TenantController中写的\n @GetMapping(\"/test-seata\")\n    @Operation(summary = \"测试seata\")\n    public CommonResult testSeata() {\n        return success(menuService.testSeata());\n    }\nmenuService业务实现方法上加注解@GlobalTransactional(name = \"testSeata\",rollbackFor = Exception.class),\n这个注解中的name的值要保证唯一性，我这里直接用的方法，如果你当前项目中有多个方法名与当前方法名相同，那就要区别开，比如前面再加上微服务名-controller名，后面再加后缀的方式，保证唯一就行了，如：systemServer-testController-testSeata-1。\n@Override\n    @GlobalTransactional(name = \"testSeata\",rollbackFor = Exception.class)\n    public Object testSeata() {\n        MenuDO menuDO = menuMapper.selectById(2815);\n        menuDO.setName(\"测试111\");\n        //本微服务system微服务中修改stem_menu表，此修改操作会成功\n        menuMapper.updateById(menuDO);\n        //通过FeignClient远程调用infra微服务中的方法testSeata，\n        //在testSeata插入一条数据到yudao_demo01_contact表，此插入操作会成功\n        Boolean bool = apiErrorLogApi.testSeata();\n        //通过FeignClient远程调用infra微服务中的方法testSeata2，\n        //在testSeata2方法中插入一条数据到yudao_demo02_category表，此插入操作会失败，因为id与数据库中的已有的id重复\n        Boolean common = apiErrorLogApi.testSeata2();\n        //执行完会去看数据库中的三张表中的数据是否有回滚，如果有回滚，证明全局事务生效了。\n        return true;\n    }\n注意1：要用全局事务时，远程调用的方法不能以CommonResult返回，要以实体数据实体返回，比如我当前方法只需要一个String字符串，那就以String返回，再比如我需要一个用户对象，那个直接以User返回，不要封装到带有code,msg,data的Result结果对象中返回，不然事务会不生效。\n注意2：远程调用的方法中不能有try{}catch (Exception e) {},不然事务也不会生效。\n然后，数据库中要加seata处理事务的表,如果有多个数据库，那么每个数据库中都要加这张表。\nCREATE TABLE `undo_log` (\n  `id` bigint NOT NULL AUTO_INCREMENT,\n  `branch_id` bigint NOT NULL,\n  `xid` varchar(100) NOT NULL,\n  `context` varchar(128) NOT NULL,\n  `rollback_info` longblob NOT NULL,\n  `log_status` int NOT NULL,\n  `log_created` datetime NOT NULL,\n  `log_modified` datetime NOT NULL,\n  `ext` varchar(100) DEFAULT NULL,\n  PRIMARY KEY (`id`),\n  UNIQUE KEY `ux_undo_log` (`xid`,`branch_id`)\n) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8mb3;\n然后启动gateway,system微服务与infra微服务，\n最后，用postman请求system微服务中的这个/test-seata接口，测试数据库的数据的修改与插入是否有回滚，是否有同步成功，同步失败。\n\n一，创建 seata 子模块\n\n在yudao-framework 模块下新建子模块 yudao-spring-boot-starter- seata,\n\n然后在这个 yudao-spring-boot-starter- seata模块的pom文件中引入依赖，\n\n<dependency>\n\n<groupId> cn.iocoder.cloud</groupId>\n\n<artifactId>y udao-common</artifactId>\n\n<version>2.3.0-SNAPSHOT</version>\n\n</dependency>\n\n<dependency>\n\n<groupId>com.alibaba.cloud</groupId>\n\n<artifactId>spring-cloud-alibaba-\n\nseata</artifactId>\n\n<version>2023.0.1.2</version>\n\n</dependency>\n\n<dependency>\n\n<groupId>io.seata</groupId>\n\n<artifactId>seata-spring-boot-\n\nstarter</artifactId>\n\n<!--注意不能用 2.0.0版本，事务不生效有 bug-->\n\n<version>1.8.0</version>\n\n</dependency>\n\n<dependency>\n\n<groupId>io.seata</groupId>\n\n<artifactId>seata-all</artifactId>\n\n<!--注意不能用 2.0.0版本，事务不生效有 bug,The\n\nAdapterSpringSeataInterceptor\'s order\'2147483647\' is\n\nlowerorequals thanTransactionInterceptor\'s order\n\n\'2147483647\' ,resetAdapterSpringSeataInterceptor\'s\n\nordertohigher order\'2147483646\'.-->\n\n<version>1.8.0</version>\n\n<exclusions>\n\n<exclusion>\n\n<groupId>log4j</groupId>\n\n<artifactId>log4j</artifactId>\n\n</exclusion>\n\n</exclusions>\n\n</dependency>\n\n<dependency>\n\n<groupId>io.seata</groupId>\n\n', 8493, 2872, 500, 0, 0, '1', '2025-03-06 22:21:48', '1', '2025-03-09 18:31:07', b'1', 1);
INSERT INTO `ai_knowledge_document` VALUES (18, 4, 'README_yudao.md', 'http://test.yudao.iocoder.cn/167d6d2372997b1fc0ac52c0756bc4bc2a5e84a690ecc8fa2f8c56ecc3adc788.md', '<p align=\"center\">\n <img src=\"https://img.shields.io/badge/Spring%20Boot-3.4.1-blue.svg\" alt=\"Downloads\">\n <img src=\"https://img.shields.io/badge/Vue-3.2-blue.svg\" alt=\"Downloads\">\n <img src=\"https://img.shields.io/github/license/YunaiV/ruoyi-vue-pro\" alt=\"Downloads\" />\n</p>\n\n**严肃声明：现在、未来都不会有商业版本，所有代码全部开源!！**\n\n**「我喜欢写代码，乐此不疲」**  \n**「我喜欢做开源，以此为乐」**\n\n我 🐶 在上海艰苦奋斗，早中晚在 top3 大厂认真搬砖，夜里为开源做贡献。\n\n如果这个项目让你有所收获，记得 Star 关注哦，这对我是非常不错的鼓励与支持。\n\n## 🐶 新手必读\n\n* 演示地址【Vue3 + element-plus】：<http://dashboard-vue3.yudao.iocoder.cn>\n* 演示地址【Vue3 + vben(ant-design-vue)】：<http://dashboard-vben.yudao.iocoder.cn>\n* 演示地址【Vue2 + element-ui】：<http://dashboard.yudao.iocoder.cn>\n* 启动文档：<https://doc.iocoder.cn/quick-start/>\n* 视频教程：<https://doc.iocoder.cn/video/>\n\n## 🐰 版本说明\n\n| 版本                                                                  | JDK 8 + Spring Boot 2.7                                                   | JDK 17/21 + Spring Boot 3.2                                                           |\n|---------------------------------------------------------------------|---------------------------------------------------------------------------|---------------------------------------------------------------------------------------|\n| 【完整版】[ruoyi-vue-pro](https://gitee.com/zhijiantianya/ruoyi-vue-pro) | [`master`](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/) 分支 | [`master-jdk17`](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master-jdk17/) 分支 |\n| 【精简版】[yudao-boot-mini](https://gitee.com/yudaocode/yudao-boot-mini) | [`master`](https://gitee.com/yudaocode/yudao-boot-mini/tree/master/) 分支   | [`master-jdk17`](https://gitee.com/yudaocode/yudao-boot-mini/tree/master-jdk17/) 分支   |\n\n* 【完整版】：包括系统功能、基础设施、会员中心、数据报表、工作流程、商城系统、微信公众号、CRM、ERP 等功能\n* 【精简版】：只包括系统功能、基础设施功能，不包括会员中心、数据报表、工作流程、商城系统、微信公众号、CRM、ERP 等功能\n\n可参考 [《迁移文档》](https://doc.iocoder.cn/migrate-module/) ，只需要 5-10 分钟，即可将【完整版】按需迁移到【精简版】\n\n## 🐯 平台简介\n\n**芋道**，以开发者为中心，打造中国第一流的快速开发平台，全部开源，个人与企业可 100% 免费使用。\n\n> 有任何问题，或者想要的功能，可以在 _Issues_ 中提给艿艿。\n>\n> 😜 给项目点点 Star 吧，这对我们真的很重要！\n\n![架构图](/.image/common/ruoyi-vue-pro-architecture.png)\n\n* Java 后端：`master` 分支为 JDK 8 + Spring Boot 2.7，`master-jdk17` 分支为 JDK 17/21 + Spring Boot 3.2\n* 管理后台的电脑端：Vue3 提供 `element-plus`、`vben(ant-design-vue)` 两个版本，Vue2 提供 `element-ui` 版本\n* 管理后台的移动端：采用 `uni-app` 方案，一份代码多终端适配，同时支持 APP、小程序、H5！\n* 后端采用 Spring Boot 多模块架构、MySQL + MyBatis Plus、Redis + Redisson\n* 数据库可使用 MySQL、Oracle、PostgreSQL、SQL Server、MariaDB、国产达梦 DM、TiDB 等\n* 消息队列可使用 Event、Redis、RabbitMQ、Kafka、RocketMQ 等\n* 权限认证使用 Spring Security & Token & Redis，支持多终端、多种用户的认证系统，支持 SSO 单点登录\n* 支持加载动态权限菜单，按钮级别权限控制，Redis 缓存提升性能\n* 支持 SaaS 多租户，可自定义每个租户的权限，提供透明化的多租户底层封装\n* 工作流使用 Flowable，支持动态表单、在线设计流程、会签 / 或签、多种任务分配方式\n* 高效率开发，使用代码生成器可以一键生成 Java、Vue 前后端代码、SQL 脚本、接口文档，支持单表、树表、主子表\n* 实时通信，采用 Spring WebSocket 实现，内置 Token 身份校验，支持 WebSocket 集群\n* 集成微信小程序、微信公众号、企业微信、钉钉等三方登陆，集成支付宝、微信等支付与退款\n* 集成阿里云、腾讯云等短信渠道，集成 MinIO、阿里云、腾讯云、七牛云等云存储服务\n* 集成报表设计器、大屏设计器，通过拖拽即可生成酷炫的报表与大屏\n\n##  🐳 项目关系\n\n![架构演进](/.image/common/yudao-roadmap.png)\n\n三个项目的功能对比，可见社区共同整理的 [国产开源项目对比](https://www.yuque.com/xiatian-bsgny/lm0ec1/wqf8mn) 表格。\n\n### 后端项目\n\n| 项目                                                              | Star                                                                                                                                                                                                                                                                                             | 简介                          |\n|-----------------------------------------------------------------|--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------|-----------------------------|\n| [ruoyi-vue-pro](https://gitee.com/zhijiantianya/ruoyi-vue-pro)  | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro)       | 基于 Spring Boot 多模块架构        |\n| [yudao-cloud](https://gitee.com/zhijiantianya/yudao-cloud)      | [![Gitee star](https://gitee.com/zhijiantianya/yudao-cloud/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/yudao-cloud) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/yudao-cloud.svg?style=social&label=Stars)](https://github.com/YunaiV/yudao-cloud)               | 基于 Spring Cloud 微服务架构       |\n| [Spring-Boot-Labs](https://gitee.com/yudaocode/SpringBoot-Labs) | [![Gitee star](https://gitee.com/yudaocode/SpringBoot-Labs/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/yudao-cloud) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/SpringBoot-Labs.svg?style=social&label=Stars)](https://github.com/yudaocode/SpringBoot-Labs) | 系统学习 Spring Boot & Cloud 专栏 |\n\n### 前端项目\n\n| 项目                                                                         | Star                                                                                                                                                                                                                                                                                                                     | 简介                                     |\n|----------------------------------------------------------------------------|--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------|----------------------------------------|\n| [yudao-ui-admin-vue3](https://gitee.com/yudaocode/yudao-ui-admin-vue3)     | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-admin-vue3/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-admin-vue3) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-admin-vue3.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-admin-vue3)         | 基于 Vue3 + element-plus 实现的管理后台         |\n| [yudao-ui-admin-vben](https://gitee.com/yudaocode/yudao-ui-admin-vben)     | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-admin-vben/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-admin-vben) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-admin-vben.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-admin-vben)         | 基于 Vue3 + vben(ant-design-vue) 实现的管理后台 |\n| [yudao-mall-uniapp](https://gitee.com/yudaocode/yudao-mall-uniapp)         | [![Gitee star](https://gitee.com/yudaocode/yudao-mall-uniapp/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-mall-uniapp) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-mall-uniapp.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-mall-uniapp)                 | 基于 uni-app 实现的商城小程序                    |\n| [yudao-ui-admin-vue2](https://gitee.com/yudaocode/yudao-ui-admin-vue2)     | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-admin-vue2/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-admin-vue2) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-admin-vue2.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-admin-vue2)         | 基于 Vue2 + element-ui 实现的管理后台           |\n| [yudao-ui-admin-uniapp](https://gitee.com/yudaocode/yudao-ui-admin-uniapp) | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-admin-uniapp/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-admin-uniapp) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-admin-uniapp.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-admin-uniapp) | 基于 Vue2 + element-ui 实现的管理后台           |\n| [yudao-ui-go-view](https://gitee.com/yudaocode/yudao-ui-go-view)           | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-go-view/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-go-view) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-go-view.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-go-view)                     | 基于 Vue3 + naive-ui 实现的大屏报表             |\n\n## 😎 开源协议\n\n**为什么推荐使用本项目？**\n\n① 本项目采用比 Apache 2.0 更宽松的 [MIT License](https://gitee.com/zhijiantianya/ruoyi-vue-pro/blob/master/LICENSE) 开源协议，个人与企业可 100% 免费使用，不用保留类作者、Copyright 信息。\n\n② 代码全部开源，不会像其他项目一样，只开源部分代码，让你无法了解整个项目的架构设计。[国产开源项目对比](https://www.yuque.com/xiatian-bsgny/lm0ec1/wqf8mn)\n\n![开源项目对比](/.image/common/project-vs.png)\n\n③ 代码整洁、架构整洁，遵循《阿里巴巴 Java 开发手册》规范，代码注释详细，113770 行 Java 代码，42462 行代码注释。\n\n## 🤝 项目外包\n\n我们也是接外包滴，如果你有项目想要外包，可以微信联系【**Aix9975**】。\n\n团队包含专业的项目经理、架构师、前端工程师、后端工程师、测试工程师、运维工程师，可以提供全流程的外包服务。\n\n项目可以是商城、SCRM 系统、OA 系统、物流系统、ERP 系统、CMS 系统、HIS 系统、支付系统、IM 聊天、微信公众号、微信小程序等等。\n\n## 🐼 内置功能\n\n系统内置多种多种业务功能，可以用于快速你的业务系统：\n\n![功能分层](/.image/common/ruoyi-vue-pro-biz.png)\n\n* 通用模块（必选）：系统功能、基础设施\n* 通用模块（可选）：工作流程、支付系统、数据报表、会员中心\n* 业务系统（按需）：ERP 系统、CRM 系统、商城系统、微信公众号、AI 大模型\n\n> 友情提示：本项目基于 RuoYi-Vue 修改，**重构优化**后端的代码，**美化**前端的界面。\n>\n> * 额外新增的功能，我们使用 🚀 标记。\n> * 重新实现的功能，我们使用 ⭐️ 标记。\n\n🙂 所有功能，都通过 **单元测试** 保证高质量。\n\n### 系统功能\n\n|     | 功能    | 描述                              |\n|-----|-------|---------------------------------|\n|     | 用户管理  | 用户是系统操作者，该功能主要完成系统用户配置          |\n| ⭐️  | 在线用户  | 当前系统中活跃用户状态监控，支持手动踢下线           |\n|     | 角色管理  | 角色菜单权限分配、设置角色按机构进行数据范围权限划分      |\n|     | 菜单管理  | 配置系统菜单、操作权限、按钮权限标识等，本地缓存提供性能    |\n|     | 部门管理  | 配置系统组织机构（公司、部门、小组），树结构展现支持数据权限  |\n|     | 岗位管理  | 配置系统用户所属担任职务                    |\n| 🚀  | 租户管理  | 配置系统租户，支持 SaaS 场景下的多租户功能        |\n| 🚀  | 租户套餐  | 配置租户套餐，自定每个租户的菜单、操作、按钮的权限       |\n|     | 字典管理  | 对系统中经常使用的一些较为固定的数据进行维护          |\n| 🚀  | 短信管理  | 短信渠道、短息模板、短信日志，对接阿里云、腾讯云等主流短信平台 |\n| 🚀  | 邮件管理  | 邮箱账号、邮件模版、邮件发送日志，支持所有邮件平台       |\n| 🚀  | 站内信   | 系统内的消息通知，提供站内信模版、站内信消息          |\n| 🚀  | 操作日志  | 系统正常操作日志记录和查询，集成 Swagger 生成日志内容 |\n| ⭐️  | 登录日志  | 系统登录日志记录查询，包含登录异常               |\n| 🚀  | 错误码管理 | 系统所有错误码的管理，可在线修改错误提示，无需重启服务     |\n|     | 通知公告  | 系统通知公告信息发布维护                    |\n| 🚀  | 敏感词   | 配置系统敏感词，支持标签分组                  |\n| 🚀  | 应用管理  | 管理 SSO 单点登录的应用，支持多种 OAuth2 授权方式 |\n| 🚀  | 地区管理  | 展示省份、城市、区镇等城市信息，支持 IP 对应城市      |\n\n![功能图](/.image/common/system-feature.png)\n\n### 工作流程\n\n|    | 功能    | 描述                                      |\n|----|-------|-----------------------------------------|\n| 🚀 | 流程模型  | 配置工作流的流程模型，支持 BPMN 和仿钉钉/飞书设计器           |\n| 🚀 | 流程表单  | 拖动表单元素生成相应的工作流表单，覆盖 Element UI 所有的表单组件  |\n| 🚀 | 用户分组  | 自定义用户分组，可用于工作流的审批分组                     |\n| 🚀 | 我的流程  | 查看我发起的工作流程，支持新建、取消流程等操作，高亮流程图、审批时间线     |\n| 🚀 | 待办任务  | 查看自己【未】审批的工作任务，支持通过、不通过、转派、委派、退回、加减签等操作 |\n| 🚀 | 已办任务  | 查看自己【已】审批的工作任务，支持流程预测，展示未来审批人信息         |\n| 🚀 | OA 请假 | 作为业务自定义接入工作流的使用示例，只需创建请求对应的工作流程，即可进行审批  |\n\n![功能图](/.image/common/bpm-feature.png)\n\n| BPMN 设计器                     | 钉钉/飞书设计器                       |\n|------------------------------|--------------------------------|\n| ![](/.image/工作流设计器-bpmn.jpg) | ![](/.image/工作流设计器-simple.jpg) |\n\n### 支付系统\n\n|     | 功能   | 描述                        |\n|-----|------|---------------------------|\n| 🚀  | 应用信息 | 配置商户的应用信息，对接支付宝、微信等多个支付渠道 |\n| 🚀  | 支付订单 | 查看用户发起的支付宝、微信等的【支付】订单     |\n| 🚀  | 退款订单 | 查看用户发起的支付宝、微信等的【退款】订单     |\n| 🚀  | 回调通知 | 查看支付回调业务的【支付】【退款】的通知结果    |\n| 🚀  | 接入示例 | 提供接入支付系统的【支付】【退款】的功能实战    |\n\n### 基础设施\n\n|     | 功能        | 描述                                           |\n|-----|-----------|----------------------------------------------|\n| 🚀  | 代码生成      | 前后端代码的生成（Java、Vue、SQL、单元测试），支持 CRUD 下载       |\n| 🚀  | 系统接口      | 基于 Swagger 自动生成相关的 RESTful API 接口文档          |\n| 🚀  | 数据库文档     | 基于 Screw 自动生成数据库文档，支持导出 Word、HTML、MD 格式      |\n|     | 表单构建      | 拖动表单元素生成相应的 HTML 代码，支持导出 JSON、Vue 文件         |\n| 🚀  | 配置管理      | 对系统动态配置常用参数，支持 SpringBoot 加载                 |\n| ⭐️  | 定时任务      | 在线（添加、修改、删除)任务调度包含执行结果日志                     |\n| 🚀  | 文件服务      | 支持将文件存储到 S3（MinIO、阿里云、腾讯云、七牛云）、本地、FTP、数据库等   | \n| 🚀  | WebSocket | 提供 WebSocket 接入示例，支持一对一、一对多发送方式              | \n| 🚀  | API 日志    | 包括 RESTful API 访问日志、异常日志两部分，方便排查 API 相关的问题   |\n|     | MySQL 监控  | 监视当前系统数据库连接池状态，可进行分析SQL找出系统性能瓶颈              |\n|     | Redis 监控  | 监控 Redis 数据库的使用情况，使用的 Redis Key 管理           |\n| 🚀  | 消息队列      | 基于 Redis 实现消息队列，Stream 提供集群消费，Pub/Sub 提供广播消费 |\n| 🚀  | Java 监控   | 基于 Spring Boot Admin 实现 Java 应用的监控           |\n| 🚀  | 链路追踪      | 接入 SkyWalking 组件，实现链路追踪                      |\n| 🚀  | 日志中心      | 接入 SkyWalking 组件，实现日志中心                      |\n| 🚀  | 服务保障      | 基于 Redis 实现分布式锁、幂等、限流功能，满足高并发场景              |\n| 🚀  | 日志服务      | 轻量级日志中心，查看远程服务器的日志                           |\n| 🚀  | 单元测试      | 基于 JUnit + Mockito 实现单元测试，保证功能的正确性、代码的质量等    |\n\n![功能图](/.image/common/infra-feature.png)\n\n### 数据报表\n\n|     | 功能    | 描述                 |\n|-----|-------|--------------------|\n| 🚀  | 报表设计器 | 支持数据报表、图形报表、打印设计等  |\n| 🚀  | 大屏设计器 | 拖拽生成数据大屏，内置几十种图表组件 |\n\n### 微信公众号\n\n|     | 功能     | 描述                            |\n|-----|--------|-------------------------------|\n| 🚀  | 账号管理   | 配置接入的微信公众号，可支持多个公众号           |\n| 🚀  | 数据统计   | 统计公众号的用户增减、累计用户、消息概况、接口分析等数据  |\n| 🚀  | 粉丝管理   | 查看已关注、取关的粉丝列表，可对粉丝进行同步、打标签等操作 |\n| 🚀  | 消息管理   | 查看粉丝发送的消息列表，可主动回复粉丝消息         |\n| 🚀  | 自动回复   | 自动回复粉丝发送的消息，支持关注回复、消息回复、关键字回复 |\n| 🚀  | 标签管理   | 对公众号的标签进行创建、查询、修改、删除等操作       |\n| 🚀  | 菜单管理   | 自定义公众号的菜单，也可以从公众号同步菜单         |\n| 🚀  | 素材管理   | 管理公众号的图片、语音、视频等素材，支持在线播放语音、视频 |\n| 🚀  | 图文草稿箱  | 新增常用的图文素材到草稿箱，可发布到公众号         |\n| 🚀  | 图文发表记录 | 查看已发布成功的图文素材，支持删除操作           |\n\n### 商城系统\n\n演示地址：<https://doc.iocoder.cn/mall-preview/>\n\n![功能图](/.image/common/mall-feature.png)\n\n![功能图](/.image/common/mall-preview.png)\n\n### 会员中心\n\n|     | 功能   | 描述                               |\n|-----|------|----------------------------------|\n| 🚀  | 会员管理 | 会员是 C 端的消费者，该功能用于会员的搜索与管理        |\n| 🚀  | 会员标签 | 对会员的标签进行创建、查询、修改、删除等操作           |\n| 🚀  | 会员等级 | 对会员的等级、成长值进行管理，可用于订单折扣等会员权益      |\n| 🚀  | 会员分组 | 对会员进行分组，用于用户画像、内容推送等运营手段         |\n| 🚀  | 积分签到 | 回馈给签到、消费等行为的积分，会员可订单抵现、积分兑换等途径消耗 |\n\n### ERP 系统\n\n演示地址：<https://doc.iocoder.cn/erp-preview/>\n\n![功能图](/.image/common/erp-feature.png)\n\n### CRM 系统\n\n演示地址：<https://doc.iocoder.cn/crm-preview/>\n\n![功能图](/.image/common/crm-feature.png)\n\n### AI 大模型\n\n演示地址：<https://doc.iocoder.cn/ai-preview/>\n\n![功能图](/.image/common/ai-feature.png)\n\n![功能图](/.image/common/ai-preview.gif)\n\n## 🐨 技术栈\n\n### 模块\n\n| 项目                    | 说明                 |\n|-----------------------|--------------------|\n| `yudao-dependencies`  | Maven 依赖版本管理       |\n| `yudao-framework`     | Java 框架拓展          |\n| `yudao-server`        | 管理后台 + 用户 APP 的服务端 |\n| `yudao-module-system` | 系统功能的 Module 模块    |\n| `yudao-module-member` | 会员中心的 Module 模块    |\n| `yudao-module-infra`  | 基础设施的 Module 模块    |\n| `yudao-module-bpm`    | 工作流程的 Module 模块    |\n| `yudao-module-pay`    | 支付系统的 Module 模块    |\n| `yudao-module-mall`   | 商城系统的 Module 模块    |\n| `yudao-module-erp`    | ERP 系统的 Module 模块  |\n| `yudao-module-crm`    | CRM 系统的 Module 模块  |\n| `yudao-module-ai`     | AI 大模型的 Module 模块  |\n| `yudao-module-mp`     | 微信公众号的 Module 模块   |\n| `yudao-module-report` | 大屏报表 Module 模块     |\n\n### 框架\n\n| 框架                                                                                          | 说明               | 版本             | 学习指南                                                           |\n|---------------------------------------------------------------------------------------------|------------------|----------------|----------------------------------------------------------------|\n| [Spring Boot](https://spring.io/projects/spring-boot)                                       | 应用开发框架           | 3.4.1          | [文档](https://github.com/YunaiV/SpringBoot-Labs)                |\n| [MySQL](https://www.mysql.com/cn/)                                                          | 数据库服务器           | 5.7 / 8.0+     |                                                                |\n| [Druid](https://github.com/alibaba/druid)                                                   | JDBC 连接池、监控组件    | 1.2.23         | [文档](http://www.iocoder.cn/Spring-Boot/datasource-pool/?yudao) |\n| [MyBatis Plus](https://mp.baomidou.com/)                                                    | MyBatis 增强工具包    | 3.5.7          | [文档](http://www.iocoder.cn/Spring-Boot/MyBatis/?yudao)         |\n| [Dynamic Datasource](https://dynamic-datasource.com/)                                       | 动态数据源            | 4.3.1          | [文档](http://www.iocoder.cn/Spring-Boot/datasource-pool/?yudao) |\n| [Redis](https://redis.io/)                                                                  | key-value 数据库    | 5.0 / 6.0 /7.0 |                                                                |\n| [Redisson](https://github.com/redisson/redisson)                                            | Redis 客户端        | 3.32.0         | [文档](http://www.iocoder.cn/Spring-Boot/Redis/?yudao)           |\n| [Spring MVC](https://github.com/spring-projects/spring-framework/tree/master/spring-webmvc) | MVC 框架           | 6.1.10         | [文档](http://www.iocoder.cn/SpringMVC/MVC/?yudao)               |\n| [Spring Security](https://github.com/spring-projects/spring-security)                       | Spring 安全框架      | 6.3.1          | [文档](http://www.iocoder.cn/Spring-Boot/Spring-Security/?yudao) |\n| [Hibernate Validator](https://github.com/hibernate/hibernate-validator)                     | 参数校验组件           | 8.0.1          | [文档](http://www.iocoder.cn/Spring-Boot/Validation/?yudao)      |\n| [Flowable](https://github.com/flowable/flowable-engine)                                     | 工作流引擎            | 7.0.0          | [文档](https://doc.iocoder.cn/bpm/)                              |\n| [Quartz](https://github.com/quartz-scheduler)                                               | 任务调度组件           | 2.3.2          | [文档](http://www.iocoder.cn/Spring-Boot/Job/?yudao)             |\n| [Springdoc](https://springdoc.org/)                                                         | Swagger 文档       | 2.3.0          | [文档](http://www.iocoder.cn/Spring-Boot/Swagger/?yudao)         |\n| [SkyWalking](https://skywalking.apache.org/)                                                | 分布式应用追踪系统        | 9.0.0          | [文档](http://www.iocoder.cn/Spring-Boot/SkyWalking/?yudao)      |\n| [Spring Boot Admin](https://github.com/codecentric/spring-boot-admin)                       | Spring Boot 监控平台 | 3.3.2          | [文档](http://www.iocoder.cn/Spring-Boot/Admin/?yudao)           |\n| [Jackson](https://github.com/FasterXML/jackson)                                             | JSON 工具库         | 2.17.1         |                                                                |\n| [MapStruct](https://mapstruct.org/)                                                         | Java Bean 转换     | 1.6.3          | [文档](http://www.iocoder.cn/Spring-Boot/MapStruct/?yudao)       |\n| [Lombok](https://projectlombok.org/)                                                        | 消除冗长的 Java 代码    | 1.18.34        | [文档](http://www.iocoder.cn/Spring-Boot/Lombok/?yudao)          |\n| [JUnit](https://junit.org/junit5/)                                                          | Java 单元测试框架      | 5.10.1         | -                                                              |\n| [Mockito](https://github.com/mockito/mockito)                                               | Java Mock 框架     | 5.7.0          | -                                                              |\n\n## 🐷 演示图\n\n### 系统功能\n\n| 模块       | biu                         | biu                       | biu                      |\n|----------|-----------------------------|---------------------------|--------------------------|\n| 登录 & 首页  | ![登录](/.image/登录.jpg)       | ![首页](/.image/首页.jpg)     | ![个人中心](/.image/个人中心.jpg) |\n| 用户 & 应用  | ![用户管理](/.image/用户管理.jpg)   | ![令牌管理](/.image/令牌管理.jpg) | ![应用管理](/.image/应用管理.jpg) |\n| 租户 & 套餐  | ![租户管理](/.image/租户管理.jpg)   | ![租户套餐](/.image/租户套餐.png) | -                        |\n| 部门 & 岗位  | ![部门管理](/.image/部门管理.jpg)   | ![岗位管理](/.image/岗位管理.jpg) | -                        |\n| 菜单 & 角色  | ![菜单管理](/.image/菜单管理.jpg)   | ![角色管理](/.image/角色管理.jpg) | -                        |\n| 审计日志     | ![操作日志](/.image/操作日志.jpg)   | ![登录日志](/.image/登录日志.jpg) | -                        |\n| 短信       | ![短信渠道](/.image/短信渠道.jpg)   | ![短信模板](/.image/短信模板.jpg) | ![短信日志](/.image/短信日志.jpg) |\n| 字典 & 敏感词 | ![字典类型](/.image/字典类型.jpg)   | ![字典数据](/.image/字典数据.jpg) | ![敏感词](/.image/敏感词.jpg)  |\n| 错误码 & 通知 | ![错误码管理](/.image/错误码管理.jpg) | ![通知公告](/.image/通知公告.jpg) | -                        |\n\n### 工作流程\n\n| 模块      | biu                             | biu                             | biu                             |\n|---------|---------------------------------|---------------------------------|---------------------------------|\n| 流程模型    | ![流程模型-列表](/.image/流程模型-列表.jpg) | ![流程模型-设计](/.image/流程模型-设计.jpg) | ![流程模型-定义](/.image/流程模型-定义.jpg) |\n| 表单 & 分组 | ![流程表单](/.image/流程表单.jpg)       | ![用户分组](/.image/用户分组.jpg)       | -                               |\n| 我的流程    | ![我的流程-列表](/.image/我的流程-列表.jpg) | ![我的流程-发起](/.image/我的流程-发起.jpg) | ![我的流程-详情](/.image/我的流程-详情.jpg) |\n| 待办 & 已办 | ![任务列表-审批](/.image/任务列表-审批.jpg) | ![任务列表-待办](/.image/任务列表-待办.jpg) | ![任务列表-已办](/.image/任务列表-已办.jpg) |\n| OA 请假   | ![OA请假-列表](/.image/OA请假-列表.jpg) | ![OA请假-发起](/.image/OA请假-发起.jpg) | ![OA请假-详情](/.image/OA请假-详情.jpg) |\n\n### 基础设施\n\n| 模块            | biu                           | biu                         | biu                       |\n|---------------|-------------------------------|-----------------------------|---------------------------|\n| 代码生成          | ![代码生成](/.image/代码生成.jpg)     | ![生成效果](/.image/生成效果.jpg)   | -                         |\n| 文档            | ![系统接口](/.image/系统接口.jpg)     | ![数据库文档](/.image/数据库文档.jpg) | -                         |\n| 文件 & 配置       | ![文件配置](/.image/文件配置.jpg)     | ![文件管理](/.image/文件管理2.jpg)  | ![配置管理](/.image/配置管理.jpg) |\n| 定时任务          | ![定时任务](/.image/定时任务.jpg)     | ![任务日志](/.image/任务日志.jpg)   | -                         |\n| API 日志        | ![访问日志](/.image/访问日志.jpg)     | ![错误日志](/.image/错误日志.jpg)   | -                         |\n| MySQL & Redis | ![MySQL](/.image/MySQL.jpg)   | ![Redis](/.image/Redis.jpg) | -                         |\n| 监控平台          | ![Java监控](/.image/Java监控.jpg) | ![链路追踪](/.image/链路追踪.jpg)   | ![日志中心](/.image/日志中心.jpg) |\n\n### 支付系统\n\n| 模块      | biu                       | biu                             | biu                             |\n|---------|---------------------------|---------------------------------|---------------------------------|\n| 商家 & 应用 | ![商户信息](/.image/商户信息.jpg) | ![应用信息-列表](/.image/应用信息-列表.jpg) | ![应用信息-编辑](/.image/应用信息-编辑.jpg) |\n| 支付 & 退款 | ![支付订单](/.image/支付订单.jpg) | ![退款订单](/.image/退款订单.jpg)       | ---                             |\n### 数据报表\n\n| 模块    | biu                             | biu                             | biu                                   |\n|-------|---------------------------------|---------------------------------|---------------------------------------|\n| 报表设计器 | ![数据报表](/.image/报表设计器-数据报表.jpg) | ![图形报表](/.image/报表设计器-图形报表.jpg) | ![报表设计器-打印设计](/.image/报表设计器-打印设计.jpg) |\n| 大屏设计器 | ![大屏列表](/.image/大屏设计器-列表.jpg)   | ![大屏预览](/.image/大屏设计器-预览.jpg)   | ![大屏编辑](/.image/大屏设计器-编辑.jpg)         |\n\n### 移动端（管理后台）\n\n| biu                              | biu                              | biu                              |\n|----------------------------------|----------------------------------|----------------------------------|\n| ![](/.image/admin-uniapp/01.png) | ![](/.image/admin-uniapp/02.png) | ![](/.image/admin-uniapp/03.png) |\n| ![](/.image/admin-uniapp/04.png) | ![](/.image/admin-uniapp/05.png) | ![](/.image/admin-uniapp/06.png) |\n| ![](/.image/admin-uniapp/07.png) | ![](/.image/admin-uniapp/08.png) | ![](/.image/admin-uniapp/09.png) |\n\n目前已经实现登录、我的、工作台、编辑资料、头像修改、密码修改、常见问题、关于我们等基础功能。\n\n', 24120, 9676, 500, 0, 0, '1', '2025-03-08 17:51:50', '1', '2025-03-08 17:51:50', b'0', 1);
INSERT INTO `ai_knowledge_document` VALUES (19, 5, '1_yudao-cloud-mini-jdk17-整合seata.docx', 'http://test.yudao.iocoder.cn/d2a8a80545b136192398fbeb5f9b917c7845c4dc186ddf142bf61f83a1cae51f.docx', '一，创建seata子模块\n在yudao-framework模块下新建子模块yudao-spring-boot-starter-seata,\n然后在这个yudao-spring-boot-starter-seata模块的pom文件中引入依赖，\n<dependency>\n            <groupId>cn.iocoder.cloud</groupId>\n            <artifactId>yudao-common</artifactId>\n            <version>2.3.0-SNAPSHOT</version>\n        </dependency>\n        <dependency>\n            <groupId>com.alibaba.cloud</groupId>\n            <artifactId>spring-cloud-alibaba-seata</artifactId>\n            <version>2023.0.1.2</version>\n        </dependency>\n        <dependency>\n            <groupId>io.seata</groupId>\n            <artifactId>seata-spring-boot-starter</artifactId>\n            <!-- 注意不能用2.0.0版本，事务不生效有bug-->\n            <version>1.8.0</version>\n        </dependency>\n        <dependency>\n            <groupId>io.seata</groupId>\n            <artifactId>seata-all</artifactId>\n            <!-- 注意不能用2.0.0版本，事务不生效有bug,The AdapterSpringSeataInterceptor\'s order \'2147483647\' is lower or equals than TransactionInterceptor\'s order \'2147483647\' , reset AdapterSpringSeataInterceptor\'s order to higher order \'2147483646\'.-->\n            <version>1.8.0</version>\n            <exclusions>\n                <exclusion>\n                    <groupId>log4j</groupId>\n                    <artifactId>log4j</artifactId>\n                </exclusion>\n            </exclusions>\n        </dependency>\n        <dependency>\n            <groupId>io.seata</groupId>\n            <artifactId>seata-spring-autoconfigure-client</artifactId>\n            <!-- 注意不能用2.0.0版本，事务不生效有bug-->\n            <version>1.8.0</version>\n        </dependency>\n        <dependency>\n            <groupId>com.caucho</groupId>\n            <artifactId>hessian</artifactId>\n            <version>4.0.63</version>\n        </dependency>\n        <dependency>\n            <groupId>io.protostuff</groupId>\n            <artifactId>protostuff-core</artifactId>\n            <version>1.7.2</version>\n        </dependency>\n        <dependency>\n            <groupId>io.protostuff</groupId>\n            <artifactId>protostuff-runtime</artifactId>\n            <version>1.7.2</version>\n        </dependency>\n\n二，部署seata服务端\nseata是用于分布式事务的，\n目前我用的是seata-server2.0.0版的windows版，nacos服务器版本我用的2.0.3\nseata\\conf\\application.yml配置文件中：\n\nserver:\n  port: 7091\n\nspring:\n  application:\n    name: seata-server\n\nlogging:\n  config: classpath:logback-spring.xml\n  file:\n    path: ${log.home:${user.home}/logs/seata}\n  extend:\n    logstash-appender:\n      destination: 127.0.0.1:4560\n    kafka-appender:\n      bootstrap-servers: 127.0.0.1:9092\n      topic: logback_to_logstash\n\nconsole:\n  user:\n    username: seata\n    password: seata\nseata:\n  config:\n    # support: nacos, consul, apollo, zk, etcd3\n    type: nacos\n    nacos:\n      server-addr: 192.168.1.146:8848\n      namespace: zma-dev\n      group: SEATA_GROUP\n      username: nacos\n      password: nacos\n      context-path:\n      ##if use MSE Nacos with auth, mutex with username/password attribute\n      #access-key:\n      #secret-key:\n      data-id: seataServer.properties\n  registry:\n    # support: nacos, eureka, redis, zk, consul, etcd3, sofa\n    type: nacos\n    preferred-networks: 30.240.*\n    nacos:\n      application: seata-server\n      server-addr: 192.168.1.146:8848\n      group: SEATA_GROUP\n      namespace: zma-dev\n      cluster: default\n      username: nacod\n      password: nacos\n      context-path:\n      ##if use MSE Nacos with auth, mutex with username/password attribute\n      #access-key:\n  store:\n    # support: file 、 db 、 redis 、 raft\n    mode: file\n  #  server:\n  #    service-port: 8091 #If not configured, the default is \'${server.port} + 1000\'\n  security:\n    secretKey: SeataSecretKey0c382ef121d778043159209298fd40bf3850a017\n    tokenValidityInMilliseconds: 1800000\n    ignore:\n      urls: /,/**/*.css,/**/*.js,/**/*.html,/**/*.map,/**/*.svg,/**/*.png,/**/*.jpeg,/**/*.ico,/api/v1/auth/login,/metadata/v1/**\nnacos配置中心里面，建一个seataServer.properties配置文件，内容如下：\nData ID: seataServer.properties\nGroup: SEATA_GROUP\nservice.enableDegrade=false\nservice.disableGlobalTransaction=false\nservice.vgroupMapping.default-tx-group=default\nservice.vgroupMapping.order-service-group=default\n启动seata-server,\n在seata\\bin下，双击seata-server.bat文件启动，查看nacos中是否有seata-server的服务，如果有，证明启动成功。\n或者去访问seata的管理页面地址：http://localhost:7091,如果能正常打开，证明seata已经启动成功。\n二，微服务中配置seata\nspringcloud的微服务中配置seata\n先在微服务的pom.xml中添加依赖\n <!-- seata -->\n        <dependency>\n            <groupId>cn.iocoder.cloud</groupId>\n            <artifactId>yudao-spring-boot-starter-seata</artifactId>\n            <version>2.3.0-SNAPSHOT</version>\n        </dependency>\n然后在springboot微服务的yml中配置：\n# Seata 配置项，对应 SeataProperties 类\nseata:\n  application-id: ${spring.application.name} # Seata 应用编号，默认为 ${spring.application.name}\n  tx-service-group: default-tx-group # Seata 事务组编号，用于 TC 集群名\n  # Seata 服务配置项，对应 ServiceProperties 类\n  service:\n    vgroup-mapping:\n      default-tx-group: default\n  data-source-proxy-mode: AT\n  # Seata 注册中心配置项，对应 RegistryProperties 类\n  registry:\n    type: nacos # 注册中心类型，默认为 file\n    nacos:\n      cluster: default # 使用的 Seata 分组\n      namespace: zma-dev # Nacos 命名空间\n      #      serverAddr: 192.168.1.17:8848 # Nacos 服务地址\n      serverAddr: localhost:8848 # Nacos 服务地址\n      group : SEATA_GROUP\n      username: nacos\n      password: nacos\n然后在微服务启动类上加注解\n//开启seata对数据源的自动代理\n@EnableAutoDataSourceProxy \n//开启seata对FeignClient运程调用的自动配置\n@EnableFeignClients(defaultConfiguration = SeataFeignClientAutoConfiguration.class)\n\n三，测试全局事务\n先写一个测试接口，我是在TenantController中写的\n @GetMapping(\"/test-seata\")\n    @Operation(summary = \"测试seata\")\n    public CommonResult testSeata() {\n        return success(menuService.testSeata());\n    }\nmenuService业务实现方法上加注解@GlobalTransactional(name = \"testSeata\",rollbackFor = Exception.class),\n这个注解中的name的值要保证唯一性，我这里直接用的方法，如果你当前项目中有多个方法名与当前方法名相同，那就要区别开，比如前面再加上微服务名-controller名，后面再加后缀的方式，保证唯一就行了，如：systemServer-testController-testSeata-1。\n@Override\n    @GlobalTransactional(name = \"testSeata\",rollbackFor = Exception.class)\n    public Object testSeata() {\n        MenuDO menuDO = menuMapper.selectById(2815);\n        menuDO.setName(\"测试111\");\n        //本微服务system微服务中修改stem_menu表，此修改操作会成功\n        menuMapper.updateById(menuDO);\n        //通过FeignClient远程调用infra微服务中的方法testSeata，\n        //在testSeata插入一条数据到yudao_demo01_contact表，此插入操作会成功\n        Boolean bool = apiErrorLogApi.testSeata();\n        //通过FeignClient远程调用infra微服务中的方法testSeata2，\n        //在testSeata2方法中插入一条数据到yudao_demo02_category表，此插入操作会失败，因为id与数据库中的已有的id重复\n        Boolean common = apiErrorLogApi.testSeata2();\n        //执行完会去看数据库中的三张表中的数据是否有回滚，如果有回滚，证明全局事务生效了。\n        return true;\n    }\n注意1：要用全局事务时，远程调用的方法不能以CommonResult返回，要以实体数据实体返回，比如我当前方法只需要一个String字符串，那就以String返回，再比如我需要一个用户对象，那个直接以User返回，不要封装到带有code,msg,data的Result结果对象中返回，不然事务会不生效。\n注意2：远程调用的方法中不能有try{}catch (Exception e) {},不然事务也不会生效。\n然后，数据库中要加seata处理事务的表,如果有多个数据库，那么每个数据库中都要加这张表。\nCREATE TABLE `undo_log` (\n  `id` bigint NOT NULL AUTO_INCREMENT,\n  `branch_id` bigint NOT NULL,\n  `xid` varchar(100) NOT NULL,\n  `context` varchar(128) NOT NULL,\n  `rollback_info` longblob NOT NULL,\n  `log_status` int NOT NULL,\n  `log_created` datetime NOT NULL,\n  `log_modified` datetime NOT NULL,\n  `ext` varchar(100) DEFAULT NULL,\n  PRIMARY KEY (`id`),\n  UNIQUE KEY `ux_undo_log` (`xid`,`branch_id`)\n) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8mb3;\n然后启动gateway,system微服务与infra微服务，\n最后，用postman请求system微服务中的这个/test-seata接口，测试数据库的数据的修改与插入是否有回滚，是否有同步成功，同步失败。\n\n一，创建 seata 子模块\n\n在yudao-framework 模块下新建子模块 yudao-spring-boot-starter- seata,\n\n然后在这个 yudao-spring-boot-starter- seata模块的pom文件中引入依赖，\n\n<dependency>\n\n<groupId> cn.iocoder.cloud</groupId>\n\n<artifactId>y udao-common</artifactId>\n\n<version>2.3.0-SNAPSHOT</version>\n\n</dependency>\n\n<dependency>\n\n<groupId>com.alibaba.cloud</groupId>\n\n<artifactId>spring-cloud-alibaba-\n\nseata</artifactId>\n\n<version>2023.0.1.2</version>\n\n</dependency>\n\n<dependency>\n\n<groupId>io.seata</groupId>\n\n<artifactId>seata-spring-boot-\n\nstarter</artifactId>\n\n<!--注意不能用 2.0.0版本，事务不生效有 bug-->\n\n<version>1.8.0</version>\n\n</dependency>\n\n<dependency>\n\n<groupId>io.seata</groupId>\n\n<artifactId>seata-all</artifactId>\n\n<!--注意不能用 2.0.0版本，事务不生效有 bug,The\n\nAdapterSpringSeataInterceptor\'s order\'2147483647\' is\n\nlowerorequals thanTransactionInterceptor\'s order\n\n\'2147483647\' ,resetAdapterSpringSeataInterceptor\'s\n\nordertohigher order\'2147483646\'.-->\n\n<version>1.8.0</version>\n\n<exclusions>\n\n<exclusion>\n\n<groupId>log4j</groupId>\n\n<artifactId>log4j</artifactId>\n\n</exclusion>\n\n</exclusions>\n\n</dependency>\n\n<dependency>\n\n<groupId>io.seata</groupId>\n\n', 8493, 2872, 500, 0, 0, '1', '2025-03-09 09:15:30', '1', '2025-03-09 09:15:30', b'0', 1);
INSERT INTO `ai_knowledge_document` VALUES (20, 3, '1_yudao-cloud-mini-jdk17-整合seata.docx', 'http://test.yudao.iocoder.cn/d2a8a80545b136192398fbeb5f9b917c7845c4dc186ddf142bf61f83a1cae51f.docx', '一，创建seata子模块\n在yudao-framework模块下新建子模块yudao-spring-boot-starter-seata,\n然后在这个yudao-spring-boot-starter-seata模块的pom文件中引入依赖，\n<dependency>\n            <groupId>cn.iocoder.cloud</groupId>\n            <artifactId>yudao-common</artifactId>\n            <version>2.3.0-SNAPSHOT</version>\n        </dependency>\n        <dependency>\n            <groupId>com.alibaba.cloud</groupId>\n            <artifactId>spring-cloud-alibaba-seata</artifactId>\n            <version>2023.0.1.2</version>\n        </dependency>\n        <dependency>\n            <groupId>io.seata</groupId>\n            <artifactId>seata-spring-boot-starter</artifactId>\n            <!-- 注意不能用2.0.0版本，事务不生效有bug-->\n            <version>1.8.0</version>\n        </dependency>\n        <dependency>\n            <groupId>io.seata</groupId>\n            <artifactId>seata-all</artifactId>\n            <!-- 注意不能用2.0.0版本，事务不生效有bug,The AdapterSpringSeataInterceptor\'s order \'2147483647\' is lower or equals than TransactionInterceptor\'s order \'2147483647\' , reset AdapterSpringSeataInterceptor\'s order to higher order \'2147483646\'.-->\n            <version>1.8.0</version>\n            <exclusions>\n                <exclusion>\n                    <groupId>log4j</groupId>\n                    <artifactId>log4j</artifactId>\n                </exclusion>\n            </exclusions>\n        </dependency>\n        <dependency>\n            <groupId>io.seata</groupId>\n            <artifactId>seata-spring-autoconfigure-client</artifactId>\n            <!-- 注意不能用2.0.0版本，事务不生效有bug-->\n            <version>1.8.0</version>\n        </dependency>\n        <dependency>\n            <groupId>com.caucho</groupId>\n            <artifactId>hessian</artifactId>\n            <version>4.0.63</version>\n        </dependency>\n        <dependency>\n            <groupId>io.protostuff</groupId>\n            <artifactId>protostuff-core</artifactId>\n            <version>1.7.2</version>\n        </dependency>\n        <dependency>\n            <groupId>io.protostuff</groupId>\n            <artifactId>protostuff-runtime</artifactId>\n            <version>1.7.2</version>\n        </dependency>\n\n二，部署seata服务端\nseata是用于分布式事务的，\n目前我用的是seata-server2.0.0版的windows版，nacos服务器版本我用的2.0.3\nseata\\conf\\application.yml配置文件中：\n\nserver:\n  port: 7091\n\nspring:\n  application:\n    name: seata-server\n\nlogging:\n  config: classpath:logback-spring.xml\n  file:\n    path: ${log.home:${user.home}/logs/seata}\n  extend:\n    logstash-appender:\n      destination: 127.0.0.1:4560\n    kafka-appender:\n      bootstrap-servers: 127.0.0.1:9092\n      topic: logback_to_logstash\n\nconsole:\n  user:\n    username: seata\n    password: seata\nseata:\n  config:\n    # support: nacos, consul, apollo, zk, etcd3\n    type: nacos\n    nacos:\n      server-addr: 192.168.1.146:8848\n      namespace: zma-dev\n      group: SEATA_GROUP\n      username: nacos\n      password: nacos\n      context-path:\n      ##if use MSE Nacos with auth, mutex with username/password attribute\n      #access-key:\n      #secret-key:\n      data-id: seataServer.properties\n  registry:\n    # support: nacos, eureka, redis, zk, consul, etcd3, sofa\n    type: nacos\n    preferred-networks: 30.240.*\n    nacos:\n      application: seata-server\n      server-addr: 192.168.1.146:8848\n      group: SEATA_GROUP\n      namespace: zma-dev\n      cluster: default\n      username: nacod\n      password: nacos\n      context-path:\n      ##if use MSE Nacos with auth, mutex with username/password attribute\n      #access-key:\n  store:\n    # support: file 、 db 、 redis 、 raft\n    mode: file\n  #  server:\n  #    service-port: 8091 #If not configured, the default is \'${server.port} + 1000\'\n  security:\n    secretKey: SeataSecretKey0c382ef121d778043159209298fd40bf3850a017\n    tokenValidityInMilliseconds: 1800000\n    ignore:\n      urls: /,/**/*.css,/**/*.js,/**/*.html,/**/*.map,/**/*.svg,/**/*.png,/**/*.jpeg,/**/*.ico,/api/v1/auth/login,/metadata/v1/**\nnacos配置中心里面，建一个seataServer.properties配置文件，内容如下：\nData ID: seataServer.properties\nGroup: SEATA_GROUP\nservice.enableDegrade=false\nservice.disableGlobalTransaction=false\nservice.vgroupMapping.default-tx-group=default\nservice.vgroupMapping.order-service-group=default\n启动seata-server,\n在seata\\bin下，双击seata-server.bat文件启动，查看nacos中是否有seata-server的服务，如果有，证明启动成功。\n或者去访问seata的管理页面地址：http://localhost:7091,如果能正常打开，证明seata已经启动成功。\n二，微服务中配置seata\nspringcloud的微服务中配置seata\n先在微服务的pom.xml中添加依赖\n <!-- seata -->\n        <dependency>\n            <groupId>cn.iocoder.cloud</groupId>\n            <artifactId>yudao-spring-boot-starter-seata</artifactId>\n            <version>2.3.0-SNAPSHOT</version>\n        </dependency>\n然后在springboot微服务的yml中配置：\n# Seata 配置项，对应 SeataProperties 类\nseata:\n  application-id: ${spring.application.name} # Seata 应用编号，默认为 ${spring.application.name}\n  tx-service-group: default-tx-group # Seata 事务组编号，用于 TC 集群名\n  # Seata 服务配置项，对应 ServiceProperties 类\n  service:\n    vgroup-mapping:\n      default-tx-group: default\n  data-source-proxy-mode: AT\n  # Seata 注册中心配置项，对应 RegistryProperties 类\n  registry:\n    type: nacos # 注册中心类型，默认为 file\n    nacos:\n      cluster: default # 使用的 Seata 分组\n      namespace: zma-dev # Nacos 命名空间\n      #      serverAddr: 192.168.1.17:8848 # Nacos 服务地址\n      serverAddr: localhost:8848 # Nacos 服务地址\n      group : SEATA_GROUP\n      username: nacos\n      password: nacos\n然后在微服务启动类上加注解\n//开启seata对数据源的自动代理\n@EnableAutoDataSourceProxy \n//开启seata对FeignClient运程调用的自动配置\n@EnableFeignClients(defaultConfiguration = SeataFeignClientAutoConfiguration.class)\n\n三，测试全局事务\n先写一个测试接口，我是在TenantController中写的\n @GetMapping(\"/test-seata\")\n    @Operation(summary = \"测试seata\")\n    public CommonResult testSeata() {\n        return success(menuService.testSeata());\n    }\nmenuService业务实现方法上加注解@GlobalTransactional(name = \"testSeata\",rollbackFor = Exception.class),\n这个注解中的name的值要保证唯一性，我这里直接用的方法，如果你当前项目中有多个方法名与当前方法名相同，那就要区别开，比如前面再加上微服务名-controller名，后面再加后缀的方式，保证唯一就行了，如：systemServer-testController-testSeata-1。\n@Override\n    @GlobalTransactional(name = \"testSeata\",rollbackFor = Exception.class)\n    public Object testSeata() {\n        MenuDO menuDO = menuMapper.selectById(2815);\n        menuDO.setName(\"测试111\");\n        //本微服务system微服务中修改stem_menu表，此修改操作会成功\n        menuMapper.updateById(menuDO);\n        //通过FeignClient远程调用infra微服务中的方法testSeata，\n        //在testSeata插入一条数据到yudao_demo01_contact表，此插入操作会成功\n        Boolean bool = apiErrorLogApi.testSeata();\n        //通过FeignClient远程调用infra微服务中的方法testSeata2，\n        //在testSeata2方法中插入一条数据到yudao_demo02_category表，此插入操作会失败，因为id与数据库中的已有的id重复\n        Boolean common = apiErrorLogApi.testSeata2();\n        //执行完会去看数据库中的三张表中的数据是否有回滚，如果有回滚，证明全局事务生效了。\n        return true;\n    }\n注意1：要用全局事务时，远程调用的方法不能以CommonResult返回，要以实体数据实体返回，比如我当前方法只需要一个String字符串，那就以String返回，再比如我需要一个用户对象，那个直接以User返回，不要封装到带有code,msg,data的Result结果对象中返回，不然事务会不生效。\n注意2：远程调用的方法中不能有try{}catch (Exception e) {},不然事务也不会生效。\n然后，数据库中要加seata处理事务的表,如果有多个数据库，那么每个数据库中都要加这张表。\nCREATE TABLE `undo_log` (\n  `id` bigint NOT NULL AUTO_INCREMENT,\n  `branch_id` bigint NOT NULL,\n  `xid` varchar(100) NOT NULL,\n  `context` varchar(128) NOT NULL,\n  `rollback_info` longblob NOT NULL,\n  `log_status` int NOT NULL,\n  `log_created` datetime NOT NULL,\n  `log_modified` datetime NOT NULL,\n  `ext` varchar(100) DEFAULT NULL,\n  PRIMARY KEY (`id`),\n  UNIQUE KEY `ux_undo_log` (`xid`,`branch_id`)\n) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8mb3;\n然后启动gateway,system微服务与infra微服务，\n最后，用postman请求system微服务中的这个/test-seata接口，测试数据库的数据的修改与插入是否有回滚，是否有同步成功，同步失败。\n\n一，创建 seata 子模块\n\n在yudao-framework 模块下新建子模块 yudao-spring-boot-starter- seata,\n\n然后在这个 yudao-spring-boot-starter- seata模块的pom文件中引入依赖，\n\n<dependency>\n\n<groupId> cn.iocoder.cloud</groupId>\n\n<artifactId>y udao-common</artifactId>\n\n<version>2.3.0-SNAPSHOT</version>\n\n</dependency>\n\n<dependency>\n\n<groupId>com.alibaba.cloud</groupId>\n\n<artifactId>spring-cloud-alibaba-\n\nseata</artifactId>\n\n<version>2023.0.1.2</version>\n\n</dependency>\n\n<dependency>\n\n<groupId>io.seata</groupId>\n\n<artifactId>seata-spring-boot-\n\nstarter</artifactId>\n\n<!--注意不能用 2.0.0版本，事务不生效有 bug-->\n\n<version>1.8.0</version>\n\n</dependency>\n\n<dependency>\n\n<groupId>io.seata</groupId>\n\n<artifactId>seata-all</artifactId>\n\n<!--注意不能用 2.0.0版本，事务不生效有 bug,The\n\nAdapterSpringSeataInterceptor\'s order\'2147483647\' is\n\nlowerorequals thanTransactionInterceptor\'s order\n\n\'2147483647\' ,resetAdapterSpringSeataInterceptor\'s\n\nordertohigher order\'2147483646\'.-->\n\n<version>1.8.0</version>\n\n<exclusions>\n\n<exclusion>\n\n<groupId>log4j</groupId>\n\n<artifactId>log4j</artifactId>\n\n</exclusion>\n\n</exclusions>\n\n</dependency>\n\n<dependency>\n\n<groupId>io.seata</groupId>\n\n', 8493, 2872, 500, 0, 0, '1', '2025-03-09 18:31:44', '1', '2025-03-09 18:44:12', b'1', 1);
INSERT INTO `ai_knowledge_document` VALUES (21, 3, '31.4k！这是我见过最强的后台管理系统 ！！.md', 'http://test.yudao.iocoder.cn/530212386f51a33cb452e84599e341ca2f47adb7cfdaff6c99950993759158e4.md', '\n## 🐯 平台简介\n\n**芋道**，以开发者为中心，打造中国第一流的快速开发平台，全部开源，个人与企业可 100% 免费使用。\n\n![架构图](https://static.iocoder.cn/ruoyi-vue-pro-architecture.png)\n\n* 管理后台的 Vue3 版本采用 [vue-element-plus-admin](https://gitee.com/kailong110120130/vue-element-plus-admin) ，Vue2 版本采用 [vue-element-admin](https://github.com/PanJiaChen/vue-element-admin) \n* 管理后台的移动端采用 [uni-app](https://github.com/dcloudio/uni-app) 方案，一份代码多终端适配，同时支持 APP、小程序、H5！\n* 后端采用 Spring Boot、MySQL + MyBatis Plus、Redis + Redisson\n* 数据库可使用 MySQL、Oracle、PostgreSQL、SQL Server、MariaDB、国产达梦 DM、TiDB 等\n* 权限认证使用 Spring Security & Token & Redis，支持多终端、多种用户的认证系统，支持 SSO 单点登录\n* 支持加载动态权限菜单，按钮级别权限控制，本地缓存提升性能\n* 支持 SaaS 多租户系统，可自定义每个租户的权限，提供透明化的多租户底层封装\n* 工作流使用 Flowable，支持动态表单、在线设计流程、会签 / 或签、多种任务分配方式\n* 高效率开发，使用代码生成器可以一键生成前后端代码 + 单元测试 + Swagger 接口文档 + Validator 参数校验\n* 集成微信小程序、微信公众号、企业微信、钉钉等三方登陆，集成支付宝、微信等支付与退款\n* 集成阿里云、腾讯云等短信渠道，集成 MinIO、阿里云、腾讯云、七牛云等云存储服务\n* 集成报表设计器，支持数据报表、图形报表、打印设计等\n\n##  🐳 项目关系\n\n![架构演进](https://static.iocoder.cn/yudao-roadmap.png?imageView2/2/format/webp)\n\n三个项目的功能对比，可见社区共同整理的 [国产开源项目对比](https://www.yuque.com/xiatian-bsgny/lm0ec1/wqf8mn) 表格。\n\n* 项目地址：<https://gitee.com/zhijiantianya/ruoyi-vue-pro>\n* 官方文档：<https://doc.iocoder.cn/>\n* 演示地址：<http://dashboard.yudao.iocoder.cn>\n* 视频教程：<https://doc.iocoder.cn/video/>\n\n### 后端项目\n\n| 项目                                                              | Star                                                                                                                                                                                                                                                                                             | 简介                          |\n|-----------------------------------------------------------------|--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------|-----------------------------|\n| [ruoyi-vue-pro](https://gitee.com/zhijiantianya/ruoyi-vue-pro)  | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro)       | 基于 Spring Boot 多模块架构        |\n| [yudao-cloud](https://gitee.com/zhijiantianya/yudao-cloud)      | [![Gitee star](https://gitee.com/zhijiantianya/yudao-cloud/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/yudao-cloud) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/yudao-cloud.svg?style=social&label=Stars)](https://github.com/YunaiV/yudao-cloud)               | 基于 Spring Cloud 微服务架构       |\n| [Spring-Boot-Labs](https://gitee.com/yudaocode/SpringBoot-Labs) | [![Gitee star](https://gitee.com/yudaocode/SpringBoot-Labs/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/yudao-cloud) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/SpringBoot-Labs.svg?style=social&label=Stars)](https://github.com/yudaocode/SpringBoot-Labs) | 系统学习 Spring Boot & Cloud 专栏 |\n\n### 前端项目\n\n| 项目                                                                                                       | Star                                                                                                                                                                                                                                                                                                                                                           | 简介                              |\n|----------------------------------------------------------------------------------------------------------|----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------|---------------------------------|\n| [yudao-ui-admin-vue3](https://gitee.com/yudaocode/yudao-ui-admin-vue3)                                   | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-admin-vue3/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-admin-vue3) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-admin-vue3.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-admin-vue3)                                               | 基于 Vue3 + element-plus 实现的管理后台  |\n| [yudao-ui-admin](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin)               | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro/tree/master/yudao-ui-admin)               | 基于 Vue2 + element-ui 实现的管理后台    |\n| [yudao-ui-admin-uniapp](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin-uniapp) | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin-uniapp) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro/tree/master/yudao-ui-admin-uniapp) | 基于 uni-app + uni-ui 实现的管理后台的小程序 |\n| [yudao-ui-go-view](https://gitee.com/yudaocode/yudao-ui-go-view)                                         | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-go-view/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-go-view) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-go-view.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-go-view)                                                           | 基于 Vue3 + naive-ui 实现的大屏报表      |\n| [yudao-ui-app](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-app)                   | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-app) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro/tree/master/yudao-ui-app)                   | 基于 uni-app + uview 实现的用户 App    |\n\n## 😎 开源协议\n\n**为什么推荐使用本项目？**\n\n① 本项目采用比 Apache 2.0 更宽松的 [MIT License](https://gitee.com/zhijiantianya/ruoyi-vue-pro/blob/master/LICENSE) 开源协议，个人与企业可 100% 免费使用，不用保留类作者、Copyright 信息。\n\n② 代码全部开源，不会像其他项目一样，只开源部分代码，让你无法了解整个项目的架构设计。\n\n③ 代码整洁、架构整洁，遵循《阿里巴巴 Java 开发手册》规范，代码注释详细，57000 行 Java 代码，22000 行代码注释。\n\n## 🐼 内置功能\n\n系统内置多种多种业务功能，可以用于快速你的业务系统：\n\n![功能分层](https://static.iocoder.cn/ruoyi-vue-pro-biz.png)\n\n* 系统功能\n* 基础设施\n* 工作流程\n* 支付系统\n* 数据报表\n\n> 友情提示：本项目基于 RuoYi-Vue 修改，**重构优化**后端的代码，**美化**前端的界面。\n>\n> * 额外新增的功能，我们使用 🚀 标记。\n> * 重新实现的功能，我们使用 ⭐️ 标记。\n\n🙂 所有功能，都通过 **单元测试** 保证高质量。\n\n### 系统功能\n\n|     | 功能    | 描述                              |\n|-----|-------|---------------------------------|\n|     | 用户管理  | 用户是系统操作者，该功能主要完成系统用户配置          |\n| ⭐️  | 在线用户  | 当前系统中活跃用户状态监控，支持手动踢下线           |\n|     | 角色管理  | 角色菜单权限分配、设置角色按机构进行数据范围权限划分      |\n|     | 菜单管理  | 配置系统菜单、操作权限、按钮权限标识等，本地缓存提供性能    |\n|     | 部门管理  | 配置系统组织机构（公司、部门、小组），树结构展现支持数据权限  |\n|     | 岗位管理  | 配置系统用户所属担任职务                    |\n| 🚀  | 租户管理  | 配置系统租户，支持 SaaS 场景下的多租户功能        |\n| 🚀  | 租户套餐  | 配置租户套餐，自定每个租户的菜单、操作、按钮的权限       |\n|     | 字典管理  | 对系统中经常使用的一些较为固定的数据进行维护          |\n| 🚀  | 短信管理  | 短信渠道、短息模板、短信日志，对接阿里云、腾讯云等主流短信平台 |\n| 🚀  | 操作日志  | 系统正常操作日志记录和查询，集成 Swagger 生成日志内容 |\n| ⭐️  | 登录日志  | 系统登录日志记录查询，包含登录异常               |\n| 🚀  | 错误码管理 | 系统所有错误码的管理，可在线修改错误提示，无需重启服务     |\n|     | 通知公告  | 系统通知公告信息发布维护                    |\n| 🚀  | 敏感词  | 配置系统敏感词，支持标签分组                  |\n| 🚀  | 应用管理  | 管理 SSO 单点登录的应用，支持多种 OAuth2 授权方式 |\n\n### 工作流程\n\n|     | 功能    | 描述                                     |\n|-----|-------|----------------------------------------|\n| 🚀  | 流程模型  | 配置工作流的流程模型，支持文件导入与在线设计流程图，提供 7 种任务分配规则 |\n| 🚀  | 流程表单  | 拖动表单元素生成相应的工作流表单，覆盖 Element UI 所有的表单组件 |\n| 🚀  | 用户分组  | 自定义用户分组，可用于工作流的审批分组                    |\n| 🚀  | 我的流程  | 查看我发起的工作流程，支持新建、取消流程等操作，高亮流程图、审批时间线    |\n| 🚀  | 待办任务  | 查看自己【未】审批的工作任务，支持通过、不通过、转发、委派、退回等操作    |\n| 🚀  | 已办任务  | 查看自己【已】审批的工作任务，未来会支持回退操作               |\n| 🚀  | OA 请假 | 作为业务自定义接入工作流的使用示例，只需创建请求对应的工作流程，即可进行审批 |\n\n### 支付系统\n\n|     | 功能   | 描述                        |\n|-----|------|---------------------------|\n| 🚀  | 商户信息 | 管理商户信息，支持 Saas 场景下的多商户功能  |\n| 🚀  | 应用信息 | 配置商户的应用信息，对接支付宝、微信等多个支付渠道 |\n| 🚀  | 支付订单 | 查看用户发起的支付宝、微信等的【支付】订单     |\n| 🚀  | 退款订单 | 查看用户发起的支付宝、微信等的【退款】订单     |\n\nps：核心功能已经实现，正在对接微信小程序中...\n\n### 基础设施\n\n|     | 功能       | 描述                                           |\n|-----|----------|----------------------------------------------|\n| 🚀  | 代码生成     | 前后端代码的生成（Java、Vue、SQL、单元测试），支持 CRUD 下载       |\n| 🚀  | 系统接口     | 基于 Swagger 自动生成相关的 RESTful API 接口文档          |\n| 🚀  | 数据库文档    | 基于 Screw 自动生成数据库文档，支持导出 Word、HTML、MD 格式      |\n|     | 表单构建     | 拖动表单元素生成相应的 HTML 代码，支持导出 JSON、Vue 文件         |\n| 🚀  | 配置管理     | 对系统动态配置常用参数，支持 SpringBoot 加载                 |\n| ⭐️  | 定时任务     | 在线（添加、修改、删除)任务调度包含执行结果日志                     |\n| 🚀  | 文件服务     | 支持将文件存储到 S3（MinIO、阿里云、腾讯云、七牛云）、本地、FTP、数据库等      | \n| 🚀  | API 日志   | 包括 RESTful API 访问日志、异常日志两部分，方便排查 API 相关的问题   |\n|     | MySQL 监控 | 监视当前系统数据库连接池状态，可进行分析SQL找出系统性能瓶颈              |\n|     | Redis 监控 | 监控 Redis 数据库的使用情况，使用的 Redis Key 管理           |\n| 🚀  | 消息队列     | 基于 Redis 实现消息队列，Stream 提供集群消费，Pub/Sub 提供广播消费 |\n| 🚀  | Java 监控  | 基于 Spring Boot Admin 实现 Java 应用的监控           |\n| 🚀  | 链路追踪     | 接入 SkyWalking 组件，实现链路追踪                      |\n| 🚀  | 日志中心     | 接入 SkyWalking 组件，实现日志中心                      |\n| 🚀  | 分布式锁     | 基于 Redis 实现分布式锁，满足并发场景                       |\n| 🚀  | 幂等组件     | 基于 Redis 实现幂等组件，解决重复请求问题                     |\n| 🚀  | 服务保障     | 基于 Resilience4j 实现服务的稳定性，包括限流、熔断等功能          |\n| 🚀  | 日志服务     | 轻量级日志中心，查看远程服务器的日志                           |\n| 🚀  | 单元测试     | 基于 JUnit + Mockito 实现单元测试，保证功能的正确性、代码的质量等    |\n\n### 数据报表\n\n|     | 功能       | 描述                                           |\n|-----|----------|----------------------------------------------|\n| 🚀  | 报表设计器     | 支持数据报表、图形报表、打印设计等       |\n| 🚀  | 大屏设计器     | 建设中... 拖拽式实现可视化数据大屏          |\n\n## 🐨 技术栈\n\n| 项目                      | 说明                 |\n|-------------------------|-----------------------|\n| `yudao-dependencies`    | Maven 依赖版本管理       |\n| `yudao-framework`       | Java 框架拓展          |\n| `yudao-server`          | 管理后台 + 用户 APP 的服务端 |\n| `yudao-ui-admin`        | 管理后台的 Vue2 前端项目     |\n| `yudao-ui-admin-vue3`   | 管理后台的 Vue3 前端项目     |\n| `yudao-ui-admin-uniapp` | 管理后台的 uni-app 多端项目  |\n| `yudao-ui-app`          | 用户 APP 的 UI 界面     |\n| `yudao-module-system`   | 系统功能的 Module 模块    |\n| `yudao-module-member`   | 会员中心的 Module 模块    |\n| `yudao-module-infra`    | 基础设施的 Module 模块    |\n| `yudao-module-tool`     | 研发工具的 Module 模块    |\n| `yudao-module-bpm`      | 工作流程的 Module 模块    |\n| `yudao-module-pay`      | 支付系统的 Module 模块    |\n\n### 后端\n\n| 框架                                                                                         | 说明                   | 版本          | 学习指南                                                           |\n|---------------------------------------------------------------------------------------------|-----------------------|-------------|----------------------------------------------------------------|\n| [Spring Boot](https://spring.io/projects/spring-boot)                                       | 应用开发框架             | 2.7.6       | [文档](https://github.com/YunaiV/SpringBoot-Labs)                |\n| [MySQL](https://www.mysql.com/cn/)                                                          | 数据库服务器             | 5.7 / 8.0+  |                                                                |\n| [Druid](https://github.com/alibaba/druid)                                                   | JDBC 连接池、监控组件     | 1.2.15      | [文档](http://www.iocoder.cn/Spring-Boot/datasource-pool/?yudao) |\n| [MyBatis Plus](https://mp.baomidou.com/)                                                    | MyBatis 增强工具包       | 3.5.2       | [文档](http://www.iocoder.cn/Spring-Boot/MyBatis/?yudao)         |\n| [Dynamic Datasource](https://dynamic-datasource.com/)                                       | 动态数据源               | 3.6.0       | [文档](http://www.iocoder.cn/Spring-Boot/datasource-pool/?yudao) |\n| [Redis](https://redis.io/)                                                                  | key-value 数据库        | 5.0 / 6.0   |                                                                |\n| [Redisson](https://github.com/redisson/redisson)                                            | Redis 客户端            | 3.18.0      | [文档](http://www.iocoder.cn/Spring-Boot/Redis/?yudao)           |\n| [Spring MVC](https://github.com/spring-projects/spring-framework/tree/master/spring-webmvc) | MVC 框架               | 5.3.24      | [文档](http://www.iocoder.cn/SpringMVC/MVC/?yudao)               |\n| [Spring Security](https://github.com/spring-projects/spring-security)                       | Spring 安全框架         | 5.7.5       | [文档](http://www.iocoder.cn/Spring-Boot/Spring-Security/?yudao) |\n| [Hibernate Validator](https://github.com/hibernate/hibernate-validator)                     | 参数校验组件             | 6.2.5       | [文档](http://www.iocoder.cn/Spring-Boot/Validation/?yudao)      |\n| [Flowable](https://github.com/flowable/flowable-engine)                                     | 工作流引擎               | 6.7.2       | [文档](https://doc.iocoder.cn/bpm/)                                                     |\n| [Quartz](https://github.com/quartz-scheduler)                                               | 任务调度组件             | 2.3.2       | [文档](http://www.iocoder.cn/Spring-Boot/Job/?yudao)             |\n| [Knife4j](https://gitee.com/xiaoym/knife4j)                                                 | Swagger 增强 UI 实现    | 3.0.3       | [文档](http://www.iocoder.cn/Spring-Boot/Swagger/?yudao)         |\n| [Resilience4j](https://github.com/resilience4j/resilience4j)                                | 服务保障组件             | 1.7.1       | [文档](http://www.iocoder.cn/Spring-Boot/Resilience4j/?yudao)    |\n| [SkyWalking](https://skywalking.apache.org/)                                                | 分布式应用追踪系统        | 8.12.0      | [文档](http://www.iocoder.cn/Spring-Boot/SkyWalking/?yudao)      |\n| [Spring Boot Admin](https://github.com/codecentric/spring-boot-admin)                       | Spring Boot 监控平台    | 2.7.9       | [文档](http://www.iocoder.cn/Spring-Boot/Admin/?yudao)           |\n| [Jackson](https://github.com/FasterXML/jackson)                                             | JSON 工具库             | 2.13.3      |                                                                |\n| [MapStruct](https://mapstruct.org/)                                                         | Java Bean 转换         | 1.5.3.Final | [文档](http://www.iocoder.cn/Spring-Boot/MapStruct/?yudao)       |\n| [Lombok](https://projectlombok.org/)                                                        | 消除冗长的 Java 代码     | 1.18.24     | [文档](http://www.iocoder.cn/Spring-Boot/Lombok/?yudao)          |\n| [JUnit](https://junit.org/junit5/)                                                          | Java 单元测试框架        | 5.8.2       | -                                                              |\n| [Mockito](https://github.com/mockito/mockito)                                               | Java Mock 框架         | 4.8.0       | -                                                              |\n\n### [管理后台 Vue2 前端](./yudao-ui-admin)\n\n| 框架                                                                           | 说明            | 版本     |\n|------------------------------------------------------------------------------|---------------|--------|\n| [Vue](https://cn.vuejs.org/index.html)                                       | JavaScript 框架 | 2.7.14 |\n| [Vue Element Admin](https://panjiachen.github.io/vue-element-admin-site/zh/) | 后台前端解决方案      | -      |\n\n### [管理后台 Vue3 前端](./yudao-ui-admin-vue3)\n\n| 框架                                                                  |     说明      |   版本   |\n|----------------------------------------------------------------------|:------------:|:------:|\n| [Vue](https://staging-cn.vuejs.org/)                                 |   Vue 框架    | 3.2.45 |\n| [Vite](https://cn.vitejs.dev//)                                      | 开发与构建工具  | 4.0.3  |\n| [Element Plus](https://element-plus.org/zh-CN/)                      | Element Plus | 2.2.27 |\n| [TypeScript](https://www.typescriptlang.org/docs/)                   |  TypeScript  | 4.9.4  |\n| [pinia](https://pinia.vuejs.org/)                                    |    vuex5     | 2.0.28 |\n| [vue-i18n](https://kazupon.github.io/vue-i18n/zh/introduction.html/) |    国际化     | 9.2.2  |\n| [vxe-table](https://vxetable.cn/)                                    |  vue最强表单  | 4.3.7  |\n\n### [管理后台 uni-app 跨端](./yudao-ui-admin-uniapp)\n\n| 框架                                                                  | 说明               | 版本     |\n|----------------------------------------------------------------------|------------------|--------|\n| [uni-app](hhttps://github.com/dcloudio/uni-app)                                 | 跨平台框架           | 2.0.0 |\n| [uni-ui](https://github.com/dcloudio/uni-ui)                                      | 基于 uni-app 的 UI 框架          | 1.4.20  |\n\n## 🐷 演示图\n\n**效果预览** ：\n\n![首页](https://mmbiz.qpic.cn/mmbiz/iaIdQfEric9Txw85YtbKNvl0ibKkgxeiahe5GYiamW2FAgbicPCzMAx37hy26WL8wtcgGqU8olicAYgAlDyGwIJtgsc6Q/640?wx_fmt=other&wxfrom=5&wx_lazy=1&wx_co=1)\n\n![令牌管理](https://mmbiz.qpic.cn/mmbiz/iaIdQfEric9Txw85YtbKNvl0ibKkgxeiahe5foMLJmVhW95QMKxkCricxPu107iboFGuN6XfVdTh7FrroB0fcX6SMFaw/640?wx_fmt=other&wxfrom=5&wx_lazy=1&wx_co=1)\n\n![流程模型-设计](https://mmbiz.qpic.cn/mmbiz/iaIdQfEric9Txw85YtbKNvl0ibKkgxeiahe5SiaibhtBlnP9OlOm5AsNE386jRpRAwHTgh0seL7tNiceNXCVhDOK72Xrg/640?wx_fmt=other&wxfrom=5&wx_lazy=1&wx_co=1)\n\n![大屏设计](https://gitee.com/yudaocode/yudao-ui-go-view/raw/master/readme/preview.png)\n', 18425, 6747, 500, 0, 0, '1', '2025-03-09 18:45:52', '1', '2025-03-09 18:45:52', b'0', 1);
INSERT INTO `ai_knowledge_document` VALUES (22, 2, '31.4k！这是我见过最强的后台管理系统 ！！.md', 'http://test.yudao.iocoder.cn/530212386f51a33cb452e84599e341ca2f47adb7cfdaff6c99950993759158e4.md', '\n## 🐯 平台简介\n\n**芋道**，以开发者为中心，打造中国第一流的快速开发平台，全部开源，个人与企业可 100% 免费使用。\n\n![架构图](https://static.iocoder.cn/ruoyi-vue-pro-architecture.png)\n\n* 管理后台的 Vue3 版本采用 [vue-element-plus-admin](https://gitee.com/kailong110120130/vue-element-plus-admin) ，Vue2 版本采用 [vue-element-admin](https://github.com/PanJiaChen/vue-element-admin) \n* 管理后台的移动端采用 [uni-app](https://github.com/dcloudio/uni-app) 方案，一份代码多终端适配，同时支持 APP、小程序、H5！\n* 后端采用 Spring Boot、MySQL + MyBatis Plus、Redis + Redisson\n* 数据库可使用 MySQL、Oracle、PostgreSQL、SQL Server、MariaDB、国产达梦 DM、TiDB 等\n* 权限认证使用 Spring Security & Token & Redis，支持多终端、多种用户的认证系统，支持 SSO 单点登录\n* 支持加载动态权限菜单，按钮级别权限控制，本地缓存提升性能\n* 支持 SaaS 多租户系统，可自定义每个租户的权限，提供透明化的多租户底层封装\n* 工作流使用 Flowable，支持动态表单、在线设计流程、会签 / 或签、多种任务分配方式\n* 高效率开发，使用代码生成器可以一键生成前后端代码 + 单元测试 + Swagger 接口文档 + Validator 参数校验\n* 集成微信小程序、微信公众号、企业微信、钉钉等三方登陆，集成支付宝、微信等支付与退款\n* 集成阿里云、腾讯云等短信渠道，集成 MinIO、阿里云、腾讯云、七牛云等云存储服务\n* 集成报表设计器，支持数据报表、图形报表、打印设计等\n\n##  🐳 项目关系\n\n![架构演进](https://static.iocoder.cn/yudao-roadmap.png?imageView2/2/format/webp)\n\n三个项目的功能对比，可见社区共同整理的 [国产开源项目对比](https://www.yuque.com/xiatian-bsgny/lm0ec1/wqf8mn) 表格。\n\n* 项目地址：<https://gitee.com/zhijiantianya/ruoyi-vue-pro>\n* 官方文档：<https://doc.iocoder.cn/>\n* 演示地址：<http://dashboard.yudao.iocoder.cn>\n* 视频教程：<https://doc.iocoder.cn/video/>\n\n### 后端项目\n\n| 项目                                                              | Star                                                                                                                                                                                                                                                                                             | 简介                          |\n|-----------------------------------------------------------------|--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------|-----------------------------|\n| [ruoyi-vue-pro](https://gitee.com/zhijiantianya/ruoyi-vue-pro)  | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro)       | 基于 Spring Boot 多模块架构        |\n| [yudao-cloud](https://gitee.com/zhijiantianya/yudao-cloud)      | [![Gitee star](https://gitee.com/zhijiantianya/yudao-cloud/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/yudao-cloud) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/yudao-cloud.svg?style=social&label=Stars)](https://github.com/YunaiV/yudao-cloud)               | 基于 Spring Cloud 微服务架构       |\n| [Spring-Boot-Labs](https://gitee.com/yudaocode/SpringBoot-Labs) | [![Gitee star](https://gitee.com/yudaocode/SpringBoot-Labs/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/yudao-cloud) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/SpringBoot-Labs.svg?style=social&label=Stars)](https://github.com/yudaocode/SpringBoot-Labs) | 系统学习 Spring Boot & Cloud 专栏 |\n\n### 前端项目\n\n| 项目                                                                                                       | Star                                                                                                                                                                                                                                                                                                                                                           | 简介                              |\n|----------------------------------------------------------------------------------------------------------|----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------|---------------------------------|\n| [yudao-ui-admin-vue3](https://gitee.com/yudaocode/yudao-ui-admin-vue3)                                   | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-admin-vue3/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-admin-vue3) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-admin-vue3.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-admin-vue3)                                               | 基于 Vue3 + element-plus 实现的管理后台  |\n| [yudao-ui-admin](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin)               | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro/tree/master/yudao-ui-admin)               | 基于 Vue2 + element-ui 实现的管理后台    |\n| [yudao-ui-admin-uniapp](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin-uniapp) | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin-uniapp) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro/tree/master/yudao-ui-admin-uniapp) | 基于 uni-app + uni-ui 实现的管理后台的小程序 |\n| [yudao-ui-go-view](https://gitee.com/yudaocode/yudao-ui-go-view)                                         | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-go-view/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-go-view) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-go-view.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-go-view)                                                           | 基于 Vue3 + naive-ui 实现的大屏报表      |\n| [yudao-ui-app](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-app)                   | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-app) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro/tree/master/yudao-ui-app)                   | 基于 uni-app + uview 实现的用户 App    |\n\n## 😎 开源协议\n\n**为什么推荐使用本项目？**\n\n① 本项目采用比 Apache 2.0 更宽松的 [MIT License](https://gitee.com/zhijiantianya/ruoyi-vue-pro/blob/master/LICENSE) 开源协议，个人与企业可 100% 免费使用，不用保留类作者、Copyright 信息。\n\n② 代码全部开源，不会像其他项目一样，只开源部分代码，让你无法了解整个项目的架构设计。\n\n③ 代码整洁、架构整洁，遵循《阿里巴巴 Java 开发手册》规范，代码注释详细，57000 行 Java 代码，22000 行代码注释。\n\n## 🐼 内置功能\n\n系统内置多种多种业务功能，可以用于快速你的业务系统：\n\n![功能分层](https://static.iocoder.cn/ruoyi-vue-pro-biz.png)\n\n* 系统功能\n* 基础设施\n* 工作流程\n* 支付系统\n* 数据报表\n\n> 友情提示：本项目基于 RuoYi-Vue 修改，**重构优化**后端的代码，**美化**前端的界面。\n>\n> * 额外新增的功能，我们使用 🚀 标记。\n> * 重新实现的功能，我们使用 ⭐️ 标记。\n\n🙂 所有功能，都通过 **单元测试** 保证高质量。\n\n### 系统功能\n\n|     | 功能    | 描述                              |\n|-----|-------|---------------------------------|\n|     | 用户管理  | 用户是系统操作者，该功能主要完成系统用户配置          |\n| ⭐️  | 在线用户  | 当前系统中活跃用户状态监控，支持手动踢下线           |\n|     | 角色管理  | 角色菜单权限分配、设置角色按机构进行数据范围权限划分      |\n|     | 菜单管理  | 配置系统菜单、操作权限、按钮权限标识等，本地缓存提供性能    |\n|     | 部门管理  | 配置系统组织机构（公司、部门、小组），树结构展现支持数据权限  |\n|     | 岗位管理  | 配置系统用户所属担任职务                    |\n| 🚀  | 租户管理  | 配置系统租户，支持 SaaS 场景下的多租户功能        |\n| 🚀  | 租户套餐  | 配置租户套餐，自定每个租户的菜单、操作、按钮的权限       |\n|     | 字典管理  | 对系统中经常使用的一些较为固定的数据进行维护          |\n| 🚀  | 短信管理  | 短信渠道、短息模板、短信日志，对接阿里云、腾讯云等主流短信平台 |\n| 🚀  | 操作日志  | 系统正常操作日志记录和查询，集成 Swagger 生成日志内容 |\n| ⭐️  | 登录日志  | 系统登录日志记录查询，包含登录异常               |\n| 🚀  | 错误码管理 | 系统所有错误码的管理，可在线修改错误提示，无需重启服务     |\n|     | 通知公告  | 系统通知公告信息发布维护                    |\n| 🚀  | 敏感词  | 配置系统敏感词，支持标签分组                  |\n| 🚀  | 应用管理  | 管理 SSO 单点登录的应用，支持多种 OAuth2 授权方式 |\n\n### 工作流程\n\n|     | 功能    | 描述                                     |\n|-----|-------|----------------------------------------|\n| 🚀  | 流程模型  | 配置工作流的流程模型，支持文件导入与在线设计流程图，提供 7 种任务分配规则 |\n| 🚀  | 流程表单  | 拖动表单元素生成相应的工作流表单，覆盖 Element UI 所有的表单组件 |\n| 🚀  | 用户分组  | 自定义用户分组，可用于工作流的审批分组                    |\n| 🚀  | 我的流程  | 查看我发起的工作流程，支持新建、取消流程等操作，高亮流程图、审批时间线    |\n| 🚀  | 待办任务  | 查看自己【未】审批的工作任务，支持通过、不通过、转发、委派、退回等操作    |\n| 🚀  | 已办任务  | 查看自己【已】审批的工作任务，未来会支持回退操作               |\n| 🚀  | OA 请假 | 作为业务自定义接入工作流的使用示例，只需创建请求对应的工作流程，即可进行审批 |\n\n### 支付系统\n\n|     | 功能   | 描述                        |\n|-----|------|---------------------------|\n| 🚀  | 商户信息 | 管理商户信息，支持 Saas 场景下的多商户功能  |\n| 🚀  | 应用信息 | 配置商户的应用信息，对接支付宝、微信等多个支付渠道 |\n| 🚀  | 支付订单 | 查看用户发起的支付宝、微信等的【支付】订单     |\n| 🚀  | 退款订单 | 查看用户发起的支付宝、微信等的【退款】订单     |\n\nps：核心功能已经实现，正在对接微信小程序中...\n\n### 基础设施\n\n|     | 功能       | 描述                                           |\n|-----|----------|----------------------------------------------|\n| 🚀  | 代码生成     | 前后端代码的生成（Java、Vue、SQL、单元测试），支持 CRUD 下载       |\n| 🚀  | 系统接口     | 基于 Swagger 自动生成相关的 RESTful API 接口文档          |\n| 🚀  | 数据库文档    | 基于 Screw 自动生成数据库文档，支持导出 Word、HTML、MD 格式      |\n|     | 表单构建     | 拖动表单元素生成相应的 HTML 代码，支持导出 JSON、Vue 文件         |\n| 🚀  | 配置管理     | 对系统动态配置常用参数，支持 SpringBoot 加载                 |\n| ⭐️  | 定时任务     | 在线（添加、修改、删除)任务调度包含执行结果日志                     |\n| 🚀  | 文件服务     | 支持将文件存储到 S3（MinIO、阿里云、腾讯云、七牛云）、本地、FTP、数据库等      | \n| 🚀  | API 日志   | 包括 RESTful API 访问日志、异常日志两部分，方便排查 API 相关的问题   |\n|     | MySQL 监控 | 监视当前系统数据库连接池状态，可进行分析SQL找出系统性能瓶颈              |\n|     | Redis 监控 | 监控 Redis 数据库的使用情况，使用的 Redis Key 管理           |\n| 🚀  | 消息队列     | 基于 Redis 实现消息队列，Stream 提供集群消费，Pub/Sub 提供广播消费 |\n| 🚀  | Java 监控  | 基于 Spring Boot Admin 实现 Java 应用的监控           |\n| 🚀  | 链路追踪     | 接入 SkyWalking 组件，实现链路追踪                      |\n| 🚀  | 日志中心     | 接入 SkyWalking 组件，实现日志中心                      |\n| 🚀  | 分布式锁     | 基于 Redis 实现分布式锁，满足并发场景                       |\n| 🚀  | 幂等组件     | 基于 Redis 实现幂等组件，解决重复请求问题                     |\n| 🚀  | 服务保障     | 基于 Resilience4j 实现服务的稳定性，包括限流、熔断等功能          |\n| 🚀  | 日志服务     | 轻量级日志中心，查看远程服务器的日志                           |\n| 🚀  | 单元测试     | 基于 JUnit + Mockito 实现单元测试，保证功能的正确性、代码的质量等    |\n\n### 数据报表\n\n|     | 功能       | 描述                                           |\n|-----|----------|----------------------------------------------|\n| 🚀  | 报表设计器     | 支持数据报表、图形报表、打印设计等       |\n| 🚀  | 大屏设计器     | 建设中... 拖拽式实现可视化数据大屏          |\n\n## 🐨 技术栈\n\n| 项目                      | 说明                 |\n|-------------------------|-----------------------|\n| `yudao-dependencies`    | Maven 依赖版本管理       |\n| `yudao-framework`       | Java 框架拓展          |\n| `yudao-server`          | 管理后台 + 用户 APP 的服务端 |\n| `yudao-ui-admin`        | 管理后台的 Vue2 前端项目     |\n| `yudao-ui-admin-vue3`   | 管理后台的 Vue3 前端项目     |\n| `yudao-ui-admin-uniapp` | 管理后台的 uni-app 多端项目  |\n| `yudao-ui-app`          | 用户 APP 的 UI 界面     |\n| `yudao-module-system`   | 系统功能的 Module 模块    |\n| `yudao-module-member`   | 会员中心的 Module 模块    |\n| `yudao-module-infra`    | 基础设施的 Module 模块    |\n| `yudao-module-tool`     | 研发工具的 Module 模块    |\n| `yudao-module-bpm`      | 工作流程的 Module 模块    |\n| `yudao-module-pay`      | 支付系统的 Module 模块    |\n\n### 后端\n\n| 框架                                                                                         | 说明                   | 版本          | 学习指南                                                           |\n|---------------------------------------------------------------------------------------------|-----------------------|-------------|----------------------------------------------------------------|\n| [Spring Boot](https://spring.io/projects/spring-boot)                                       | 应用开发框架             | 2.7.6       | [文档](https://github.com/YunaiV/SpringBoot-Labs)                |\n| [MySQL](https://www.mysql.com/cn/)                                                          | 数据库服务器             | 5.7 / 8.0+  |                                                                |\n| [Druid](https://github.com/alibaba/druid)                                                   | JDBC 连接池、监控组件     | 1.2.15      | [文档](http://www.iocoder.cn/Spring-Boot/datasource-pool/?yudao) |\n| [MyBatis Plus](https://mp.baomidou.com/)                                                    | MyBatis 增强工具包       | 3.5.2       | [文档](http://www.iocoder.cn/Spring-Boot/MyBatis/?yudao)         |\n| [Dynamic Datasource](https://dynamic-datasource.com/)                                       | 动态数据源               | 3.6.0       | [文档](http://www.iocoder.cn/Spring-Boot/datasource-pool/?yudao) |\n| [Redis](https://redis.io/)                                                                  | key-value 数据库        | 5.0 / 6.0   |                                                                |\n| [Redisson](https://github.com/redisson/redisson)                                            | Redis 客户端            | 3.18.0      | [文档](http://www.iocoder.cn/Spring-Boot/Redis/?yudao)           |\n| [Spring MVC](https://github.com/spring-projects/spring-framework/tree/master/spring-webmvc) | MVC 框架               | 5.3.24      | [文档](http://www.iocoder.cn/SpringMVC/MVC/?yudao)               |\n| [Spring Security](https://github.com/spring-projects/spring-security)                       | Spring 安全框架         | 5.7.5       | [文档](http://www.iocoder.cn/Spring-Boot/Spring-Security/?yudao) |\n| [Hibernate Validator](https://github.com/hibernate/hibernate-validator)                     | 参数校验组件             | 6.2.5       | [文档](http://www.iocoder.cn/Spring-Boot/Validation/?yudao)      |\n| [Flowable](https://github.com/flowable/flowable-engine)                                     | 工作流引擎               | 6.7.2       | [文档](https://doc.iocoder.cn/bpm/)                                                     |\n| [Quartz](https://github.com/quartz-scheduler)                                               | 任务调度组件             | 2.3.2       | [文档](http://www.iocoder.cn/Spring-Boot/Job/?yudao)             |\n| [Knife4j](https://gitee.com/xiaoym/knife4j)                                                 | Swagger 增强 UI 实现    | 3.0.3       | [文档](http://www.iocoder.cn/Spring-Boot/Swagger/?yudao)         |\n| [Resilience4j](https://github.com/resilience4j/resilience4j)                                | 服务保障组件             | 1.7.1       | [文档](http://www.iocoder.cn/Spring-Boot/Resilience4j/?yudao)    |\n| [SkyWalking](https://skywalking.apache.org/)                                                | 分布式应用追踪系统        | 8.12.0      | [文档](http://www.iocoder.cn/Spring-Boot/SkyWalking/?yudao)      |\n| [Spring Boot Admin](https://github.com/codecentric/spring-boot-admin)                       | Spring Boot 监控平台    | 2.7.9       | [文档](http://www.iocoder.cn/Spring-Boot/Admin/?yudao)           |\n| [Jackson](https://github.com/FasterXML/jackson)                                             | JSON 工具库             | 2.13.3      |                                                                |\n| [MapStruct](https://mapstruct.org/)                                                         | Java Bean 转换         | 1.5.3.Final | [文档](http://www.iocoder.cn/Spring-Boot/MapStruct/?yudao)       |\n| [Lombok](https://projectlombok.org/)                                                        | 消除冗长的 Java 代码     | 1.18.24     | [文档](http://www.iocoder.cn/Spring-Boot/Lombok/?yudao)          |\n| [JUnit](https://junit.org/junit5/)                                                          | Java 单元测试框架        | 5.8.2       | -                                                              |\n| [Mockito](https://github.com/mockito/mockito)                                               | Java Mock 框架         | 4.8.0       | -                                                              |\n\n### [管理后台 Vue2 前端](./yudao-ui-admin)\n\n| 框架                                                                           | 说明            | 版本     |\n|------------------------------------------------------------------------------|---------------|--------|\n| [Vue](https://cn.vuejs.org/index.html)                                       | JavaScript 框架 | 2.7.14 |\n| [Vue Element Admin](https://panjiachen.github.io/vue-element-admin-site/zh/) | 后台前端解决方案      | -      |\n\n### [管理后台 Vue3 前端](./yudao-ui-admin-vue3)\n\n| 框架                                                                  |     说明      |   版本   |\n|----------------------------------------------------------------------|:------------:|:------:|\n| [Vue](https://staging-cn.vuejs.org/)                                 |   Vue 框架    | 3.2.45 |\n| [Vite](https://cn.vitejs.dev//)                                      | 开发与构建工具  | 4.0.3  |\n| [Element Plus](https://element-plus.org/zh-CN/)                      | Element Plus | 2.2.27 |\n| [TypeScript](https://www.typescriptlang.org/docs/)                   |  TypeScript  | 4.9.4  |\n| [pinia](https://pinia.vuejs.org/)                                    |    vuex5     | 2.0.28 |\n| [vue-i18n](https://kazupon.github.io/vue-i18n/zh/introduction.html/) |    国际化     | 9.2.2  |\n| [vxe-table](https://vxetable.cn/)                                    |  vue最强表单  | 4.3.7  |\n\n### [管理后台 uni-app 跨端](./yudao-ui-admin-uniapp)\n\n| 框架                                                                  | 说明               | 版本     |\n|----------------------------------------------------------------------|------------------|--------|\n| [uni-app](hhttps://github.com/dcloudio/uni-app)                                 | 跨平台框架           | 2.0.0 |\n| [uni-ui](https://github.com/dcloudio/uni-ui)                                      | 基于 uni-app 的 UI 框架          | 1.4.20  |\n\n## 🐷 演示图\n\n**效果预览** ：\n\n![首页](https://mmbiz.qpic.cn/mmbiz/iaIdQfEric9Txw85YtbKNvl0ibKkgxeiahe5GYiamW2FAgbicPCzMAx37hy26WL8wtcgGqU8olicAYgAlDyGwIJtgsc6Q/640?wx_fmt=other&wxfrom=5&wx_lazy=1&wx_co=1)\n\n![令牌管理](https://mmbiz.qpic.cn/mmbiz/iaIdQfEric9Txw85YtbKNvl0ibKkgxeiahe5foMLJmVhW95QMKxkCricxPu107iboFGuN6XfVdTh7FrroB0fcX6SMFaw/640?wx_fmt=other&wxfrom=5&wx_lazy=1&wx_co=1)\n\n![流程模型-设计](https://mmbiz.qpic.cn/mmbiz/iaIdQfEric9Txw85YtbKNvl0ibKkgxeiahe5SiaibhtBlnP9OlOm5AsNE386jRpRAwHTgh0seL7tNiceNXCVhDOK72Xrg/640?wx_fmt=other&wxfrom=5&wx_lazy=1&wx_co=1)\n\n![大屏设计](https://gitee.com/yudaocode/yudao-ui-go-view/raw/master/readme/preview.png)\n', 18425, 6747, 500, 0, 0, '1', '2025-03-09 18:50:19', '1', '2025-03-09 18:50:19', b'0', 1);
INSERT INTO `ai_knowledge_document` VALUES (23, 2, 'MQ 分享.md', 'http://test.yudao.iocoder.cn/0963041be320795bf707da09da1062d3b8c237d974234e04bce0884eb3e84ab6.md', '---\nmarp: true\n---\n\n# 分享内容\n\n* 为什么推荐阅读 MQ 的源码\n* 对比 RocketMQ 与 PMQ 的整体架构\n* 有趣的 MQ 功能点实现\n\n---\n\n# 为什么推荐阅 MQ 的源码\n\n* 工作：[常用中间件](https://www.processon.com/view/link/60f3896a0791291daf481096)\n* 技术：[一通百通](https://www.processon.com/view/link/60f3bcc2e401fd4fe0542a0e)\n\n---\n\n# 整体架构\n\n[RocketMQ  与 PMQ 对比图](https://www.processon.com/diagraming/60eced2d7d9c08312720a8e3)\n\n<!-- [只读](https://www.processon.com/view/link/60f3becb1efad41bbea96c7d) -->\n\n* 存储\n* 高可用\n* 通信\n* 注册中心内嵌\n\n---\n\n# 消息队列的功能\n\n[功能导图](https://www.processon.com/view/link/60f3de381efad41bbea99334)\n\n---\n\n# 前置：消息模型\n\n~~JMS、AMQP、OpenMessaging 协议~~\n\n[Topic + Queue 模型](https://www.processon.com/view/link/60f3de381efad41bbea99334)\n\n<!-- [只读](https://www.processon.com/view/link/60f3e49c5653bb0b4889f98f) -->\n\n---\n\n# RocketMQ 存储\n\n## 1. 整体\n\n![store 目录](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-%E6%95%B4%E4%BD%93.png)\n\n## 2. config 目录\n\n![config 目录](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-config.png)\n\n---\n\n# RocketMQ 存储（config）\n\n### 2.1 topics.json\n\n用途：Topic 定义\n\n![topics.json](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-topics.png)\n\n---\n\n# RocketMQ 存储（config）\n\n### 2.1 topics.json（有趣的参数）\n\n<!-- readQueueNums vs writeQueueNums？ -->\n\n[有趣的参数](https://www.processon.com/diagraming/60f3eae4637689739c3bbbc5)\n\n<!-- [只读](https://www.processon.com/view/link/60f3ef735653bb0b488a09c4) -->\n\n---\n\n# RocketMQ 存储（config）\n\n### 2.2 subscriptionGroupTable.json\n\n用途：Consumer Group 定义\n\n![subscriptionGroupTable.json](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-subscriptionGroupTable.png)\n\n为什么没有订阅的 topic？\n\n---\n\n# RocketMQ 存储（config）\n\n### 2.3 offsetTable.json\n\n用途：每个消费组，针对每个 topic 的消费进度\n\n![offsetTable.json](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-offsetTable.png)\n\n---\n\n# RocketMQ 存储（commitlog）\n\n## 3. commitlog 目录\n\n用途：存储所有消息\n\n![commitlog 目录](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-commitlog.png)\n\n问题：为什么是 1G？\n* Memory-mapped files cannot be larger than 2GB on 32-bit systems.\n\n---\n\n# RocketMQ 存储（commitlog）\n\n## 3.1 消息分布\n\n![消息分布](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-commitlog2.png)\n\n---\n\n# RocketMQ 存储（commitlog）\n\n## 3.2 消息格式\n\n[![消息格式](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-commitlog3.png)](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-commitlog3.png)\n\n---\n\n# RocketMQ 存储（consumequeue）\n\n## 4. 存储（consumequeue）\n\n用途：每个 topic 的 queue，对 commitlog 的索引\n\n额外作用：计算每个 topic + queue 的 offset\n\n![关系](http://assets.processon.com/chart_image/60f3fbdf5653bb0b488a1a07.png)\n\n---\n\n## 4.1 分布\n\n![](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-consuequeue.png)\n\n和 commitlog 一样的命名方式，只是大小为 30w * 20B\n\n---\n\n## 4.2 内容\n\n![](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-consuequeue2.png)\n\n长度为 20B\n\n提问：为什么会有 Tag？\n\n---\n\n# PMQ 存储\n\n## 4.1 表关系\n\n[传送门](https://www.processon.com/diagraming/60f2b4f25653bb0b488947a4)\n\n<!-- 只读 http://assets.processon.com/chart_image/60f2b4f35653bb0b488947a7.png -->\n\n---\n\n# 4.2 分库分表\n\n![分库分表](https://static.iocoder.cn/pmq%E5%AD%98%E5%82%A8-%E5%88%86%E5%BA%93%E5%88%86%E8%A1%A8.png)\n\n---\n\n# 4.2 分库分表\n\n![查询演示](https://static.iocoder.cn/pmq%E5%AD%98%E5%82%A8-%E5%88%86%E5%BA%93%E5%88%86%E8%A1%A82.png)\n\n----\n\n# 4.3 RocketMQ 文件 vs PMQ 表\n\n| 定义 |  RocketMQ 文件 | PMQ 表 | 备注 |\n|  ----  |  ----  | ----  | ----  |\n| 主题 | `topics.json`  | `topic`  |   |\n| 队列 |   | `queue` | ① 分库分表 |\n| 消费者分组 | `subscriptionGroupTable.json`  | `consumer_group` |  |\n| 消费进度 | `offsetTable.json`  | `queue_offset` |  |\n| 消费者 | 内存  | `consumer` | ② 共享 |\n| 分组的消费者 | 内存  | `consumer_group_consumer` | ② 共享 |\n| 分组的主题 | 内存  | `consumer_group_topic` | ② 共享 |\n| 消息 | `commitlog` + `consumequeue`  | `message` | ③ ？？？  |\n\n---\n\n# 4.4 是否可以每个队列的文件，直接存储消息？\n\nkafka 的设计如此。\n\nrocketmq 优点：\n* commitlog 消息的合并提交\n* 无法支撑海量 Topic + 队列 [《如何解决kafka topic数量过多带来的性能问题？》](https://www.zhihu.com/question/431131178/answer/1586855731)\n\nrocketmq 缺点：\n* commitlog 是顺序写，但是 commitlog 是随机读\n* 读取两次，先读 consumequeue，在读 commitlog\n\n<!-- 参考文章，RocketMQ 负责人的分析 https://developer.aliyun.com/article/105 -->\n\n推荐阅读：[《天池中间件大赛百万队列存储设计总结【复赛】》](https://mp.weixin.qq.com/s/aQtaDdnGxoGLvmXf7iuhLQ)\n\n---\n\n# RocketMQ 消息的写入\n\n需要写入 commitlog 和 consumequeue\n\n---\n\n## 4.1 写入 commitlog\n\n三种：\n* 同步写入\n* 异步写入 + mmap\n* 异步写入 + filechannel + buffer\n\n[传送门](https://www.processon.com/diagraming/60eced2d7d9c08312720a8e3)\n\n<!-- 只读 hhttps://www.processon.com/view/link/60f3becb1efad41bbea96c7d -->\n\nTODO 需要再思考下\n\n---\n\n## 4.2 写入 consumequeue\n\n![写入 consumequeue](http://assets.processon.com/chart_image/60f4590ae401fd4fe054d374.png)\n\n---\n\n# RocketMQ 消息的读取\n\n两种：\n* 堆内传输\n* 堆外传输 + 零拷贝\n\n[传送门](https://www.processon.com/diagraming/60f45b0d637689739c3c2faa)\n\n<!-- 只读 https://www.processon.com/view/link/60f4619b1e085376da5bbd73 -->\n\nTODO 需要再思考下\n\n---\n\n# PMQ 消息的写入\n\nTopic、Queue 等元数据，缓存在内存中，通过定时任务每 3000 毫秒刷新一次。\n\n```Java\n    // 设置使用的 DB 编号；该变量，是 ThreadLocal\n    message01Service.setDbId(temp.getDbNodeId());\n```\n\n如下，是批量插入消息的 SQL：\n\n```SQL\n	<insert id=\"insertBatchDy\" useGeneratedKeys=\"false\">\n		insert into ${tbName} (\n		    biz_id, tag,  head,  body, send_ip, race_id, retry_count\n		)\n		values\n		<foreach collection=\"entityList\" item=\"item\" index=\"index\" separator=\",\">\n		(\n		    #{item.bizId}, #{item.tag}, #{item.body}, #{item.sendIp}, #{item.traceId} , #{item.retryCount}\n		)\n		</foreach>\n	</insert>\n```\n\n[《阿里云 MySQL 8.0测试结果》](https://help.aliyun.com/document_detail/150351.html)\n\n[MySQL 写入过程](https://www.processon.com/view/link/5f6eb0845653bb6013249557)\n\n---\n\n# PMQ 消息的读取\n\n```Java\n    // 设置使用的 DB 编号；该变量，是 ThreadLocal\n    message01Service.setDbId(temp.getDbNodeId());\n```\n\n如下，是批量查询消息的 SQL：\n\n```SQL\n	<select id=\"getListDy\" resultMap=\"BaseResultMap\" statementType=\"STATEMENT\"\n		useCache=\"false\">\n	        <![CDATA[\n			select *\n			from ${tbName} where id>${start} and id<=${end}\n	         ]]>\n	</select>\n```\n\n---\n\n# RocketMQ 高可用\n\n* 主从架构\n* [基于 Raft 协议的多副本架构](https://www.infoq.cn/article/7xejrpdzba9v*gdzofs6)\n\n---\n\n# 1. RocketMQ 高可用（主从架构）\n\n![](http://assets.processon.com/chart_image/60f434325653bb0b488a54c1.png)\n\n* 主从不支持切换\n* 多套 Broker 集群保证可用性\n* 需要同步的数据：1）commitlog；2）config\n\n---\n\n# 2. RocketMQ 高可用（主从同步 commitlog）\n\n同步类型：\n* 同步\n* 异步\n\n[流程图](https://www.processon.com/diagraming/60f43bbee401fd4fe054bb9a)\n\n<!-- 只读 <https://www.processon.com/view/link/60f440b7637689739c3c1b3a> -->\n\n---\n\n# 3. RocketMQ 高可用（主从同步 config）\n\n[流程图](https://www.processon.com/diagraming/60f445d10791291daf48df0e)\n\n<!-- 只读 <https://www.processon.com/view/link/60f4476c7d9c087bac5ce124> -->\n\n---\n\n# PMQ 高可用\n\n[传送门](https://www.processon.com/diagraming/60f447f55653bb0b488a6a94)\n\n<!-- 只读 <https://www.processon.com/view/link/60f4488a1e085376da5bae6b> -->\n\n* Broker 无状态，集群\n* MySQL 主从集群\n\n---\n\n# RocketMQ 延迟消息（定义）\n\n延迟级别：\n\n| 延迟级别 | 时间 |    延迟级别  |   时间   |\n| :------- | :--- | ---- | :--- |\n| 1        | 1s   | 10   | 6m   |\n| 2        | 5s   | 11   | 7m   |\n| 3        | 10s  | 12   | 8m   |\n| 4        | 30s  | 13   | 9m   |\n| 5        | 1m   | 14   | 10m  |\n| 6        | 2m   | 15   | 20m  |\n| 7        | 3m   | 16   | 30m  |\n| 8        | 4m   | 17   | 1h   |\n| 9        | 5m   | 18   | 2h   |\n\n---\n\n# RocketMQ 延迟消息（实现）\n\n实现原理：[传送门](https://www.processon.com/diagraming/60f468067d9c087bac5cf13a)\n\n<!-- 只读 https://www.processon.com/view/link/60f46df31efad41bbeaa2182 -->\n\n# 其它中间件的延迟消息\n\n* Mafka 支持任意维度的延迟消息\n* [QMQ 支持任意时间的延迟消息](https://github.com/qunarcorp/qmq/blob/master/docs/cn/arch.md#%E5%BB%B6%E6%97%B6%E5%AE%9A%E6%97%B6%E6%B6%88%E6%81%AF)\n* [rabbitmq 支持任务时间的延迟消息](https://blog.csdn.net/u013256816/article/details/55106401)\n* [滴滴开源分布式消息中间件产品 DDMQ](https://blog.didiyun.com/index.php/2019/01/18/ddmq/)\n\n---\n\n# MQ 事务消息\n\n* [为什么会有事务的问题？](https://www.processon.com/diagraming/60f4ce3d5653bb0b488a8c36)\n* 不同 MQ 提供的事务消息能力不同：\n    * RabbitMQ 事务消息：多条消息的一致性，本地事务\n    * Kafka 事务消息：实现 Exactly-Once 的特性\n    * RocketMQ 事务消息：分布式事务，基于 MQ 协调\n    * QMQ 事务消息：分布式事务，基于 MySQL 协调\n\n---\n\n# RocketMQ 事务消息\n\n![阿里云](https://static-aliyun-doc.oss-accelerate.aliyuncs.com/assets/img/zh-CN/1579264061/p177406.png)\n\n* 比较复杂，需要新增两个存储文件（`transaction/statetable` 和 `transaction/redolog` ）。暂时不分享，[源码解析](https://www.iocoder.cn/RocketMQ/message-transaction/?vip)\n* [使用示例](https://github.com/YunaiV/SpringBoot-Labs/blob/master/lab-31/lab-31-rocketmq-demo/src/main/java/cn/iocoder/springboot/lab31/rocketmqdemo/producer/Demo07Producer.java)\n* 存在的问题：1）使用复杂 2）强依赖 MQ；3）强依赖 RocketMQ 的特性\n\n---\n\n# QMQ 事务消息\n\n```Java\nbegin transaction;\ncreateOrder();\nsaveMessageA(); // sendMessageA();\nsaveMessageB(); // snedMessageB();\ncommit transaction;\n\n// 监听事务提交，发送消息\nsendMessageA();\nsnedMessageB();\n\n// 如果提交失败，Job 重试\n```\n\n[官方文档](https://github.com/qunarcorp/qmq/blob/master/docs/cn/transaction.md)\n\n---\n\n# 推荐阅读文章\n\n* 《阿里二面：什么是mmap？》https://zhuanlan.zhihu.com/p/357820303\n* 《谈谈 RocketMQ 消息存储的设计与实现》https://juejin.cn/post/6844903893982248967\n* Linux中的零拷贝 https://www.cnblogs.com/rexcheny/p/12178014.html\n* pagecache与mmap https://www.jianshu.com/p/7044e0b9ab7a\n* 消息中间件—RocketMQ消息存储（一） https://www.jianshu.com/p/b73fdd893f98\n* 消息中间件—RocketMQ消息存储（二） https://www.jianshu.com/p/6d0c118c17de\n* 框架篇：小白也能秒懂的Linux零拷贝原理 https://juejin.cn/post/6887469050515947528\n* 面试官：RocketMQ 如何基于mmap+page cache实现磁盘文件的高性能读写？ https://www.imooc.com/article/301624\n* 文件 IO 操作的一些最佳实践 https://www.cnkirito.moe/file-io-best-practise/\n* 零拷贝技术的原理与在java中应用 https://blog.csdn.net/u022812849/article/details/109805403\n* 论最强IO：MappedByteBuffer VS FileChannel https://blog.csdn.net/alex_xfboy/article/details/90174840\n* Page Cache是怎样产生和释放的？ https://time.geekbang.org/column/article/274106\n\n---\n\n', 9406, 4308, 500, 0, 0, '1', '2025-03-10 12:54:21', '1', '2025-03-10 12:54:21', b'0', 1);
INSERT INTO `ai_knowledge_document` VALUES (24, 2, 'de30420d8e7e4824948096f81b08a50d.pdf', 'http://test.yudao.iocoder.cn/677871c92cea0aeeab6020e4bef713ff0b9bc1b340c7034141379a072635c6f1.pdf', '\n1 广州天凯信息科技有限公司                                                      www.dbs-\nservice.com\n\n1\n\nOracle镜像使用说明\n\n一、 镜像背景\n\n广州天凯信息科技有限公司，是广州少数主打数据库技术服务的企业，主营服务：数据库优化，数据误删恢复，迁\n\n移升级，故障修复等运维服务。拥有资深专业的技术团队，数据库专家平均具备 10年以上大型企业数据库 DBA经验，\n\n具有 OCP,OCM,MySQL,LINUX等专家认证，服务行业涉及金融，税务，交通，电商等关键行业，长期与国内知名企业合\n\n作，累积客户 5000+。我们的服务宗旨是“专业，诚信，可靠”，我们将帮助中小企业低成本获得数据安全保障，为企\n\n业数据安全做长远规划，从企业的利益出发，给企业带来价值！欢迎各界企业客户咨询合作。\n\n为了提高客户 IT系统的上云效率，给客户环境部署带来便利，我方推出了镜像产品服务，而我们主要针对数据库集\n\n成方面，做了更专业更周到的部署集成服务，以下是我们的镜像产品说明。\n\n二、 镜像说明\n\n(一) 镜像简介\n\n本镜像系统预安装了 Oracle官方企业版，并升级更新最新发布补丁包程序，修复了安全漏洞同时，并对数据库配置\n\n做了调整优化，可当作数据库服务器可直接使用或上线。本镜像有以下亮点。\n\n● 官方企业版：镜像采用主流 Centos7.8系统，预安装官方 Oracle11gR2企业版数据库，功能完整，稳定性有保障;\n\n● 安全保障：在 Oracle11.2.0.4安装完成后，更新了 2020年 4月 20日最新发布的补丁包，修复了此版本以往所有\n\n安全漏洞与 BUG，可应对各种等保漏扫软件;\n\n● 配置优化：对 Oracle内存参数，性能参数，REDO成员，开机自启动等方面做了一系列优化，满足了上线的要求\n\n● 预安装了高版本 Oracle EM或 PLSQL Developer软件，方便数据库管理使用；\n\n● 技术支持：对镜像使用有任何疑问或技术问题，提供免费技术支持，售后无忧。\n\n2 广州天凯信息科技有限公司                                                      www.dbs-\nservice.com\n\n2\n\n(二) 使用须知\n\n2.1 修改监听 IP地址\n\n当使用本镜像安装系统后，监听程序由于绑定了旧 IP所以无法正常启动，需要修改\n\n$ORACLE_HOME/network/admin下的 listener.ora文件，将里面 HOST=后面的主机名修改成服务器本身设置的主机\n\n名，同时检查/etc/hosts的主机记录，确保正确的对应关系，可参考下面条目：\n\n127.0.0.1       localhost       localhost.localdomain   localhost4      localhost4.localdomain4\n\n::1             localhost       localhost.localdomain   localhost6      localhost6.localdomain6\n\n172.17.252.242  db-server       db-server\n\n当修改完以上配置后，重启监听程序即可！\n\n2.2 修改 LOCAL_LISTENER参数\n\n若上面配置无法解决，需重新设置以下 LOCAL_LISTENER 参数，调整方法：\n\nSqlplus / as sysdba登陆执行：\n\nALTER SYSTEM SET LOCAL_LISTENER=\'(ADDRESS=(PROTOCOL=TCP)(HOST=新 IP 地址)(PORT=1521))\';\n\n最后再次重启监听程序即可解决！\n\n2.3 修改 TNSNAMES.ORA\n\n当监听程序启动正常后，若服务器内部需要引用 TNSNAMES.ORA文件连接数据库，还需要将此文件里的 HOST改\n\n成新主机名。\n\n2.4 数据库登陆方式\n\n本镜像还预安装了 Oracle EM数据库管理后台（地址：https://你的 IP:5500/em或 http://你的 IP:5500/em）和\n\nPLSQL Developer软件（已激活,主要针对 windows server环境），数据库登陆信息文件保存在桌面或 Linux环境的\n\n/home/oracle/Orapwd.txt;\n\n(三) 软件/平台\n\n本镜像系统采用 CentOS7.8 64位，预安装数据库版本 Oracle11.2.0.4 企业版 \n\n3 广州天凯信息科技有限公司                                                      www.dbs-\nservice.com\n\n3\n\n(四) 最低配置\n\n本镜像环境：CPU:2核心  内存：4G  系统盘：100G\n\n注意：若低于此配置，需要修改内存参数才能启动.\n\n(五) 售后支持\n\n1，免费技术支持：对镜像部署有疑问或使用过程存在问题，欢迎咨询阿里旺旺、手机或工单方式与我们联系。\n\n2，收费人工支持：若涉及非镜像以外的数据库技术问题，如有数据库误删恢复，数据库故障排查，性能优化，代\n\n运维等技术服务需求，请在我方云市场购买我们服务，也可直接进入我方店铺找到 Oracle技术服务商品进行购\n\n买合作。\n\n\n', 2292, 1475, 500, 0, 0, '1', '2025-03-10 12:59:10', '1', '2025-03-10 12:59:10', b'0', 1);
