INSERT INTO `ai_knowledge_segment` VALUES (136, 3, 20, '一，创建seata子模块\n在yudao-framework模块下新建子模块yudao-spring-boot-starter-seata,\n然后在这个yudao-spring-boot-starter-seata模块的pom文件中引入依赖，\n<dependency>\n            <groupId>cn.iocoder.cloud</groupId>\n            <artifactId>yudao-common</artifactId>\n            <version>2.3.0-SNAPSHOT</version>\n        </dependency>\n        <dependency>\n            <groupId>com.alibaba.cloud</groupId>\n            <artifactId>spring-cloud-alibaba-seata</artifactId>\n            <version>2023.0.1.2</version>\n        </dependency>\n        <dependency>\n            <groupId>io.seata</groupId>\n            <artifactId>seata-spring-boot-starter</artifactId>\n            <!-- 注意不能用2.0.0版本，事务不生效有bug-->\n            <version>1.8.0</version>\n        </dependency>\n        <dependency>\n            <groupId>io.seata</groupId>\n            <artifactId>seata-all</artifactId>\n            <!-- 注意不能用2.0.0版本，事务不生效有bug,The AdapterSpringSeataInterceptor\'s order \'2147483647\' is lower or equals than TransactionInterceptor\'s order \'2147483647\' , reset AdapterSpringSeataInterceptor\'s order to higher order \'2147483646\'.-->\n            <version>1.8.0</version>\n            <exclusions>\n                <exclusion>\n                    <groupId>log4j</groupId>\n                    <artifactId>log4j</artifactId>\n                </exclusion>\n            </exclusions>\n        </dependency>\n        <dependency>\n            <groupId>io.seata</groupId>\n            <artifactId>seata-spring-autoconfigure-client</artifactId>\n            <!-- 注意不能用2.0.0版本，事务不生效有bug-->\n            <version>1.8.0</version>\n        </dependency>\n        <dependency>\n            <groupId>com.caucho</groupId>\n            <artifactId>hessian</artifactId>\n            <version>4.0.63</version>\n        </dependency>\n        <dependency>\n            <groupId>io.protostuff</groupId>', 1804, '98da75c9-21c8-4c61-a85b-252feba2fcb5', 500, 0, 0, NULL, '2025-03-09 18:31:44', '1', '2025-03-09 18:44:12', b'1', 1);
INSERT INTO `ai_knowledge_segment` VALUES (137, 3, 20, '<artifactId>protostuff-core</artifactId>\n            <version>1.7.2</version>\n        </dependency>\n        <dependency>\n            <groupId>io.protostuff</groupId>\n            <artifactId>protostuff-runtime</artifactId>\n            <version>1.7.2</version>\n        </dependency>\n\n二，部署seata服务端\nseata是用于分布式事务的，\n目前我用的是seata-server2.0.0版的windows版，nacos服务器版本我用的2.0.3\nseata\\conf\\application.yml配置文件中：\n\nserver:\n  port: 7091\n\nspring:\n  application:\n    name: seata-server\n\nlogging:\n  config: classpath:logback-spring.xml\n  file:\n    path: ${log.home:${user.home}/logs/seata}\n  extend:\n    logstash-appender:\n      destination: 127.0.0.1:4560\n    kafka-appender:\n      bootstrap-servers: 127.0.0.1:9092\n      topic: logback_to_logstash\n\nconsole:\n  user:\n    username: seata\n    password: seata\nseata:\n  config:\n    # support: nacos, consul, apollo, zk, etcd3\n    type: nacos\n    nacos:\n      server-addr: 192.168.1.146:8848\n      namespace: zma-dev\n      group: SEATA_GROUP\n      username: nacos\n      password: nacos\n      context-path:\n      ##if use MSE Nacos with auth, mutex with username/password attribute\n      #access-key:\n      #secret-key:\n      data-id: seataServer.properties\n  registry:\n    # support: nacos, eureka, redis, zk, consul, etcd3, sofa\n    type: nacos\n    preferred-networks: 30.240.*\n    nacos:\n      application: seata-server\n      server-addr: 192.168.1.146:8848\n      group: SEATA_GROUP\n      namespace: zma-dev\n      cluster: default\n      username: nacod\n      password: nacos\n      context-path:\n      ##if use MSE Nacos with auth, mutex with username/password attribute\n      #', 1604, '70ec3d25-8e5a-4b38-9fcd-f2d5cf841d72', 499, 2, 0, NULL, '2025-03-09 18:31:44', '1', '2025-03-09 18:44:12', b'1', 1);
INSERT INTO `ai_knowledge_segment` VALUES (138, 3, 20, 'access-key:\n  store:\n    # support: file 、 db 、 redis 、 raft\n    mode: file\n  #  server:\n  #    service-port: 8091 #If not configured, the default is \'${server.port} + 1000\'\n  security:\n    secretKey: SeataSecretKey0c382ef121d778043159209298fd40bf3850a017\n    tokenValidityInMilliseconds: 1800000\n    ignore:\n      urls: /,/**/*.css,/**/*.js,/**/*.html,/**/*.map,/**/*.svg,/**/*.png,/**/*.jpeg,/**/*.ico,/api/v1/auth/login,/metadata/v1/**\nnacos配置中心里面，建一个seataServer.properties配置文件，内容如下：\nData ID: seataServer.properties\nGroup: SEATA_GROUP\nservice.enableDegrade=false\nservice.disableGlobalTransaction=false\nservice.vgroupMapping.default-tx-group=default\nservice.vgroupMapping.order-service-group=default\n启动seata-server,\n在seata\\bin下，双击seata-server.bat文件启动，查看nacos中是否有seata-server的服务，如果有，证明启动成功。\n或者去访问seata的管理页面地址：http://localhost:7091,如果能正常打开，证明seata已经启动成功。\n二，微服务中配置seata\nspringcloud的微服务中配置seata\n先在微服务的pom.xml中添加依赖\n <!-- seata -->\n        <dependency>\n            <groupId>cn.iocoder.cloud</groupId>\n            <artifactId>yudao-spring-boot-starter-seata</artifactId>\n            <version>2.3.0-SNAPSHOT</version>\n        </dependency>\n然后在springboot微服务的yml中配置：\n# Seata 配置项，对应 SeataProperties 类\nseata:\n  application-id: ${spring.application.name} # Seata 应用编号，默认为 ${spring.application.name}\n  tx-service-group: default-tx-group # Seata 事务组编号，用于 TC 集群名\n  # Seata 服务配置项，对应 ServiceProperties 类\n  service:\n    vgroup-mapping:\n      default-tx-group: default\n  data-source-proxy-mode:', 1476, '7d9b361e-d43a-4480-ad61-6f7323014a9d', 500, 2, 0, NULL, '2025-03-09 18:31:44', '1', '2025-03-09 18:44:12', b'1', 1);
INSERT INTO `ai_knowledge_segment` VALUES (139, 3, 20, 'AT\n  # Seata 注册中心配置项，对应 RegistryProperties 类\n  registry:\n    type: nacos # 注册中心类型，默认为 file\n    nacos:\n      cluster: default # 使用的 Seata 分组\n      namespace: zma-dev # Nacos 命名空间\n      #      serverAddr: 192.168.1.17:8848 # Nacos 服务地址\n      serverAddr: localhost:8848 # Nacos 服务地址\n      group : SEATA_GROUP\n      username: nacos\n      password: nacos\n然后在微服务启动类上加注解\n//开启seata对数据源的自动代理\n@EnableAutoDataSourceProxy \n//开启seata对FeignClient运程调用的自动配置\n@EnableFeignClients(defaultConfiguration = SeataFeignClientAutoConfiguration.class)\n\n三，测试全局事务\n先写一个测试接口，我是在TenantController中写的\n @GetMapping(\"/test-seata\")\n    @Operation(summary = \"测试seata\")\n    public CommonResult testSeata() {\n        return success(menuService.testSeata());\n    }\nmenuService业务实现方法上加注解@GlobalTransactional(name = \"testSeata\",rollbackFor = Exception.class),\n这个注解中的name的值要保证唯一性，我这里直接用的方法，如果你当前项目中有多个方法名与当前方法名相同，那就要区别开，比如前面再加上微服务名-controller名，后面再加后缀的方式，保证唯一就行了，如：systemServer-testController-testSeata-1。\n@Override\n    @GlobalTransactional(name = \"testSeata\",rollbackFor = Exception.class)\n    public Object testSeata() {\n        MenuDO menuDO = menuMapper.selectById(2815);\n        menuDO.setName(\"测试111\");\n        //本微服务system微服务中修改stem_menu表，此修改操作会成功\n        menuMapper.updateById(menuDO);\n        //通过FeignClient远程调用infra微服务中的方法testSeata，\n        //在testSeata插入一条数据到yudao_demo01_contact表，此插入操作', 1354, '46dc2e26-ea81-4504-84cf-58ab0202b5f4', 500, 2, 0, NULL, '2025-03-09 18:31:44', '1', '2025-03-09 18:44:12', b'1', 1);
INSERT INTO `ai_knowledge_segment` VALUES (140, 3, 20, '会成功\n        Boolean bool = apiErrorLogApi.testSeata();\n        //通过FeignClient远程调用infra微服务中的方法testSeata2，\n        //在testSeata2方法中插入一条数据到yudao_demo02_category表，此插入操作会失败，因为id与数据库中的已有的id重复\n        Boolean common = apiErrorLogApi.testSeata2();\n        //执行完会去看数据库中的三张表中的数据是否有回滚，如果有回滚，证明全局事务生效了。\n        return true;\n    }\n注意1：要用全局事务时，远程调用的方法不能以CommonResult返回，要以实体数据实体返回，比如我当前方法只需要一个String字符串，那就以String返回，再比如我需要一个用户对象，那个直接以User返回，不要封装到带有code,msg,data的Result结果对象中返回，不然事务会不生效。\n注意2：远程调用的方法中不能有try{}catch (Exception e) {},不然事务也不会生效。\n然后，数据库中要加seata处理事务的表,如果有多个数据库，那么每个数据库中都要加这张表。\nCREATE TABLE `undo_log` (\n  `id` bigint NOT NULL AUTO_INCREMENT,\n  `branch_id` bigint NOT NULL,\n  `xid` varchar(100) NOT NULL,\n  `context` varchar(128) NOT NULL,\n  `rollback_info` longblob NOT NULL,\n  `log_status` int NOT NULL,\n  `log_created` datetime NOT NULL,\n  `log_modified` datetime NOT NULL,\n  `ext` varchar(100) DEFAULT NULL,\n  PRIMARY KEY (`id`),\n  UNIQUE KEY `ux_undo_log` (`xid`,`branch_id`)\n) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8mb3;\n然后启动gateway,system微服务与infra微服务，\n最后，用postman请求system微服务中的这个/test-seata接口，测试数据库的数据的修改与插入是否有回滚，是否有同步成功，同步失败。\n\n一，创建', 1144, 'a2c67968-51de-47fb-b97a-90a0287bde66', 500, 2, 0, NULL, '2025-03-09 18:31:44', '1', '2025-03-09 18:44:12', b'1', 1);
INSERT INTO `ai_knowledge_segment` VALUES (141, 3, 20, 'seata 子模块\n\n在yudao-framework 模块下新建子模块 yudao-spring-boot-starter- seata,\n\n然后在这个 yudao-spring-boot-starter- seata模块的pom文件中引入依赖，\n\n<dependency>\n\n<groupId> cn.iocoder.cloud</groupId>\n\n<artifactId>y udao-common</artifactId>\n\n<version>2.3.0-SNAPSHOT</version>\n\n</dependency>\n\n<dependency>\n\n<groupId>com.alibaba.cloud</groupId>\n\n<artifactId>spring-cloud-alibaba-\n\nseata</artifactId>\n\n<version>2023.0.1.2</version>\n\n</dependency>\n\n<dependency>\n\n<groupId>io.seata</groupId>\n\n<artifactId>seata-spring-boot-\n\nstarter</artifactId>\n\n<!--注意不能用 2.0.0版本，事务不生效有 bug-->\n\n<version>1.8.0</version>\n\n</dependency>\n\n<dependency>\n\n<groupId>io.seata</groupId>\n\n<artifactId>seata-all</artifactId>\n\n<!--注意不能用 2.0.0版本，事务不生效有 bug,The\n\nAdapterSpringSeataInterceptor\'s order\'2147483647\' is\n\nlowerorequals thanTransactionInterceptor\'s order\n\n\'2147483647\' ,resetAdapterSpringSeataInterceptor\'s\n\nordertohigher order\'2147483646\'.-->\n\n<version>1.8.0</version>\n\n<exclusions>\n\n<exclusion>\n\n<groupId>log4j</groupId>\n\n<artifactId>log4j</artifactId>\n\n</exclusion>\n\n</exclusions>\n\n</dependency>\n\n<dependency>\n\n<groupId>io.seata</groupId>', 1094, 'd3ec1283-ce70-4465-b3bf-ef53e2610eaa', 372, 2, 0, NULL, '2025-03-09 18:31:44', '1', '2025-03-09 18:44:12', b'1', 1);
INSERT INTO `ai_knowledge_segment` VALUES (142, 3, 21, '## 🐯 平台简介\n\n**芋道**，以开发者为中心，打造中国第一流的快速开发平台，全部开源，个人与企业可 100% 免费使用。\n\n![架构图](https://static.iocoder.cn/ruoyi-vue-pro-architecture.png)\n\n* 管理后台的 Vue3 版本采用 [vue-element-plus-admin](https://gitee.com/kailong110120130/vue-element-plus-admin) ，Vue2 版本采用 [vue-element-admin](https://github.com/PanJiaChen/vue-element-admin) \n* 管理后台的移动端采用 [uni-app](https://github.com/dcloudio/uni-app) 方案，一份代码多终端适配，同时支持 APP、小程序、H5！\n* 后端采用 Spring Boot、MySQL + MyBatis Plus、Redis + Redisson\n* 数据库可使用 MySQL、Oracle、PostgreSQL、SQL Server、MariaDB、国产达梦 DM、TiDB 等\n* 权限认证使用 Spring Security & Token & Redis，支持多终端、多种用户的认证系统，支持 SSO 单点登录\n* 支持加载动态权限菜单，按钮级别权限控制，本地缓存提升性能\n* 支持 SaaS 多租户系统，可自定义每个租户的权限，提供透明化的多租户底层封装\n* 工作流使用 Flowable，支持动态表单、在线设计流程、会签 / 或签、多种任务分配方式\n* 高效率开发，使用代码生成器可以一键生成前后端代码 + 单元测试 + Swagger 接口文档 + Validator 参数校验\n* 集成微信小程序、微信公众号、企业微信、钉钉等三方登陆，集成支付宝、微信等支付与退款\n* 集成阿里云', 836, '', 499, 0, 0, NULL, '2025-03-09 18:45:53', NULL, '2025-03-11 20:13:01', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (143, 3, 21, '、腾讯云等短信渠道，集成 MinIO、阿里云、腾讯云、七牛云等云存储服务\n* 集成报表设计器，支持数据报表、图形报表、打印设计等\n\n##  🐳 项目关系\n\n![架构演进](https://static.iocoder.cn/yudao-roadmap.png?imageView2/2/format/webp)\n\n三个项目的功能对比，可见社区共同整理的 [国产开源项目对比](https://www.yuque.com/xiatian-bsgny/lm0ec1/wqf8mn) 表格。\n\n* 项目地址：<https://gitee.com/zhijiantianya/ruoyi-vue-pro>\n* 官方文档：<https://doc.iocoder.cn/>\n* 演示地址：<http://dashboard.yudao.iocoder.cn>\n* 视频教程：<https://doc.iocoder.cn/video/>\n\n### 后端项目\n\n| 项目                                                              | Star                                                                                                                                                                                                                                                                                             | 简介                          |\n|-----------------------------------------------------------------|--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------|-----------------------------|\n| [ruoyi-vue-pro](https://gitee.com/zhijiantianya/ruoyi-vue-pro)  | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro)       | 基于 Spring Boot 多模块架构        |\n| [yudao-cloud](https://gitee.com/zhijiantianya/yudao-cloud)      | [![Gitee star](https://gitee.com/zhijiantianya/yudao-cloud/badge/star.svg?theme=white)](https://gitee.com/', 1767, '9a3987cd-9562-4522-814e-d070b56ce242', 500, 0, 0, NULL, '2025-03-09 18:45:53', NULL, '2025-03-09 18:45:53', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (144, 3, 21, 'zhijiantianya/yudao-cloud) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/yudao-cloud.svg?style=social&label=Stars)](https://github.com/YunaiV/yudao-cloud)               | 基于 Spring Cloud 微服务架构       |\n| [Spring-Boot-Labs](https://gitee.com/yudaocode/SpringBoot-Labs) | [![Gitee star](https://gitee.com/yudaocode/SpringBoot-Labs/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/yudao-cloud) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/SpringBoot-Labs.svg?style=social&label=Stars)](https://github.com/yudaocode/SpringBoot-Labs) | 系统学习 Spring Boot & Cloud 专栏 |\n\n### 前端项目\n\n| 项目                                                                                                       | Star                                                                                                                                                                                                                                                                                                                                                           | 简介                              |\n|----------------------------------------------------------------------------------------------------------|----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------|---------------------------------|\n| [yudao-ui-admin-vue3](https://gitee.com/yudaocode/yudao-ui-admin-vue3)                                   | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-admin-vue3/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-admin-vue3) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-admin-vue3.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-admin-vue3)                                               | 基于 Vue3 + element-plus 实现的管理后台  |\n| [yudao-ui-admin](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin)               | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin) [![', 2379, '951f5d30-dad3-426b-8314-f79c7e45bdac', 500, 2, 0, NULL, '2025-03-09 18:45:53', NULL, '2025-03-09 10:46:35', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (145, 3, 21, 'GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro/tree/master/yudao-ui-admin)               | 基于 Vue2 + element-ui 实现的管理后台    |\n| [yudao-ui-admin-uniapp](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin-uniapp) | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin-uniapp) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro/tree/master/yudao-ui-admin-uniapp) | 基于 uni-app + uni-ui 实现的管理后台的小程序 |\n| [yudao-ui-go-view](https://gitee.com/yudaocode/yudao-ui-go-view)                                         | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-go-view/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-go-view) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-go-view.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-go-view)                                                           | 基于 Vue3 + naive-ui 实现的大屏报表      |\n| [yudao-ui-app](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-app)                   | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-v', 1450, '0d9c869d-8838-4a89-b80c-60a4131cbc72', 500, 2, 0, NULL, '2025-03-09 18:45:53', NULL, '2025-03-09 10:46:35', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (146, 3, 21, 'ue-pro/tree/master/yudao-ui-app) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro/tree/master/yudao-ui-app)                   | 基于 uni-app + uview 实现的用户 App    |\n\n## 😎 开源协议\n\n**为什么推荐使用本项目？**\n\n① 本项目采用比 Apache 2.0 更宽松的 [MIT License](https://gitee.com/zhijiantianya/ruoyi-vue-pro/blob/master/LICENSE) 开源协议，个人与企业可 100% 免费使用，不用保留类作者、Copyright 信息。\n\n② 代码全部开源，不会像其他项目一样，只开源部分代码，让你无法了解整个项目的架构设计。\n\n③ 代码整洁、架构整洁，遵循《阿里巴巴 Java 开发手册》规范，代码注释详细，57000 行 Java 代码，22000 行代码注释。\n\n## 🐼 内置功能\n\n系统内置多种多种业务功能，可以用于快速你的业务系统：\n\n![功能分层](https://static.iocoder.cn/ruoyi-vue-pro-biz.png)\n\n* 系统功能\n* 基础设施\n* 工作流程\n* 支付系统\n* 数据报表\n\n> 友情提示：本项目基于 RuoYi-Vue 修改，**重构优化**后端的代码，**美化**前端的界面。\n>\n> * 额外新增的功能，我们使用 🚀 标记。\n> * 重新实现的功能，我们使用 ⭐️ 标记。\n\n🙂 所有功能，都通过 **单元测试** 保证高质量。\n\n### 系统功能\n\n|     | 功能    | 描述                              |\n|-----|-------|---------------------------------|', 930, '49c17292-9f26-409d-8078-2c8fa1aea78f', 500, 0, 0, NULL, '2025-03-09 18:45:53', NULL, '2025-03-09 18:45:53', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (147, 3, 21, '|     | 用户管理  | 用户是系统操作者，该功能主要完成系统用户配置          |\n| ⭐️  | 在线用户  | 当前系统中活跃用户状态监控，支持手动踢下线           |\n|     | 角色管理  | 角色菜单权限分配、设置角色按机构进行数据范围权限划分      |\n|     | 菜单管理  | 配置系统菜单、操作权限、按钮权限标识等，本地缓存提供性能    |\n|     | 部门管理  | 配置系统组织机构（公司、部门、小组），树结构展现支持数据权限  |\n|     | 岗位管理  | 配置系统用户所属担任职务                    |\n| 🚀  | 租户管理  | 配置系统租户，支持 SaaS 场景下的多租户功能        |\n| 🚀  | 租户套餐  | 配置租户套餐，自定每个租户的菜单、操作、按钮的权限       |\n|     | 字典管理  | 对系统中经常使用的一些较为固定的数据进行维护          |\n| 🚀  | 短信管理  | 短信渠道、短息模板、短信日志，对接阿里云、腾讯云等主流短信平台 |\n| 🚀  | 操作日志  | 系统正常操作日志记录和查询，集成 Swagger 生成日志内容 |\n| ⭐️  | 登录日志  | 系统登录日志记录查询，包含登录异常               |\n| 🚀  | 错误码管理 | 系统所有错误码的管理，可在线修改错误提示，无需重启服务     |\n|     | 通知公告  | 系统通知公告信息发布维护                    |\n| 🚀', 704, '5c1b69bf-aa2f-47a5-985e-23c91844c9d0', 499, 0, 0, NULL, '2025-03-09 18:45:53', NULL, '2025-03-09 18:45:53', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (148, 3, 21, '| 敏感词  | 配置系统敏感词，支持标签分组                  |\n| 🚀  | 应用管理  | 管理 SSO 单点登录的应用，支持多种 OAuth2 授权方式 |\n\n### 工作流程\n\n|     | 功能    | 描述                                     |\n|-----|-------|----------------------------------------|\n| 🚀  | 流程模型  | 配置工作流的流程模型，支持文件导入与在线设计流程图，提供 7 种任务分配规则 |\n| 🚀  | 流程表单  | 拖动表单元素生成相应的工作流表单，覆盖 Element UI 所有的表单组件 |\n| 🚀  | 用户分组  | 自定义用户分组，可用于工作流的审批分组                    |\n| 🚀  | 我的流程  | 查看我发起的工作流程，支持新建、取消流程等操作，高亮流程图、审批时间线    |\n| 🚀  | 待办任务  | 查看自己【未】审批的工作任务，支持通过、不通过、转发、委派、退回等操作    |\n| 🚀  | 已办任务  | 查看自己【已】审批的工作任务，未来会支持回退操作               |\n| 🚀  | OA 请假 | 作为业务自定义接入工作流的使用示例，只需创建请求对应的工作流程，即可进行审批 |\n\n### 支付系统\n\n|     | 功能   | 描述                        |\n|-----|------|---------------------------|\n| 🚀  | 商户信息 | 管理商户信息，支持 Saas 场景下的多商户功能  |\n| 🚀  | 应用信息 | 配置商户的应用信息，对接支付宝、微信等多个支付渠道 |\n| 🚀', 804, '74fb04a8-b8a4-4cab-9eff-4106b8acca7c', 499, 4, 0, NULL, '2025-03-09 18:45:53', NULL, '2025-03-09 10:49:36', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (149, 3, 21, '| 支付订单 | 查看用户发起的支付宝、微信等的【支付】订单     |\n| 🚀  | 退款订单 | 查看用户发起的支付宝、微信等的【退款】订单     |\n\nps：核心功能已经实现，正在对接微信小程序中...\n\n### 基础设施\n\n|     | 功能       | 描述                                           |\n|-----|----------|----------------------------------------------|\n| 🚀  | 代码生成     | 前后端代码的生成（Java、Vue、SQL、单元测试），支持 CRUD 下载       |\n| 🚀  | 系统接口     | 基于 Swagger 自动生成相关的 RESTful API 接口文档          |\n| 🚀  | 数据库文档    | 基于 Screw 自动生成数据库文档，支持导出 Word、HTML、MD 格式      |\n|     | 表单构建     | 拖动表单元素生成相应的 HTML 代码，支持导出 JSON、Vue 文件         |\n| 🚀  | 配置管理     | 对系统动态配置常用参数，支持 SpringBoot 加载                 |\n| ⭐️  | 定时任务     | 在线（添加、修改、删除)任务调度包含执行结果日志                     |\n| 🚀  | 文件服务     | 支持将文件存储到 S3（MinIO、阿里云、腾讯云、七牛云）、本地、FTP、数据库等      | \n| 🚀  | API 日志   | 包括 RESTful API 访问日志、异常日志两部分，方便排查 API 相关的问题   |\n|     | MySQL 监控 | 监视当前系统数据库连接池状态，可进行分析SQL找出系统性能瓶颈              |\n|     | Redis 监控 | 监控 Redis 数据库的使用情况，使用的 Redis Key 管理           |\n| 🚀  | 消息队列     | 基于 Redis 实现消息', 946, '2fae57d4-ec04-49de-a57c-5a2892d66257', 500, 0, 0, NULL, '2025-03-09 18:45:53', NULL, '2025-03-09 18:45:53', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (150, 3, 21, '队列，Stream 提供集群消费，Pub/Sub 提供广播消费 |\n| 🚀  | Java 监控  | 基于 Spring Boot Admin 实现 Java 应用的监控           |\n| 🚀  | 链路追踪     | 接入 SkyWalking 组件，实现链路追踪                      |\n| 🚀  | 日志中心     | 接入 SkyWalking 组件，实现日志中心                      |\n| 🚀  | 分布式锁     | 基于 Redis 实现分布式锁，满足并发场景                       |\n| 🚀  | 幂等组件     | 基于 Redis 实现幂等组件，解决重复请求问题                     |\n| 🚀  | 服务保障     | 基于 Resilience4j 实现服务的稳定性，包括限流、熔断等功能          |\n| 🚀  | 日志服务     | 轻量级日志中心，查看远程服务器的日志                           |\n| 🚀  | 单元测试     | 基于 JUnit + Mockito 实现单元测试，保证功能的正确性、代码的质量等    |\n\n### 数据报表\n\n|     | 功能       | 描述                                           |\n|-----|----------|----------------------------------------------|\n| 🚀  | 报表设计器     | 支持数据报表、图形报表、打印设计等       |\n| 🚀  | 大屏设计器     | 建设中... 拖拽式实现可视化数据大屏          |\n\n## 🐨 技术栈\n\n| 项目                      | 说明                 |\n|-------------------------|-----------------------|\n| `yudao-dependencies`    | Maven 依赖版本管理       |\n| `yudao-framework`       | Java 框架拓展          |\n| `yudao-server`          | 管理后台 + 用户 APP 的服务端 |\n| `yudao-ui-admin`        | 管理', 1092, 'e67aa9d3-d115-4a8b-8a33-20b222741d8c', 500, 6, 0, NULL, '2025-03-09 18:45:53', NULL, '2025-03-09 10:49:55', b'0', 1);
