INSERT INTO `ai_knowledge_segment` VALUES (156, 2, 22, '## 🐯 平台简介\n\n**芋道**，以开发者为中心，打造中国第一流的快速开发平台，全部开源，个人与企业可 100% 免费使用。\n\n![架构图](https://static.iocoder.cn/ruoyi-vue-pro-architecture.png)\n\n* 管理后台的 Vue3 版本采用 [vue-element-plus-admin](https://gitee.com/kailong110120130/vue-element-plus-admin) ，Vue2 版本采用 [vue-element-admin](https://github.com/PanJiaChen/vue-element-admin) \n* 管理后台的移动端采用 [uni-app](https://github.com/dcloudio/uni-app) 方案，一份代码多终端适配，同时支持 APP、小程序、H5！\n* 后端采用 Spring Boot、MySQL + MyBatis Plus、Redis + Redisson\n* 数据库可使用 MySQL、Oracle、PostgreSQL、SQL Server、MariaDB、国产达梦 DM、TiDB 等\n* 权限认证使用 Spring Security & Token & Redis，支持多终端、多种用户的认证系统，支持 SSO 单点登录\n* 支持加载动态权限菜单，按钮级别权限控制，本地缓存提升性能\n* 支持 SaaS 多租户系统，可自定义每个租户的权限，提供透明化的多租户底层封装\n* 工作流使用 Flowable，支持动态表单、在线设计流程、会签 / 或签、多种任务分配方式\n* 高效率开发，使用代码生成器可以一键生成前后端代码 + 单元测试 + Swagger 接口文档 + Validator 参数校验\n* 集成微信小程序、微信公众号、企业微信、钉钉等三方登陆，集成支付宝、微信等支付与退款\n* 集成阿里云', 836, '4363be1d-0d2f-433f-9e69-e90aa8efbd88', 499, 0, 0, NULL, '2025-03-09 18:50:19', NULL, '2025-03-11 20:15:47', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (157, 2, 22, '、腾讯云等短信渠道，集成 MinIO、阿里云、腾讯云、七牛云等云存储服务\n* 集成报表设计器，支持数据报表、图形报表、打印设计等\n\n##  🐳 项目关系\n\n![架构演进](https://static.iocoder.cn/yudao-roadmap.png?imageView2/2/format/webp)\n\n三个项目的功能对比，可见社区共同整理的 [国产开源项目对比](https://www.yuque.com/xiatian-bsgny/lm0ec1/wqf8mn) 表格。\n\n* 项目地址：<https://gitee.com/zhijiantianya/ruoyi-vue-pro>\n* 官方文档：<https://doc.iocoder.cn/>\n* 演示地址：<http://dashboard.yudao.iocoder.cn>\n* 视频教程：<https://doc.iocoder.cn/video/>\n\n### 后端项目\n\n| 项目                                                              | Star                                                                                                                                                                                                                                                                                             | 简介                          |\n|-----------------------------------------------------------------|--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------|-----------------------------|\n| [ruoyi-vue-pro](https://gitee.com/zhijiantianya/ruoyi-vue-pro)  | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro)       | 基于 Spring Boot 多模块架构        |\n| [yudao-cloud](https://gitee.com/zhijiantianya/yudao-cloud)      | [![Gitee star](https://gitee.com/zhijiantianya/yudao-cloud/badge/star.svg?theme=white)](https://gitee.com/', 1767, 'ef9735a5-c474-4548-ab5d-19371ee820ab', 500, 1, 0, NULL, '2025-03-09 18:50:19', NULL, '2025-03-11 20:15:47', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (158, 2, 22, 'zhijiantianya/yudao-cloud) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/yudao-cloud.svg?style=social&label=Stars)](https://github.com/YunaiV/yudao-cloud)               | 基于 Spring Cloud 微服务架构       |\n| [Spring-Boot-Labs](https://gitee.com/yudaocode/SpringBoot-Labs) | [![Gitee star](https://gitee.com/yudaocode/SpringBoot-Labs/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/yudao-cloud) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/SpringBoot-Labs.svg?style=social&label=Stars)](https://github.com/yudaocode/SpringBoot-Labs) | 系统学习 Spring Boot & Cloud 专栏 |\n\n### 前端项目\n\n| 项目                                                                                                       | Star                                                                                                                                                                                                                                                                                                                                                           | 简介                              |\n|----------------------------------------------------------------------------------------------------------|----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------|---------------------------------|\n| [yudao-ui-admin-vue3](https://gitee.com/yudaocode/yudao-ui-admin-vue3)                                   | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-admin-vue3/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-admin-vue3) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-admin-vue3.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-admin-vue3)                                               | 基于 Vue3 + element-plus 实现的管理后台  |\n| [yudao-ui-admin](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin)               | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin) [![', 2379, '339b5c8c-165e-4d18-9c6c-f7ccf622251d', 500, 0, 0, NULL, '2025-03-09 18:50:19', NULL, '2025-03-11 20:15:48', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (159, 2, 22, 'GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro/tree/master/yudao-ui-admin)               | 基于 Vue2 + element-ui 实现的管理后台    |\n| [yudao-ui-admin-uniapp](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin-uniapp) | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-admin-uniapp) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro/tree/master/yudao-ui-admin-uniapp) | 基于 uni-app + uni-ui 实现的管理后台的小程序 |\n| [yudao-ui-go-view](https://gitee.com/yudaocode/yudao-ui-go-view)                                         | [![Gitee star](https://gitee.com/yudaocode/yudao-ui-go-view/badge/star.svg?theme=white)](https://gitee.com/yudaocode/yudao-ui-go-view) [![GitHub stars](https://img.shields.io/github/stars/yudaocode/yudao-ui-go-view.svg?style=social&label=Stars)](https://github.com/yudaocode/yudao-ui-go-view)                                                           | 基于 Vue3 + naive-ui 实现的大屏报表      |\n| [yudao-ui-app](https://gitee.com/zhijiantianya/ruoyi-vue-pro/tree/master/yudao-ui-app)                   | [![Gitee star](https://gitee.com/zhijiantianya/ruoyi-vue-pro/badge/star.svg?theme=white)](https://gitee.com/zhijiantianya/ruoyi-v', 1450, '2d6daa4d-c4c2-48b2-907c-b384baf5dec7', 500, 0, 0, NULL, '2025-03-09 18:50:19', NULL, '2025-03-11 20:15:48', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (160, 2, 22, 'ue-pro/tree/master/yudao-ui-app) [![GitHub stars](https://img.shields.io/github/stars/YunaiV/ruoyi-vue-pro.svg?style=social&label=Stars)](https://github.com/YunaiV/ruoyi-vue-pro/tree/master/yudao-ui-app)                   | 基于 uni-app + uview 实现的用户 App    |\n\n## 😎 开源协议\n\n**为什么推荐使用本项目？**\n\n① 本项目采用比 Apache 2.0 更宽松的 [MIT License](https://gitee.com/zhijiantianya/ruoyi-vue-pro/blob/master/LICENSE) 开源协议，个人与企业可 100% 免费使用，不用保留类作者、Copyright 信息。\n\n② 代码全部开源，不会像其他项目一样，只开源部分代码，让你无法了解整个项目的架构设计。\n\n③ 代码整洁、架构整洁，遵循《阿里巴巴 Java 开发手册》规范，代码注释详细，57000 行 Java 代码，22000 行代码注释。\n\n## 🐼 内置功能\n\n系统内置多种多种业务功能，可以用于快速你的业务系统：\n\n![功能分层](https://static.iocoder.cn/ruoyi-vue-pro-biz.png)\n\n* 系统功能\n* 基础设施\n* 工作流程\n* 支付系统\n* 数据报表\n\n> 友情提示：本项目基于 RuoYi-Vue 修改，**重构优化**后端的代码，**美化**前端的界面。\n>\n> * 额外新增的功能，我们使用 🚀 标记。\n> * 重新实现的功能，我们使用 ⭐️ 标记。\n\n🙂 所有功能，都通过 **单元测试** 保证高质量。\n\n### 系统功能\n\n|     | 功能    | 描述                              |\n|-----|-------|---------------------------------|', 930, '16bef440-7e1e-49d4-ad69-fefc53072186', 500, 1, 0, NULL, '2025-03-09 18:50:19', NULL, '2025-03-11 20:15:49', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (161, 2, 22, '|     | 用户管理  | 用户是系统操作者，该功能主要完成系统用户配置          |\n| ⭐️  | 在线用户  | 当前系统中活跃用户状态监控，支持手动踢下线           |\n|     | 角色管理  | 角色菜单权限分配、设置角色按机构进行数据范围权限划分      |\n|     | 菜单管理  | 配置系统菜单、操作权限、按钮权限标识等，本地缓存提供性能    |\n|     | 部门管理  | 配置系统组织机构（公司、部门、小组），树结构展现支持数据权限  |\n|     | 岗位管理  | 配置系统用户所属担任职务                    |\n| 🚀  | 租户管理  | 配置系统租户，支持 SaaS 场景下的多租户功能        |\n| 🚀  | 租户套餐  | 配置租户套餐，自定每个租户的菜单、操作、按钮的权限       |\n|     | 字典管理  | 对系统中经常使用的一些较为固定的数据进行维护          |\n| 🚀  | 短信管理  | 短信渠道、短息模板、短信日志，对接阿里云、腾讯云等主流短信平台 |\n| 🚀  | 操作日志  | 系统正常操作日志记录和查询，集成 Swagger 生成日志内容 |\n| ⭐️  | 登录日志  | 系统登录日志记录查询，包含登录异常               |\n| 🚀  | 错误码管理 | 系统所有错误码的管理，可在线修改错误提示，无需重启服务     |\n|     | 通知公告  | 系统通知公告信息发布维护                    |\n| 🚀', 704, '', 499, 0, 0, NULL, '2025-03-09 18:50:19', NULL, '2025-03-11 20:15:49', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (162, 2, 22, '| 敏感词  | 配置系统敏感词，支持标签分组                  |\n| 🚀  | 应用管理  | 管理 SSO 单点登录的应用，支持多种 OAuth2 授权方式 |\n\n### 工作流程\n\n|     | 功能    | 描述                                     |\n|-----|-------|----------------------------------------|\n| 🚀  | 流程模型  | 配置工作流的流程模型，支持文件导入与在线设计流程图，提供 7 种任务分配规则 |\n| 🚀  | 流程表单  | 拖动表单元素生成相应的工作流表单，覆盖 Element UI 所有的表单组件 |\n| 🚀  | 用户分组  | 自定义用户分组，可用于工作流的审批分组                    |\n| 🚀  | 我的流程  | 查看我发起的工作流程，支持新建、取消流程等操作，高亮流程图、审批时间线    |\n| 🚀  | 待办任务  | 查看自己【未】审批的工作任务，支持通过、不通过、转发、委派、退回等操作    |\n| 🚀  | 已办任务  | 查看自己【已】审批的工作任务，未来会支持回退操作               |\n| 🚀  | OA 请假 | 作为业务自定义接入工作流的使用示例，只需创建请求对应的工作流程，即可进行审批 |\n\n### 支付系统\n\n|     | 功能   | 描述                        |\n|-----|------|---------------------------|\n| 🚀  | 商户信息 | 管理商户信息，支持 Saas 场景下的多商户功能  |\n| 🚀  | 应用信息 | 配置商户的应用信息，对接支付宝、微信等多个支付渠道 |\n| 🚀', 804, '0daa057c-c1b7-48f5-b2c3-5528b9d078a9', 499, 6, 0, NULL, '2025-03-09 18:50:19', NULL, '2025-03-11 09:41:02', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (163, 2, 22, '| 支付订单 | 查看用户发起的支付宝、微信等的【支付】订单     |\n| 🚀  | 退款订单 | 查看用户发起的支付宝、微信等的【退款】订单     |\n\nps：核心功能已经实现，正在对接微信小程序中...\n\n### 基础设施\n\n|     | 功能       | 描述                                           |\n|-----|----------|----------------------------------------------|\n| 🚀  | 代码生成     | 前后端代码的生成（Java、Vue、SQL、单元测试），支持 CRUD 下载       |\n| 🚀  | 系统接口     | 基于 Swagger 自动生成相关的 RESTful API 接口文档          |\n| 🚀  | 数据库文档    | 基于 Screw 自动生成数据库文档，支持导出 Word、HTML、MD 格式      |\n|     | 表单构建     | 拖动表单元素生成相应的 HTML 代码，支持导出 JSON、Vue 文件         |\n| 🚀  | 配置管理     | 对系统动态配置常用参数，支持 SpringBoot 加载                 |\n| ⭐️  | 定时任务     | 在线（添加、修改、删除)任务调度包含执行结果日志                     |\n| 🚀  | 文件服务     | 支持将文件存储到 S3（MinIO、阿里云、腾讯云、七牛云）、本地、FTP、数据库等      | \n| 🚀  | API 日志   | 包括 RESTful API 访问日志、异常日志两部分，方便排查 API 相关的问题   |\n|     | MySQL 监控 | 监视当前系统数据库连接池状态，可进行分析SQL找出系统性能瓶颈              |\n|     | Redis 监控 | 监控 Redis 数据库的使用情况，使用的 Redis Key 管理           |\n| 🚀  | 消息队列     | 基于 Redis 实现消息', 946, 'aa345612-2c60-4e1f-81db-cf2c3a1086cc', 500, 0, 0, NULL, '2025-03-09 18:50:19', NULL, '2025-03-11 09:41:02', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (164, 2, 22, '队列，Stream 提供集群消费，Pub/Sub 提供广播消费 |\n| 🚀  | Java 监控  | 基于 Spring Boot Admin 实现 Java 应用的监控           |\n| 🚀  | 链路追踪     | 接入 SkyWalking 组件，实现链路追踪                      |\n| 🚀  | 日志中心     | 接入 SkyWalking 组件，实现日志中心                      |\n| 🚀  | 分布式锁     | 基于 Redis 实现分布式锁，满足并发场景                       |\n| 🚀  | 幂等组件     | 基于 Redis 实现幂等组件，解决重复请求问题                     |\n| 🚀  | 服务保障     | 基于 Resilience4j 实现服务的稳定性，包括限流、熔断等功能          |\n| 🚀  | 日志服务     | 轻量级日志中心，查看远程服务器的日志                           |\n| 🚀  | 单元测试     | 基于 JUnit + Mockito 实现单元测试，保证功能的正确性、代码的质量等    |\n\n### 数据报表\n\n|     | 功能       | 描述                                           |\n|-----|----------|----------------------------------------------|\n| 🚀  | 报表设计器     | 支持数据报表、图形报表、打印设计等       |\n| 🚀  | 大屏设计器     | 建设中... 拖拽式实现可视化数据大屏          |\n\n## 🐨 技术栈\n\n| 项目                      | 说明                 |\n|-------------------------|-----------------------|\n| `yudao-dependencies`    | Maven 依赖版本管理       |\n| `yudao-framework`       | Java 框架拓展          |\n| `yudao-server`          | 管理后台 + 用户 APP 的服务端 |\n| `yudao-ui-admin`        | 管理', 1092, '95c808f1-00eb-493d-b797-87b8c9c10b2e', 500, 9, 0, NULL, '2025-03-09 18:50:19', NULL, '2025-03-11 09:41:02', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (165, 2, 22, '后台的 Vue2 前端项目     |\n| `yudao-ui-admin-vue3`   | 管理后台的 Vue3 前端项目     |\n| `yudao-ui-admin-uniapp` | 管理后台的 uni-app 多端项目  |\n| `yudao-ui-app`          | 用户 APP 的 UI 界面     |\n| `yudao-module-system`   | 系统功能的 Module 模块    |\n| `yudao-module-member`   | 会员中心的 Module 模块    |\n| `yudao-module-infra`    | 基础设施的 Module 模块    |\n| `yudao-module-tool`     | 研发工具的 Module 模块    |\n| `yudao-module-bpm`      | 工作流程的 Module 模块    |\n| `yudao-module-pay`      | 支付系统的 Module 模块    |\n\n### 后端\n\n| 框架                                                                                         | 说明                   | 版本          | 学习指南                                                           |\n|---------------------------------------------------------------------------------------------|-----------------------|-------------|----------------------------------------------------------------|\n| [Spring Boot](https://spring.io/projects/spring-boot)                                       | 应用开发框架             | 2.7.6       | [文档](https://github.com/YunaiV/SpringBoot-Labs)                |\n| [MySQL](https://www.mysql.com/cn/)                                                          | 数据库服务器             | 5.7 / 8.0+  |                                                                |\n| [Druid](https://github.com/alibaba/druid)                                                   | JDBC 连接池、监控组件     | 1.2.15      | [文档](http://www.iocoder.cn/Spring-Boot/datasource-pool/?yudao) |\n| [MyBatis Plus](https://mp.baomidou.com/)                                                    | MyBatis 增强工具包       | 3.5.2       | [文档](http://www.iocoder.cn/Spring-Boot/MyBatis/?yudao)         |\n| [Dynamic Datasource](https://dynamic-datasource.com', 1705, '01a1aedb-59c0-4927-85ae-3d77e1991377', 500, 0, 0, NULL, '2025-03-09 18:50:19', NULL, '2025-03-11 09:41:02', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (166, 2, 22, '/)                                       | 动态数据源               | 3.6.0       | [文档](http://www.iocoder.cn/Spring-Boot/datasource-pool/?yudao) |\n| [Redis](https://redis.io/)                                                                  | key-value 数据库        | 5.0 / 6.0   |                                                                |\n| [Redisson](https://github.com/redisson/redisson)                                            | Redis 客户端            | 3.18.0      | [文档](http://www.iocoder.cn/Spring-Boot/Redis/?yudao)           |\n| [Spring MVC](https://github.com/spring-projects/spring-framework/tree/master/spring-webmvc) | MVC 框架               | 5.3.24      | [文档](http://www.iocoder.cn/SpringMVC/MVC/?yudao)               |\n| [Spring Security](https://github.com/spring-projects/spring-security)                       | Spring 安全框架         | 5.7.5       | [文档](http://www.iocoder.cn/Spring-Boot/Spring-Security/?yudao) |\n| [Hibernate Validator](https://github.com/hibernate/hibernate-validator)                     | 参数校验组件             | 6.2.5       | [文档](http://www.iocoder.cn/Spring-Boot/Validation/?yudao)      |\n| [Flowable](https://github.com/flowable/flowable-engine)                                     | 工作流引擎               | 6.7.2       | [文档](https://doc.iocoder.cn/bpm/)                                                     |\n| [Quartz](https://github.com/quartz-scheduler)                                               | 任务调度组件             | 2.3.2       | [文档](http://www.iocoder.cn/Spring-Boot/Job/?yudao)             |\n| [Knife4j](https://gitee.com/xiaoym/knife4j)                                                 | Swagger 增强 UI 实现    | 3.0.3       | [文档](http://www.iocoder.cn/Spring-Boot/Swagger/?yudao)         |\n| [Resilience4', 1758, 'ec784049-a2cf-4f66-83d0-5984b232f732', 500, 0, 0, NULL, '2025-03-09 18:50:19', NULL, '2025-03-11 09:41:02', b'0', 1);
