Admin](https://panjiachen.github.io/vue-element-admin-site/zh/) | 后', 1997, '93b46b30-6f21-4368-935d-22c5167c88fe', 500, 1, 0, NULL, '2025-03-09 18:50:19', NULL, '2025-03-11 09:41:02', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (168, 2, 22, '台前端解决方案      | -      |\n\n### [管理后台 Vue3 前端](./yudao-ui-admin-vue3)\n\n| 框架                                                                  |     说明      |   版本   |\n|----------------------------------------------------------------------|:------------:|:------:|\n| [Vue](https://staging-cn.vuejs.org/)                                 |   Vue 框架    | 3.2.45 |\n| [Vite](https://cn.vitejs.dev//)                                      | 开发与构建工具  | 4.0.3  |\n| [Element Plus](https://element-plus.org/zh-CN/)                      | Element Plus | 2.2.27 |\n| [TypeScript](https://www.typescriptlang.org/docs/)                   |  TypeScript  | 4.9.4  |\n| [pinia](https://pinia.vuejs.org/)                                    |    vuex5     | 2.0.28 |\n| [vue-i18n](https://kazupon.github.io/vue-i18n/zh/introduction.html/) |    国际化     | 9.2.2  |\n| [vxe-table](https://vxetable.cn/)                                    |  vue最强表单  | 4.3.7  |\n\n### [管理后台 uni-app 跨端](./yudao-ui-admin-uniapp)\n\n| 框架                                                                  | 说明               | 版本     |\n|----------------------------------------------------------------------|------------------|--------|\n| [uni-app](hhttps://github.com/dcloudio/uni-app)                                 | 跨平台框架           | 2.0.0 |\n| [uni-ui](https://github.com/dcloudio/uni-ui)                                      | 基于 uni-app 的 UI 框架          | 1.4.20  |\n\n## 🐷 演示图\n\n**效果预览** ：\n\n![首页](https://mmbiz.qpic.cn/mmbiz/iaIdQfEric9Txw85YtbKNvl0ibKkgxeiahe5GYiamW2FAgbicPCzMAx37hy26WL8wtcgGqU8olicAYgAlDyGwIJtgsc6Q/640?wx', 1573, '1b57e4fb-841c-4f31-8a90-e5d6cc814586', 500, 0, 0, NULL, '2025-03-09 18:50:19', NULL, '2025-03-11 09:41:02', b'0', 1);
