INSERT INTO `ai_knowledge_segment` VALUES (171, 2, 23, '---\nmarp: true\n---\n\n# 分享内容\n\n* 为什么推荐阅读 MQ 的源码\n* 对比 RocketMQ 与 PMQ 的整体架构\n* 有趣的 MQ 功能点实现\n\n---\n\n# 为什么推荐阅 MQ 的源码\n\n* 工作：[常用中间件](https://www.processon.com/view/link/60f3896a0791291daf481096)\n* 技术：[一通百通](https://www.processon.com/view/link/60f3bcc2e401fd4fe0542a0e)\n\n---\n\n# 整体架构\n\n[RocketMQ  与 PMQ 对比图](https://www.processon.com/diagraming/60eced2d7d9c08312720a8e3)\n\n<!-- [只读](https://www.processon.com/view/link/60f3becb1efad41bbea96c7d) -->\n\n* 存储\n* 高可用\n* 通信\n* 注册中心内嵌\n\n---\n\n# 消息队列的功能\n\n[功能导图](https://www.processon.com/view/link/60f3de381efad41bbea99334)\n\n---\n\n# 前置：消息模型\n\n~~JMS、AMQP、OpenMessaging 协议~~\n\n[Topic + Queue 模型](https://www.processon.com/view/link/60f3de381efad41bbea99334)\n\n<!-- [只读](https://www.processon.com/view/link/60f3e49c5653bb0b4889f98f) -->\n\n---\n\n# RocketMQ 存储\n\n## 1. 整体\n\n![store 目录](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-%E6%95%B4%E4%BD%93.png)\n\n## 2. config 目录\n\n![config 目录](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-config.png)\n\n---\n\n# RocketMQ 存储（config）\n\n### 2.1 topics.json\n\n用途：Topic 定', 1028, '0b4c2799-f1dd-4ee4-8dfa-e18f8540c39d', 500, 0, 0, NULL, '2025-03-10 12:54:22', NULL, '2025-03-11 09:41:02', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (172, 2, 23, '义\n\n![topics.json](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-topics.png)\n\n---\n\n# RocketMQ 存储（config）\n\n### 2.1 topics.json（有趣的参数）\n\n<!-- readQueueNums vs writeQueueNums？ -->\n\n[有趣的参数](https://www.processon.com/diagraming/60f3eae4637689739c3bbbc5)\n\n<!-- [只读](https://www.processon.com/view/link/60f3ef735653bb0b488a09c4) -->\n\n---\n\n# RocketMQ 存储（config）\n\n### 2.2 subscriptionGroupTable.json\n\n用途：Consumer Group 定义\n\n![subscriptionGroupTable.json](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-subscriptionGroupTable.png)\n\n为什么没有订阅的 topic？\n\n---\n\n# RocketMQ 存储（config）\n\n### 2.3 offsetTable.json\n\n用途：每个消费组，针对每个 topic 的消费进度\n\n![offsetTable.json](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-offsetTable.png)\n\n---\n\n# RocketMQ 存储（commitlog）\n\n## 3. commitlog 目录\n\n用途：存储所有消息\n\n![commitlog 目录](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-commitlog.png)\n\n问题：为什么是 1G？\n* Memory-mapped files cannot be larger than 2GB on 32-bit systems.\n\n---\n\n# RocketMQ 存储（commitlog）\n\n## 3.1 消息分布\n\n![消息分布](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-commitlog2.png)\n\n---\n\n# RocketMQ 存储（commitlog）\n\n## 3.2 消息格式\n\n[![消息格式](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-commitlog3.png)](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A', 1244, '54858aac-86fd-4d30-846e-714a07be6c0d', 500, 0, 0, NULL, '2025-03-10 12:54:22', NULL, '2025-03-11 09:41:02', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (173, 2, 23, '8-commitlog3.png)\n\n---\n\n# RocketMQ 存储（consumequeue）\n\n## 4. 存储（consumequeue）\n\n用途：每个 topic 的 queue，对 commitlog 的索引\n\n额外作用：计算每个 topic + queue 的 offset\n\n![关系](http://assets.processon.com/chart_image/60f3fbdf5653bb0b488a1a07.png)\n\n---\n\n## 4.1 分布\n\n![](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-consuequeue.png)\n\n和 commitlog 一样的命名方式，只是大小为 30w * 20B\n\n---\n\n## 4.2 内容\n\n![](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-consuequeue2.png)\n\n长度为 20B\n\n提问：为什么会有 Tag？\n\n---\n\n# PMQ 存储\n\n## 4.1 表关系\n\n[传送门](https://www.processon.com/diagraming/60f2b4f25653bb0b488947a4)\n\n<!-- 只读 http://assets.processon.com/chart_image/60f2b4f35653bb0b488947a7.png -->\n\n---\n\n# 4.2 分库分表\n\n![分库分表](https://static.iocoder.cn/pmq%E5%AD%98%E5%82%A8-%E5%88%86%E5%BA%93%E5%88%86%E8%A1%A8.png)\n\n---\n\n# 4.2 分库分表\n\n![查询演示](https://static.iocoder.cn/pmq%E5%AD%98%E5%82%A8-%E5%88%86%E5%BA%93%E5%88%86%E8%A1%A82.png)\n\n----\n\n# 4.3 RocketMQ 文件 vs PMQ 表\n\n| 定义 |  RocketMQ 文件 | PMQ 表 | 备注 |\n|  ----  |  ----  | ----  | ----  |\n| 主题 | `topics.json`  | `topic`  |   |\n| 队列 |   | `queue` | ① 分库', 1050, '13c07c1d-c357-45e1-9065-5e1f48c8ecbb', 500, 0, 0, NULL, '2025-03-10 12:54:22', NULL, '2025-03-11 09:41:02', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (174, 2, 23, '分表 |\n| 消费者分组 | `subscriptionGroupTable.json`  | `consumer_group` |  |\n| 消费进度 | `offsetTable.json`  | `queue_offset` |  |\n| 消费者 | 内存  | `consumer` | ② 共享 |\n| 分组的消费者 | 内存  | `consumer_group_consumer` | ② 共享 |\n| 分组的主题 | 内存  | `consumer_group_topic` | ② 共享 |\n| 消息 | `commitlog` + `consumequeue`  | `message` | ③ ？？？  |\n\n---\n\n# 4.4 是否可以每个队列的文件，直接存储消息？\n\nkafka 的设计如此。\n\nrocketmq 优点：\n* commitlog 消息的合并提交\n* 无法支撑海量 Topic + 队列 [《如何解决kafka topic数量过多带来的性能问题？》](https://www.zhihu.com/question/431131178/answer/1586855731)\n\nrocketmq 缺点：\n* commitlog 是顺序写，但是 commitlog 是随机读\n* 读取两次，先读 consumequeue，在读 commitlog\n\n<!-- 参考文章，RocketMQ 负责人的分析 https://developer.aliyun.com/article/105 -->\n\n推荐阅读：[《天池中间件大赛百万队列存储设计总结【复赛】》](https://mp.weixin.qq.com/s/aQtaDdnGxoGLvmXf7iuhLQ)\n\n---\n\n# RocketMQ 消息的写入\n\n需要写入 commitlog 和 consumequeue\n\n---\n\n## 4.1 写入 commitlog\n\n三种：\n* 同步写入\n* 异步写入 + mmap\n* 异步写入 + filechannel + buffer\n\n[传送门](https://www.processon.com/diagraming/60eced2d7d9c08312720a8e3)\n\n<!-- 只读 hhttps://www.processon.com/view/link/60f3becb1efad41bbea', 1018, 'eb291eff-bd57-45f3-8527-7f40c8870f76', 500, 2, 0, NULL, '2025-03-10 12:54:22', NULL, '2025-03-11 09:41:02', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (175, 2, 23, '96c7d -->\n\nTODO 需要再思考下\n\n---\n\n## 4.2 写入 consumequeue\n\n![写入 consumequeue](http://assets.processon.com/chart_image/60f4590ae401fd4fe054d374.png)\n\n---\n\n# RocketMQ 消息的读取\n\n两种：\n* 堆内传输\n* 堆外传输 + 零拷贝\n\n[传送门](https://www.processon.com/diagraming/60f45b0d637689739c3c2faa)\n\n<!-- 只读 https://www.processon.com/view/link/60f4619b1e085376da5bbd73 -->\n\nTODO 需要再思考下\n\n---\n\n# PMQ 消息的写入\n\nTopic、Queue 等元数据，缓存在内存中，通过定时任务每 3000 毫秒刷新一次。\n\n```Java\n    // 设置使用的 DB 编号；该变量，是 ThreadLocal\n    message01Service.setDbId(temp.getDbNodeId());\n```\n\n如下，是批量插入消息的 SQL：\n\n```SQL\n	<insert id=\"insertBatchDy\" useGeneratedKeys=\"false\">\n		insert into ${tbName} (\n		    biz_id, tag,  head,  body, send_ip, race_id, retry_count\n		)\n		values\n		<foreach collection=\"entityList\" item=\"item\" index=\"index\" separator=\",\">\n		(\n		    #{item.bizId}, #{item.tag}, #{item.body}, #{item.sendIp}, #{item.traceId} , #{item.retryCount}\n		)\n		</foreach>\n	</insert>\n```\n\n[《阿里云 MySQL 8.0测试结果》](https://help.aliyun.com/document_detail/150351.html)\n\n[MySQL 写入过程](https://www.processon.com/view/link/5f6eb0845653bb6013249557)\n\n---\n\n# PMQ 消息的读取\n\n```Java\n    // 设置使用的 DB 编号；该变量，是 ThreadLocal\n    message01Service.setDbId(temp.getDbNodeId());\n```\n\n如下，是批量查询消息的 SQL：\n\n```SQL\n	<select', 1210, 'c194607c-58f8-4d1b-a358-2618bde591fd', 500, 0, 0, NULL, '2025-03-10 12:54:22', NULL, '2025-03-11 09:41:02', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (176, 2, 23, 'id=\"getListDy\" resultMap=\"BaseResultMap\" statementType=\"STATEMENT\"\n		useCache=\"false\">\n	        <![CDATA[\n			select *\n			from ${tbName} where id>${start} and id<=${end}\n	         ]]>\n	</select>\n```\n\n---\n\n# RocketMQ 高可用\n\n* 主从架构\n* [基于 Raft 协议的多副本架构](https://www.infoq.cn/article/7xejrpdzba9v*gdzofs6)\n\n---\n\n# 1. RocketMQ 高可用（主从架构）\n\n![](http://assets.processon.com/chart_image/60f434325653bb0b488a54c1.png)\n\n* 主从不支持切换\n* 多套 Broker 集群保证可用性\n* 需要同步的数据：1）commitlog；2）config\n\n---\n\n# 2. RocketMQ 高可用（主从同步 commitlog）\n\n同步类型：\n* 同步\n* 异步\n\n[流程图](https://www.processon.com/diagraming/60f43bbee401fd4fe054bb9a)\n\n<!-- 只读 <https://www.processon.com/view/link/60f440b7637689739c3c1b3a> -->\n\n---\n\n# 3. RocketMQ 高可用（主从同步 config）\n\n[流程图](https://www.processon.com/diagraming/60f445d10791291daf48df0e)\n\n<!-- 只读 <https://www.processon.com/view/link/60f4476c7d9c087bac5ce124> -->\n\n---\n\n# PMQ 高可用\n\n[传送门](https://www.processon.com/diagraming/60f447f55653bb0b488a6a94)\n\n<!-- 只读 <https://www.processon.com/view/link/60f4488a1e085376da5bae6b> -->\n\n* Broker 无状态，集群\n* MySQL 主从集群\n\n---\n\n# RocketMQ 延迟消息（定义）\n\n延迟级别：\n\n| 延迟级别 | 时间 |    延迟', 1097, '89cb689c-c2a4-42b1-89ea-dffd75179086', 500, 0, 0, NULL, '2025-03-10 12:54:22', NULL, '2025-03-11 09:41:02', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (177, 2, 23, '级别  |   时间   |\n| :------- | :--- | ---- | :--- |\n| 1        | 1s   | 10   | 6m   |\n| 2        | 5s   | 11   | 7m   |\n| 3        | 10s  | 12   | 8m   |\n| 4        | 30s  | 13   | 9m   |\n| 5        | 1m   | 14   | 10m  |\n| 6        | 2m   | 15   | 20m  |\n| 7        | 3m   | 16   | 30m  |\n| 8        | 4m   | 17   | 1h   |\n| 9        | 5m   | 18   | 2h   |\n\n---\n\n# RocketMQ 延迟消息（实现）\n\n实现原理：[传送门](https://www.processon.com/diagraming/60f468067d9c087bac5cf13a)\n\n<!-- 只读 https://www.processon.com/view/link/60f46df31efad41bbeaa2182 -->\n\n# 其它中间件的延迟消息\n\n* Mafka 支持任意维度的延迟消息\n* [QMQ 支持任意时间的延迟消息](https://github.com/qunarcorp/qmq/blob/master/docs/cn/arch.md#%E5%BB%B6%E6%97%B6%E5%AE%9A%E6%97%B6%E6%B6%88%E6%81%AF)\n* [rabbitmq 支持任务时间的延迟消息](https://blog.csdn.net/u013256816/article/details/55106401)\n* [滴滴开源分布式消息中间件产品 DDMQ](https://blog.didiyun.com/index.php/2019/01/18/ddmq/)\n\n---\n\n# MQ 事务消息\n\n* [为什么会有事务的问题？](https://www.processon.com/diagraming/60f4ce3d5653bb0b488a8c36)\n* 不同 MQ', 966, 'db165411-e677-4ac0-9f9d-32831e000989', 500, 1, 0, NULL, '2025-03-10 12:54:22', NULL, '2025-03-11 09:41:03', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (178, 2, 23, '提供的事务消息能力不同：\n    * RabbitMQ 事务消息：多条消息的一致性，本地事务\n    * Kafka 事务消息：实现 Exactly-Once 的特性\n    * RocketMQ 事务消息：分布式事务，基于 MQ 协调\n    * QMQ 事务消息：分布式事务，基于 MySQL 协调\n\n---\n\n# RocketMQ 事务消息\n\n![阿里云](https://static-aliyun-doc.oss-accelerate.aliyuncs.com/assets/img/zh-CN/1579264061/p177406.png)\n\n* 比较复杂，需要新增两个存储文件（`transaction/statetable` 和 `transaction/redolog` ）。暂时不分享，[源码解析](https://www.iocoder.cn/RocketMQ/message-transaction/?vip)\n* [使用示例](https://github.com/YunaiV/SpringBoot-Labs/blob/master/lab-31/lab-31-rocketmq-demo/src/main/java/cn/iocoder/springboot/lab31/rocketmqdemo/producer/Demo07Producer.java)\n* 存在的问题：1）使用复杂 2）强依赖 MQ；3）强依赖 RocketMQ 的特性\n\n---\n\n# QMQ 事务消息\n\n```Java\nbegin transaction;\ncreateOrder();\nsaveMessageA(); // sendMessageA();\nsaveMessageB(); // snedMessageB();\ncommit transaction;\n\n// 监听事务提交，发送消息\nsendMessageA();\nsnedMessageB();\n\n// 如果提交失败，Job 重试\n```\n\n[官方文档](https://github.com/qunarcorp/qmq/blob/master/docs/cn/transaction.md)\n\n---\n\n# 推荐阅读文章\n\n* 《阿里二面：什么是mmap？》https://zhuanlan.zhihu.com/p/357820303\n* 《谈谈 RocketMQ 消息存储的设计与实现》https://juejin.cn/post/6844903893982248967\n* Linux中的零拷贝 https://www.cnblogs.com/rexcheny/p/12178014.html\n* page', 1143, '3d4d0483-3951-4cbb-9cb0-6357773e0d03', 500, 0, 0, NULL, '2025-03-10 12:54:22', NULL, '2025-03-11 09:41:03', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (179, 2, 23, 'cache与mmap https://www.jianshu.com/p/7044e0b9ab7a\n* 消息中间件—RocketMQ消息存储（一） https://www.jianshu.com/p/b73fdd893f98\n* 消息中间件—RocketMQ消息存储（二） https://www.jianshu.com/p/6d0c118c17de\n* 框架篇：小白也能秒懂的Linux零拷贝原理 https://juejin.cn/post/6887469050515947528\n* 面试官：RocketMQ 如何基于mmap+page cache实现磁盘文件的高性能读写？ https://www.imooc.com/article/301624\n* 文件 IO 操作的一些最佳实践 https://www.cnkirito.moe/file-io-best-practise/\n* 零拷贝技术的原理与在java中应用 https://blog.csdn.net/u022812849/article/details/109805403\n* 论最强IO：MappedByteBuffer VS FileChannel https://blog.csdn.net/alex_xfboy/article/details/90174840\n* Page Cache是怎样产生和释放的？ https://time.geekbang.org/column/article/274106\n\n---', 646, '36b1694f-a5b2-472e-ac87-b1a8ad0f08fa', 308, 0, 0, NULL, '2025-03-10 12:54:22', NULL, '2025-03-11 09:41:03', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (180, 2, 24, '1 广州天凯信息科技有限公司                                                      www.dbs-\nservice.com\n\n1\n\nOracle镜像使用说明\n\n一、 镜像背景\n\n广州天凯信息科技有限公司，是广州少数主打数据库技术服务的企业，主营服务：数据库优化，数据误删恢复，迁\n\n移升级，故障修复等运维服务。拥有资深专业的技术团队，数据库专家平均具备 10年以上大型企业数据库 DBA经验，\n\n具有 OCP,OCM,MySQL,LINUX等专家认证，服务行业涉及金融，税务，交通，电商等关键行业，长期与国内知名企业合\n\n作，累积客户 5000+。我们的服务宗旨是“专业，诚信，可靠”，我们将帮助中小企业低成本获得数据安全保障，为企\n\n业数据安全做长远规划，从企业的利益出发，给企业带来价值！欢迎各界企业客户咨询合作。\n\n为了提高客户 IT系统的上云效率，给客户环境部署带来便利，我方推出了镜像产品服务，而我们主要针对数据库集\n\n成方面，做了更专业更周到的部署集成服务，以下是我们的镜像产品说明。\n\n二、 镜像说明\n\n(一) 镜像简介\n\n本镜像系统预安装了 Oracle官方企业版，并升级更新最新发布补丁包程序，修复了安全漏洞同时，并对数据库配置\n\n做了调整优化，可当作数据库服务器可直接使用或上线。本镜像有以下亮点。\n\n● 官方企业版：镜像采用主', 601, '645e77ba-b7fd-460f-a8cd-197f2f198d3e', 499, 0, 0, NULL, '2025-03-10 12:59:10', NULL, '2025-03-11 09:41:03', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (181, 2, 24, '流 Centos7.8系统，预安装官方 Oracle11gR2企业版数据库，功能完整，稳定性有保障;\n\n● 安全保障：在 Oracle11.2.0.4安装完成后，更新了 2020年 4月 20日最新发布的补丁包，修复了此版本以往所有\n\n安全漏洞与 BUG，可应对各种等保漏扫软件;\n\n● 配置优化：对 Oracle内存参数，性能参数，REDO成员，开机自启动等方面做了一系列优化，满足了上线的要求\n\n● 预安装了高版本 Oracle EM或 PLSQL Developer软件，方便数据库管理使用；\n\n● 技术支持：对镜像使用有任何疑问或技术问题，提供免费技术支持，售后无忧。\n\n2 广州天凯信息科技有限公司                                                      www.dbs-\nservice.com\n\n2\n\n(二) 使用须知\n\n2.1 修改监听 IP地址\n\n当使用本镜像安装系统后，监听程序由于绑定了旧 IP所以无法正常启动，需要修改\n\n$ORACLE_HOME/network/admin下的 listener.ora文件，将里面 HOST=后面的主机名修改成服务器本身设置的主机\n\n名，同时检查/etc/hosts的主机记录，确保正确的对应关系，可参考下面条目：\n\n127.0.0.1       localhost       localhost.localdomain   localhost4      localhost4.localdomain4\n\n::1             localhost       localhost.localdomain   localhost6      localhost6.localdomain6\n\n172.17.252.242  db-server       db-server\n\n当修改完以上配置后，重启监听程序即可！\n\n2.2 修改 LOCAL_LISTENER参数\n\n若上面配置无法解决，需重新设置以下 LOCAL_LISTENER 参数，调整方法：\n\nSqlplus / as sysdba登陆执行：\n\nALTER SYSTEM SET LOCAL_LISTENER=\'(ADDRESS=(PROTOCOL=TCP)(HOST', 977, '1b2d4910-aff3-417d-b55f-fca3594afc1d', 500, 0, 0, NULL, '2025-03-10 12:59:10', NULL, '2025-03-11 09:41:03', b'0', 1);
INSERT INTO `ai_knowledge_segment` VALUES (182, 2, 24, '=新 IP 地址)(PORT=1521))\';\n\n最后再次重启监听程序即可解决！\n\n2.3 修改 TNSNAMES.ORA\n\n当监听程序启动正常后，若服务器内部需要引用 TNSNAMES.ORA文件连接数据库，还需要将此文件里的 HOST改\n\n成新主机名。\n\n2.4 数据库登陆方式\n\n本镜像还预安装了 Oracle EM数据库管理后台（地址：https://你的 IP:5500/em或 http://你的 IP:5500/em）和\n\nPLSQL Developer软件（已激活,主要针对 windows server环境），数据库登陆信息文件保存在桌面或 Linux环境的\n\n/home/oracle/Orapwd.txt;\n\n(三) 软件/平台\n\n本镜像系统采用 CentOS7.8 64位，预安装数据库版本 Oracle11.2.0.4 企业版 \n\n3 广州天凯信息科技有限公司                                                      www.dbs-\nservice.com\n\n3\n\n(四) 最低配置\n\n本镜像环境：CPU:2核心  内存：4G  系统盘：100G\n\n注意：若低于此配置，需要修改内存参数才能启动.\n\n(五) 售后支持\n\n1，免费技术支持：对镜像部署有疑问或使用过程存在问题，欢迎咨询阿里旺旺、手机或工单方式与我们联系。\n\n2，收费人工支持：若涉及非镜像以外的数据库技术问题，如有数据库误删恢复，数据库故障排查，性能优化，代\n\n运维等技术服务需求，请在我方云市场购买我们服务，也可直接进入我方店铺找到 Oracle技术服务商品进行购\n\n买合作。', 710, '64d94497-e192-4f73-b5d7-6e3d623c356c', 474, 0, 0, NULL, '2025-03-10 12:59:10', NULL, '2025-03-11 09:41:03', b'0', 1);
